INSERT INTO `m_kategorikegiatan` (`id`, `server_id`, `kategorikegiatan`, `pelatihan_id`, `sosialisasi_id`, `pameran_id`, `fasilitasi_id`, `created`, `modified`, `ipaddress`, `dataactive`) VALUES
