INSERT INTO `m_kbli` (`id`, `server_id`, `kode`, `direktorat_id`, `kode2009`, `kbli2009_id`, `kbli`, `deskripsi`, `created`, `modified`, `ipaddress`, `dataactive`) VALUES
(1, 0, '10110', 1, '10110', 1, 'KEGIATAN RUMAH POTONG DAN PENGEPAKAN DAGING BUKAN UNGGAS', 'mencakup kegiatan pemotongan, pengulitan, pembersihan dan pengepakan daging, seperti daging sapi, babi, biri-biri, kelinci, domba, unta dan daging segar lainnya bukan unggas, kegiatan pengurusan hasil sampingan, seperti produksi kulit dan jangat dari tempat pemotongan hewan termasuk fellmongery, penjemuran tulang, pengolahan sisaan atau kotoran hewan, penyortiran wol dan bulu dan pembersihan lemak. Termasuk kegiatan pemotongan dan pengolahan paus di darat atau di kapal khusus.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(2, 0, '10120', 1, '10120', 2, 'KEGIATAN RUMAH POTONG DAN PENGEPAKAN DAGING UNGGAS', 'mencakup kegiatan operasional rumah potong unggas dan pengepakan daging unggas, termasuk kegiatan pengurusan hasil sampingan, seperti pemrosesan sisa atau kotoran unggas, pementangan kulit, penyortiran bulu dan pembersihan lemak.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(3, 0, '10130', 1, '10130', 3, 'INDUSTRI PENGOLAHAN DAN PENGAWETAN PRODUK DAGING DAN DAGING UNGGAS', 'mencakup usaha pengolahan dan pengawetan produk daging dan daging unggas dengan cara pengalengan, pengasapan, penggaraman, pembekuan, pemanisan dan sebagainya. Kegiatannya mencakup produksi daging beku dalam bentuk carcase, produksi daging beku yang telah dipotong, produksi daging beku dalam porsi tersendiri, produksi daging yang dikeringkan, daging yang diasinkan atau daging yang diasapkan, produksi produk-produk daging, seperti sosis, salami, puding, andovillettes, saveloy, bologna, patc, rillet, dan daging ham. Termasuk kegiatan pengolahan daging paus di darat atau di kapalkhusus.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(4, 0, '10211', 1, '10211', 4, 'INDUSTRI PENGGARAMAN/PENGERINGAN IKAN', 'mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses penggaraman/pengeringan, seperti ikan tembang asin, ikan teri asin, dan ikan kering tawar.mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses penggaraman/pengeringan, seperti ikan tembang asin, ikan teri asin, dan ikan kering tawar.mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses penggaraman/pengeringan, seperti ikan tembang asin, ikan teri asin, dan ikan kering tawar.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(5, 0, '10212', 1, '10212', 5, 'INDUSTRI PENGASAPAN/PEMANGGANGAN IKAN', 'mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pengasapan/pemanggangan seperti ikan bandeng asap, ikan julung-julung/roa asap, ikan fufu/asar asap, ikan lele asap, dan ikan patin asap.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(6, 0, '10213', 1, '10213', 6, 'INDUSTRI PEMBEKUAN IKAN', 'mencakup usaha pengawetan ikan (bersirip/pisces) melalui proses pembekuan, seperti ikan bandeng beku, ikan tuna/cakalang beku dan kakap beku. Termasuk juga ikan utuh maupun dipotong (fillet, loin, saku, steak, chunk, brown meat) yang dibekukan.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(7, 0, '10214', 1, '10214', 7, 'INDUSTRI PEMINDANGAN IKAN', 'mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pemindangan, seperti pindang bandeng/paso, pindang tongkol, pindang cuwe, pindang naya, pindang lemuru/tembang, pindang layang, dan pindang cakalang.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(8, 0, '10215', 1, '10215', 0, 'INDUSTRI PERAGIAN/FERMENTASI IKAN', 'mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses peragian/fermentasi, seperti peragian/fermentasi peda dan ikan kayu.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(9, 0, '10216', 1, '10216', 0, 'INDUSTRI BERBASIS DAGING LUMATAN DAN SURIM', 'mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pelumatan daging ikan/penggilingan. Termasuk industri daging lumat yang dicampur bahan tambahan melalui proses pemasakan atau tidak dimasak kemudian dibekukan. Contoh berbasis daging lumatan dan surimi: mata goyang, kurisi, dll. Berbasis surimi: baso, nuget, otak2, kamaboko, sosis, pempek, siomay, dimsum, chikuwa, imitation crab.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(10, 0, '10217', 1, '10217', 0, 'INDUSTRI PENDINGINAN/PENGESAN IKAN', 'mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) melalui proses pendinginan/pengesan.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(11, 0, '10219', 1, '10219', 8, 'INDUSTRI PENGOLAHAN DAN PENGAWETAN LAINNYA UNTUK IKAN', 'mencakup usaha pengolahan dan pengawetan ikan (bersirip/pisces) dengan cara selain yang tercakup dalam kelompok 10211 s.d. 10218. Termasuk kegiatan kapal yang digunakan hanya untuk pengolahan dan pengawetan ikan dan biota air lainnya (dalam hal ini tidak termasuk pengalengannya), produksi tepung ikan untuk konsumsi manusia dan makanan hewan dan produksi daging dan bagian dari ikan bukan untuk konsumsi manusia, konsentrat tepung ikan.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(12, 0, '10221', 1, '10221', 9, 'INDUSTRI PENGOLAHAN DAN PENGAWETAN IKAN DAN BIOTA AIR (BUKAN UDANG) DALAM KALENG', 'mencakup usaha pengolahan dan pengawetan ikan dan biota perairan lainnya kecuali udang melalui proses pengalengan, seperti ikan sardencis dalam kaleng, kerang dalam kaleng, lemuru dalam kaleng, mackarel dalam kaleng, cephalopoda (cumi/gurita/sotong) dalam kaleng, tuna dalam kaleng, rajungan/kepiting dalam kaleng. Termasuk kegiatan kapal pengolah ikan yang hanya melakukan pengolahan dan pengawetan dalam kaleng (tanpa melakukan kegiatan penangkapan).', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(13, 0, '10222', 1, '10222', 10, 'INDUSTRI PENGOLAHAN DAN PENGAWETAN UDANG DALAM KALENG', 'mencakup usaha pengolahan dan pengawetan udang melalui proses pengalengan (udang dalam kaleng). Termasuk kegiatan kapal pengolah udang yang hanya melakukan pengolahan dan pengawetan dalam kaleng (tanpa melakukan kegiatan penangkapan).', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(14, 0, '10291', 1, '10291', 11, 'INDUSTRI PENGGARAMAN/PENGERINGAN BIOTA AIR LAINNYA', 'mencakup usaha pengolahan dan pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses penggaraman/pengeringan, seperti udang asin, cumi-cumi asin, ebi, ubur-ubur asin, sotong asin, teripang kering, sotong kering, dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(15, 0, '10292', 1, '10292', 12, 'INDUSTRI PENGASAPAN/PEMANGGANGAN BIOTA AIR LAINNYA', 'mencakup usaha pengolahan dan pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses pengasapan/pemanggangan, seperti sotong asap/panggang, teripang asap/panggang.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(16, 0, '10293', 1, '10293', 13, 'INDUSTRI PEMBEKUAN BIOTA AIR LAINNYA', 'mencakup usaha pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses pembekuan, seperti udang beku, paha kodok beku, cephalopoda (cumi/sotong/gurita) beku, kepiting/rajungan beku, dan kerang beku.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(17, 0, '10294', 1, '10294', 14, 'INDUSTRI PEMINDANGAN BIOTA AIR LAINNYA', 'mencakup usaha pengolahan dan pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses pemindangan.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(18, 0, '10295', 1, '10295', 0, 'INDUSTRI PERAGIAN/FERMENTASI BIOTA AIR LAINNYA', 'mencakup usaha pengolahan dan pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses peragian/fermentasi.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(19, 0, '10296', 1, '10296', 0, 'INDUSTRI BERBASIS LUMATAN BIOTA AIR LAINNYA', 'mencakup usaha pengolahan dan pengawetan biota air lainnya melalui proses pelumatan daging/penggilingan/pencampuran bahan tambahan/pengukusan, seperti lumatan cumi, lumatan udang, baso udang, baso cumi, baso kepiting, dan kaki naga udang.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(20, 0, '10297', 1, '10297', 0, 'INDUSTRI PENDINGINAN/PENGESAN BIOTA AIR LAINNYA', 'mencakup usaha pengolahan dan pengawetan crustacea, mollusca dan biota perairan lainnya melalui proses pendinginan/pengesan, seperti cumi segar, kerang segar, teripang segar, dan kepiting segar.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(21, 0, '10298', 1, NULL, 0, 'INDUSTRI PENGOLAHAN RUMPUT LAUT', 'mencakup usaha pengolahan rumput laut menjadi rumput laut kering olahan (alkali treated caragenan chips), gelatin, agar-agar, karagenan dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(22, 0, '10299', 1, '10299', 15, 'INDUSTRI PENGOLAHAN DAN PENGAWETAN LAINNYA UNTUK BIOTA AIR LAINNYA', 'mencakup usaha pengolahan dan pengawetan crustacea, mollusca dan biota perairan lainnya dengan cara selain yang tercakup dalam kelompok 10291 s.d. 10298, seperti tepung udang, tepung kerang, dan tepung kodok.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(23, 0, '10311', 1, '10311', 16, 'INDUSTRI PENGASINAN/PEMANISAN BUAH-BUAHAN DAN SAYURAN', 'mencakup usaha pengawetan buah-buahan dan sayuran dengan proses pengasinan/pemanisan, baik dalam bentuk kemasan ataupun tidak, seperti asinan kedondong, asinan wortel, manisan pala dan manisan mangga.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(24, 0, '10312', 1, '10312', 17, 'INDUSTRI PELUMATAN BUAH-BUAHAN DAN SAYURAN', 'mencakup usaha pengawetan buah-buahan dan sayuran dengan proses pelumatan, baik dalam bentuk kemasan ataupun tidak, seperti selai mangga, jelly murbai, dan cabe giling.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(25, 0, '10313', 1, '10313', 18, 'INDUSTRI PENGERINGAN BUAH-BUAHAN DAN SAYURAN', 'mencakup usaha pengawetan buah-buahan dan sayuran dengan cara pengeringan, baik dalam bentuk kemasan ataupun tidak, seperti kismis (anggur), bawang merah, bawang putih, cabe kering, rebung kering dan jamur kering.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(26, 0, '10314', 1, '10314', 19, 'INDUSTRI PEMBEKUAN BUAH-BUAHAN DAN SAYURAN', 'mencakup usaha pengawetan buah-buahan dan sayuran dengan proses pembekuan, seperti buah-buahan beku dan sayur-sayuran beku.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(27, 0, '10320', 1, '10320', 20, 'INDUSTRI PENGOLAHAN DAN PENGAWETAN BUAH-BUAHAN DAN SAYURAN DALAM KALENG', 'mencakup usaha pengolahan dan pengawetan buah-buahan dan sayuran melalui proses pengalengan, seperti nanas dalam kaleng, rambutan dalam kaleng, kacang dalam kaleng dan wortel dalam kaleng. Yang dimaksud pengalengan di sini merupakan proses pengawetan dan bukan hanya pengemasan.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(28, 0, '10330', 1, '10330', 21, 'INDUSTRI PENGOLAHAN SARI BUAH DAN SAYURAN', 'mencakup usaha pengawetan buah-buahan dan sayuran dengan cara pengolahan sari buah-buahan dan sayuran, seperti bubuk sari buah-buahan, air/sari pekat buah buahan dan air/sari pekat sayuran.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(29, 0, '10391', 1, '10391', 22, 'INDUSTRI TEMPE KEDELAI', 'mencakup usaha pembuatan tempe dari kedelai.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(30, 0, '10392', 1, '10392', 23, 'INDUSTRI TAHU KEDELAI', 'mencakup usaha pembuatan tahu dari kedelai.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(31, 0, '10399', 1, '10399', 24, 'INDUSTRI PENGOLAHAN DAN PENGAWETAN LAINNYA BUAH-BUAHAN DAN SAYURAN', 'mencakup usaha pengawetan buah-buahan dan sayuran dengan cara selain yang tercakup dalam subgolongan 1031 s.d. 1033, seperti industri pengupasan kentang dan produksi konsentrat dari buah dan sayuran segar, termasuk tempe bongkrek', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(32, 0, '10411', 1, '10411', 25, 'INDUSTRI MINYAK MENTAH DAN LEMAK NABATI', 'mencakup usaha pengolahan bahan-bahan dari nabati menjadi minyak mentah (crude oil) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain (kecuali minyak mentah kelapa sawit (crude plam oil) dan minyak mentah kelapa) termasuk juga industri hasil lemak dari nabati yang dapat digunakan sebagai bahan makanan, seperti minyak bunga matahari.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(33, 0, '10412', 1, '10412', 26, 'INDUSTRI MARGARINE', 'mencakup usaha pembuatan margarine dari minyak makan nabati.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(34, 0, '10413', 1, '10413', 27, 'INDUSTRI MINYAK MENTAH DAN LEMAK HEWANI SELAIN IKAN', 'mencakup usaha pengolahan bahan-bahan dari hewani selain ikan menjadi minyak mentah dan lemak hewani, seperti minyak/lemak babi, lemak sapi dan lemak unggas.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(35, 0, '10414', 1, '10414', 0, 'INDUSTRI MINYAK IKAN', 'mencakup usaha pembuatan minyak yang berbahan baku dari badan ikan yang berlemak tinggi, seperti lemuru, atau dari organ badan ikan seperti hati cucut. Mencakup juga industri minyak yang dihasilkan dari hasil sampingan pengalengan ikan, seperti hasil pengalengan sarden.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(36, 0, '10415', 1, '10415', 0, 'INDUSTRI MINYAK GORENG BUKAN MINYAK KELAPA DAN MINYAK KELAPA SAWIT', 'mencakup usaha pembuatan minyak goreng lainnya, bukan minyak goreng kelapa dan minyak goreng kelapa sawit, seperti minyak bekatul, minyak goreng babi dan minyak goreng unggas.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(37, 0, '10421', 1, '10421', 28, 'INDUSTRI KOPRA', 'mencakup usaha pembuatan kopra.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(38, 0, '10422', 1, '10422', 29, 'INDUSTRI MINYAK MENTAH KELAPA', 'mencakup usaha pengolahan kelapa menjadi minyak mentah (crude oil) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(39, 0, '10423', 1, '10423', 30, 'INDUSTRI MINYAK GORENG KELAPA', 'mencakup usaha pengolahan lebih lanjut (pemurnian, pemucatan dan penghilangan bau yang tidak dikehendaki) dari minyak mentah kelapa menjadi minyak goreng kelapa.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(40, 0, '10424', 1, '10424', 31, 'INDUSTRI TEPUNG DAN PELET KELAPA', 'mencakup usaha pengolahan lebih lanjut kelapa, seperti tepung dan pelet kelapa.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(41, 0, '10431', 1, '10431', 32, 'INDUSTRI MINYAK MENTAH KELAPA SAWIT (CRUDE PALM OIL)', 'mencakup usaha pengolahan kelapa sawit menjadi minyak mentah (Crude Palm Oil/CPO) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(42, 0, '10432', 1, '10432', 33, 'INDUSTRI MINYAK MENTAH INTI KELAPA SAWIT (CRUDE PALM KERNEL OIL)', 'mencakup usaha pengolahan inti kelapa sawit menjadi minyak mentah inti (Crude Palm Kernel Oil/CPKO) yang masih perlu diolah lebih lanjut dan biasanya produk ini dipakai oleh industri lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(43, 0, '10433', 1, NULL, 0, 'INDUSTRI PEMISAHAN/FRAKSINASI MINYAK MENTAH KELAPA SAWIT DAN MINYAK MENTAH INTI KELAPA SAWIT', 'mencakup pemisahan fraksi padat dan fraksi cair dari minyak mentah kelapa sawit menjadi minyak mentah kelapa sawit olein (Crude Palm Olein) dan minyak mentah kelapa sawit stearin (Crude Palm Stearin) atau dari minyak mentah inti kelapa sawit menjadi minyak mentah inti kelapa sawit olein (Crude Palm Kernel Olein) dan minyak mentah inti kelapa sawit stearin (Crude Palm Kernel Stearin) yang masih perlu diolah lebih lanjut.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(44, 0, '10434', 1, NULL, 0, 'INDUSTRI PEMURNIAN MINYAK MENTAH KELAPA SAWIT DAN MINYAK MENTAH INTI KELAPA SAWIT', 'mencakup pemurnian minyak mentah dari kelapa sawit menjadi minyak murni kelapa sawit (Refined Bleached Deodorized Palm Oil) atau dari minyak inti kelapa sawit menjadi minyak murni inti kelapa sawit (Refined Bleached Deodorized Palm Kernel Oil) yang masih perlu diolah lebih lanjut.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(45, 0, '10435', 1, NULL, 0, 'INDUSTRI PEMISAHAN/FRAKSINASI MINYAK MURNI KELAPA SAWIT', 'mencakup usaha pemisahan fraksi padat dan fraksi cair dari minyak murni kelapa sawit menjadi miyak murni kelapa sawit olein (Refined Bleached Deodorized Palm Olein) dan minyak murni kelapa sawit stearin (Refined Bleached Deodorized Palm Stearin).', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(46, 0, '10436', 1, NULL, 0, 'INDUSTRI PEMISAHAN/FRAKSINASI MINYAK MURNI INTI KELAPA SAWIT', 'mencakup usaha pemisahan fraksi padat dan fraksi cair dari minyak murni inti kelapa sawit menjadi minyak murni inti kelapa sawit olein (Refined Bleached Deodorized Palm Kernel Olein) dan miyak murni inti kelapa sawit stearin (Refined Bleached Deodorized Palm Kernel Stearin).', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(47, 0, '10437', 1, NULL, 0, 'INDUSTRI MINYAK GORENG KELAPA SAWIT', 'mencakup usaha pengolahan lebih lanjut (pemurnian, pemucatan dan penghilangan bau yang tidak dikehendaki) dari minyak mentah kelapa sawit (CPO) menjadi minyak goreng kelapa sawit.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(48, 0, '10490', 1, '10490', 34, 'INDUSTRI MINYAK MENTAH DAN LEMAK NABATI DAN HEWANI LAINNYA', 'mencakup usaha pengolahan lainnya untuk minyak dan lemak, yang belum tercakup pada subgolongan 1041 s.d. 1043, seperti industri shorterning (minyak roti), industri minyak dan lemak dari binatang yang tidak dapat dimakan, produksi (linter) sisaan kapas, bungkil atau ampas dan hasil sisaan lainnya dari produksi minyak dan penyulingan minyak dari ikan dan mamalia laut.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(49, 0, '10510', 1, '10510', 35, 'INDUSTRI PENGOLAHAN SUSU SEGAR DAN KRIM', 'mencakup usaha Iidustri pengolahan susu cair segar, susu dipasteurisasi, disterilisasi, homogenisasi dan atau pemanasan ultra (UHT) dan industri pengolahan krim dari susu cair segar, pasteurisasi, sterilisasi dan homogenisasi.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(50, 0, '10520', 1, '10520', 36, 'INDUSTRI PENGOLAHAN SUSU BUBUK DAN SUSU KENTAL', 'mencakup usaha industri pengolahan susu bubuk atau susu kental dengan pemanis atau tidak dan industri pengolahan susu atau krim dalam bentuk yang padat.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(51, 0, '10531', 1, '10531', 37, 'INDUSTRI PENGOLAHAN ES KRIM', 'mencakup usaha pembuatan berbagai macam es krim yang bahan utamanya dari susu.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(52, 0, '10532', 1, '10532', 38, 'INDUSTRI PENGOLAHAN ES SEJENISNYA YANG DAPAT DIMAKAN (BUKAN ES BATU DAN ES BALOK)', 'mencakup usaha pembuatan berbagai macam es yang bahan utamanya bukan dari susu, seperti sorbet, es lilin, ice drop, es dengan berbagai rasa lainnya, es mambo dan es puter.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(53, 0, '10590', 1, '10590', 39, 'INDUSTRI PENGOLAHAN PRODUK DARI SUSU LAINNYA', 'mencakup usaha pengolahan produk dari susu lainnya, seperti mentega, yoghurt, keju dan dadih, air dadih, kaseinatau laktosa (susu manis) dan bubuk es krim.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(54, 0, '10611', 1, '10611', 40, 'INDUSTRI PENGGILINGAN GANDUM DAN SERELIA LAINNYA', 'mencakup usaha penggilingan gandum dan serelia lainnya menjadi tepung dan pelet, seperti gandum dan sorghum, rye, oat dan serelia lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(55, 0, '10612', 1, '10612', 41, 'INDUSTRI PENGGILINGAN ANEKA KACANG (TERMASUK LEGUMINOUS)', 'mencakup usaha pembuatan tepung dari aneka kacang melalui proses penggilingan, seperti tepung tepung kacang hijau, tepung kacang kedelai dan tepung lainnya (seperti dari kacang tanah, kacang merah dan tanaman leguminous lainnya).', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(56, 0, '10613', 1, '10613', 42, 'INDUSTRI PENGGILINGAN ANEKA UMBI DAN SAYURAN (TERMASUK RHIZOMA)', 'mencakup usaha pembuatan tepung dari aneka umbi dan sayuran melalui proses penggilingan, seperti tepung dari ubi kayu (gaplek), ubi jalar, talas, irut, jahe, temulawak, kunyit dan kapulaga dan sayuran.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(57, 0, '10614', 1, '10614', 43, 'INDUSTRI TEPUNG CAMPURAN DAN ADONAN TEPUNG', 'mencakup usaha pembuatan tepung campuran dan adonan tepung yang sudah dicampur untuk roti, kue, biskuit, kue dadar.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(58, 0, '10615', 1, '10615', 44, 'INDUSTRI PENGUPASAN DAN PEMBERSIHAN DAN KACANG-KACANGAN', 'mencakup usaha pembuatan makanan sereal.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(59, 0, '10615', 1, '10615', 44, 'INDUSTRI MAKANAN SEREAL', 'mencakup usaha pembuatan makanan sereal.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(60, 0, '10616', 1, '10616', 45, 'INDUSTRI PENGUPASAN DAN PEMBERSIHAN UMBI-UMBIAN (TERMASUK RIZOMA)', 'mencakup usaha pembuatan tepung terigu.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(61, 0, '10616', 1, '10616', 45, 'INDUSTRI TEPUNG TERIGU', 'mencakup usaha pembuatan tepung terigu.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(62, 0, '10621', 1, '10621', 48, 'INDUSTRI PATI UBI KAYU', 'mencakup usaha pembuatan pati ubi kayu melalui ekstraksi, seperti tepung tapioka.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(63, 0, '10622', 1, '10622', 49, 'INDUSTRI BERBAGAI MACAM PATI PALMA', 'mencakup usaha pembuatan pati dari berbagai macam tanaman suku palma, seperti pati sagu dan pati aren.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(64, 0, '10623', 1, '10623', 50, 'INDUSTRI GLUKOSA DAN SEJENISNYA', 'mencakup usaha pembuatan gula glukosa, selain yang termasuk dalam kelompok 10721 dan 10722, seperti glucosa, fructosa, lactosa, maltosa, sacharosa dan gula stevia.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(65, 0, '10629', 1, '10629', 51, 'INDUSTRI PATI LAINNYA', 'mencakup usaha pembuatan berbagai macam pati melalui proses ekstraksi yang belum termasuk kelompok 10621 s.d. 10623, seperti pati kentang, pati bengkoang, pati temulawak, pati irut dan pati biji mangga.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(66, 0, '10631', 1, '10631', 52, 'INDUSTRI PENGGILINGAN PADI DAN PENYOSOHAN BERAS', 'mencakup usaha penggilingan padi menjadi beras, termasuk penyosohan beras yang terpisah dengan usaha penggilingan padi.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(67, 0, '10632', 1, '10632', 53, 'INDUSTRI PENGGILINGAN DAN PEMBERSIHAN JAGUNG', 'mencakup usaha penggilingan dan pembersihan jagung.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(68, 0, '10633', 1, '10633', 54, 'INDUSTRI TEPUNG BERAS DAN TEPUNG JAGUNG', 'mencakup usaha pembuatan tepung beras dan tepung jagung.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(69, 0, '10634', 1, '10634', 55, 'INDUSTRI PATI BERAS DAN JAGUNG', 'mencakup usaha pembuatan pati beras dan pati jagung (maizena).', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(70, 0, '10710', 1, '10710', 56, 'INDUSTRI PRODUK ROTI DAN KUE', 'mencakup usaha pembuatan berbagai macam roti dan kue, seperti industri roti tawar dan roti kadet; industri kue, pie, tart; industri biskuit dan produk roti kering lainnya; industri pengawetan kue kering dan cake; industri produk makanan ringan (cookies, cracker, kue kering) baik yang manis atau asin; industri tortillas; dan industri produk roti yang dibekukan, seperti pancake, waffle dan roti kadet.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(71, 0, '10721', 1, '10721', 57, 'INDUSTRI GULA PASIR', 'mencakup usaha pembuatan gula yang berbentuk kristal (pasir), bahan utamanya dari tebu, bit ataupun lainnya. Termasuk kegiatan pembuatan sirop yang tergabung dengan pabrik gula dan tidak dapat dipisahkan tersendiri.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(72, 0, '10722', 1, '10722', 58, 'INDUSTRI GULA MERAH', 'mencakup usaha pembuatan gula merah yang tidak berbentuk kristal, dengan bahan utamanya tebu maupun nira (aren, kelapa dan sejenisnya). Termasuk kegiatan pembuatan sirop yang tergabung dengan pabrik gula dan tidak dapat dipisahkan tersendiri.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(73, 0, '10723', 1, '10723', 59, 'INDUSTRI SIROP', 'mencakup usaha pengolahan gula menjadi sirop, seperti industri sirup gula dan produksi sirup dan gula maple.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(74, 0, '10729', 1, '10729', 60, 'INDUSTRI PENGOLAHAN GULA LAINNYA BUKAN SIROP', 'mencakup usaha pengolahan gula ke dalam bentuk lain, termasuk pembuatan gula batu, tepung gula, gula pengganti dari jus tebu, bit, maple dan kelapa, nira, aren dan molasse (harum manis).', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(75, 0, '10731', 1, '10731', 61, 'INDUSTRI KAKAO', 'mencakup usaha pengolahan biji kakao menjadi bubuk kakao, lemak kakao, pasta kakao, dan bungkil kakao.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(76, 0, '10732', 1, '10732', 62, 'INDUSTRI MAKANAN DARI COKELAT DAN KEMBANG GULA', 'mencakup usaha pembuatan segala macam makanan yang bahan utamanya dari cokelat seperti cokelat dan gula-gula dari cokelat dan pembuatan segala macam kembang gula seperti caramel, cachous, nougat, fondant dan cokelat putih. Termasuk industri minuman dari cokelat dalam bentuk bubuk maupun cair.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(77, 0, '10733', 1, '10733', 63, 'INDUSTRI MANISAN BUAH-BUAHAN DAN SAYURAN KERING', 'mencakup usaha pengawetan buah-buahan dan sayuran baik buah, kacang, kulit buah dan bagian lain dari tumbuhan dengan proses pengasinan/pemanisan dan pengeringan, baik dalam bentuk kemasan ataupun tidak, seperti manisan pala dan manisan mangga kering, sayuran dan buah-buahan kering lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(78, 0, '10739', 1, '10739', 64, 'INDUSTRI KEMBANG GULA LAINNYA', 'mencakup usaha industri kembang gula lainnya, seperti permen karet dan permen obat batuk dan pastilles.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(79, 0, '10740', 1, '10740', 65, 'INDUSTRI MAKARONI, MIE DAN PRODUK SEJENISNYA', 'mencakup usaha pembuatan makaroni, mie, spagheti, bihun, soun dan sejenisnya, baik dimasak atau tidak dalam bentuk basah maupun kering. Termasuk industri couscous dan industri produk pasta yang dibekukan atau dikalengkan.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(80, 0, '10750', 1, '10750', 66, 'INDUSTRI MAKANAN DAN MASAKAN OLAHAN', 'mencakup industri makanan siap saji (diolah, dibumbui dan dimasak) diolah untuk tujuan diawetkan dalam kaleng atau dibekukan dan biasanya dikemas dan dilabel untuk dijual kembali. Mencakup juga industri masakan daging atau unggas, industri masakan ikan (kecuali masakan ikan dan udang dalam kaleng), industri masakan sayuran siap saji, industri masakan rebusan dalam kaleng dan makanan di dalam wadah hampa udara dan industri masakan siap saji yang lain. Termasuk industri pizza beku, pepes, presto, dendeng ikan, baby fish goreng/crispy ikan, udang tepung dan ikan tepung.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(81, 0, '10761', 1, '10761', 67, 'INDUSTRI PENGOLAHAN KOPI', 'mencakup usaha penyangraian, penggilingan dan pensarian (ekstraksi) kopi menjadi berbagai macam bubuk atau cairan, seperti kopi sangrai, kopi bubuk, kopi instan, ekstrak dan sari kopi. Termasuk industri pengganti pengganti.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(82, 0, '10762', 1, '10762', 68, 'INDUSTRI PENGOLAHAN HERBAL (HERB INFUSION)', 'mencakup usaha pengolahan herbal (mint, vervain, chamomil). Termasuk industri makanan suplemen dari herbal.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(83, 0, '10763', 1, NULL, 0, 'INDUSTRI PENGOLAHAN TEH', 'mencakup usaha pengolahan daun teh menjadi teh. Termasuk kegiatan pencampuran teh dan mate, industri ekstraksi dan olahan berbahan dasar teh dan mate.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(84, 0, '10771', 1, '10771', 69, 'INDUSTRI KECAP', 'mencakup usaha pembuatan kecap dari kedele/kacang-kacangan lainnya, termasuk kecap ikan dan pembuatan tauco (baik dari kedelai/kacang-kacangan lainnya yang masih segar, maupun dari hasil sisa pembuatan kecap).', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(85, 0, '10772', 1, '10772', 70, 'INDUSTRI BUMBU MASAK DAN PENYEDAP MASAKAN', 'mencakup usaha pembuatan bumbu masak dalam keadaan sudah diramu atau belum, baik berbentuk bubuk ataupun lainnya, seperti bumbu gulai, bumbu kari, bumbu merica, bubuk jahe, bubuk jinten, bubuk pala, bubuk cabe dan bubuk kayu manis. Termasuk usaha industri penyedap masakan baik yang asli, natura maupun sintesa khemis, seperti vetsin dan serbuk panili dan industri bumbu-bumbu, saus dan rempah-rempah, seperti mayonais, tepung mustar, mustar olahan, sauce tomat, dan sauce selada.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(86, 0, '10773', 1, '10773', 71, 'INDUSTRI PRODUK MASAK DARI KELAPA', 'mencakup usaha pembuatan produk masak dari kelapa yang belum tercakup dalam golongan manapun, seperti santan pekat dan santan cair, kecap kelapa, sari kelapa (nata de coco), kelapa parut kering (dicicated coconut) dan krim kelapa.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(87, 0, '10774', 1, '10774', 72, 'INDUSTRI PENGOLAHAN GARAM', 'mencakup usaha pengolahan garam dapur.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(88, 0, '10779', 1, '10779', 73, 'INDUSTRI PRODUK MASAK LAINNYA', 'mencakup usaha pembuatan petis, saus tiram, terasi, khitin/khitosan, atau yang sejenisnya, dengan bahan baku utamanya ikan dan udang ataupun bagian-bagiannya, industri madu dan karamel buatan, industri ekstraksi dan jus dari daging dan ikan, industri konsentrat buatan/pembuatan macam-macam makanan yang belum tercakup dalam golongan manapun, seperti cincau, gist, baking powder, essence dan cuka makan. Termasuk usaha pembuatan tempe dari kacang-kacangan lainnya dan oncom (dari kacang tanah/kacang-kacangan lainnya), seperti tempe bongkrek, tempe gembus. Tidak termasuk industri tempe dan tahu kedelai.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(89, 0, '10791', 1, '10791', 74, 'INDUSTRI MAKANAN BAYI', 'mencakup usaha pembuatan makanan bayi, seperti formula bayi, susu lanjutan dan makanan lanjutan lainnya, makanan bayi dan makanan yang mengandung bahan yang dihomogenisasi.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(90, 0, '10792', 1, '10792', 75, 'INDUSTRI KUE BASAH', 'mencakup usaha pembuatan macam-macam makanan kue basah, yaitu sejenis kue yang relatif tidak tahan lama, seperti wajik, lemper, kue lapis, lumpia, dan martabak (termasuk pembuatan tape dan dodol).', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(91, 0, '10793', 1, '10793', 76, 'INDUSTRI MAKANAN DARI KEDELE DAN KACANG-KACANGAN LAINNYA BUKAN KECAP, TEMPE DAN TAHU', 'mencakup usaha pembuatan makanan dari kedele/kacang-kacangan lainnya bukan kecap dan tempe, seperti keripik/peyek dari kacang-kacangan, daging sintetis, kacang kapri, kacang asin, kacang telur, kacang sukro, kacang bogor, kacang atom, kacang mete dan enting-enting.', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(92, 0, '10794', 1, '10794', 77, 'INDUSTRI KERUPUK, KERIPIK, PEYEK DAN SEJENISNYA', 'mencakup usaha industri berbagai macam kerupuk, keripik, peyek dan sejenisnya, seperti kerupuk udang, kerupuk ikan dan kerupuk pati (kerupuk terung). Dan usaha pembuatan berbagai macam makanan sejenis kerupuk, seperti macam-macam emping, kecimpring, karak, gendar, opak, keripik paru, keripik bekicot dan keripik kulit, peyek teri, peyek udang. Kegiatan atau usaha pembuatan keripik/peyek dari kacang kacangan dimasukkan dalam kelompok 10793', '2017-03-12 22:18:29', '2017-05-30 21:13:44', NULL, 1),
(93, 0, '10795', 1, NULL, 0, 'INDUSTRI KRIMER NABATI', 'mencakup usaha pembuatan krimer nabati emulsi lemak nabati yang berasal dari kelapa atau kelapa sawit yang digunakan sebagai campuran makanan atau minuman', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(94, 0, '10799', 1, '10799', 78, 'INDUSTRI PRODUK MAKANAN LAINNYA', 'mencakup usaha pembuatan produk makanan lainnya, seperti telur asin, soup dan kaldu, makanan yang tidak tahan lama, seperti sandwich, pizza mentah dan lainnya. Termasuk industri ragi, susu dan keju pengganti dari selain susu dan produk telur dan albumin telur.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(95, 0, '10801', 1, '10801', 79, 'INDUSTRI RANSUM MAKANAN HEWAN', 'mencakup usaha pembuatan berbagai macam ransum pakan ternak, unggas, ikan dan hewan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(96, 0, '10802', 1, '10802', 80, 'INDUSTRI KONSENTRAT MAKANAN HEWAN', 'mencakup usaha pembuatan konsentrat pakan ternak, unggas dan hewan lainnya. Pengolahan konsentrat pakan ternak, unggas dan hewan lainnya yang tidak dapat di pisahkan dari usaha peternakan dimasukkan dalam golongan 014(Peternakan).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(97, 0, '11010', 1, '11010', 81, 'INDUSTRI MINUMAN BERALKOHOL HASIL DESTILASI', 'mencakup industri pengolahan minuman yang menggunakan bahan baku alkohol (ethyl alcohol) dengan proses destilasi dengan kadar 20%-55%, seperti whisky, brandy, rum, gin, liqueurs, tidak termasuk residu sulphite dari pabrik pulp dan pencampuran minuman beralkohol, termasuk produk minuman beralkohol netral (tanpa rasa/flavor). Industri alkohol murni dimasukkan dalam kelompok 20115. Usaha pembotolan saja, tanpa melakukan usaha pengolahan minuman dimasukkan dalam kelompok 82920.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(98, 0, '11020', 1, '11020', 82, 'INDUSTRI MINUMAN BERALKOHOL HASIL FERMENTASI ANGGUR DAN HASIL PERTANIAN LAINNYA', 'mencakup industri pengolahan minuman secara fermentasi dengan bahan baku anggur, apel, buah-buahan lain atau hasil pertanian lainnya, seperti beras, sayuran, daun, batang dan akar (kecuali malt). Kegiatan yang tercakup adalah industri minuman anggur, sparkling wine, minuman anggur dari sari anggur, fermentasi tanpa destilasi minuman beralkohol, seperti sake, sari buah apel, perry, mead, minuman anggur dari buah lain dan minuman campuran yang mengandung alkohol, minuman anggur putih dan sejenisnya, pencampuran minuman anggur dan minuman anggur beralkohol rendah atau tidak beralkohol. Usaha pembotolan saja tanpa melakukan usaha pengolahan minuman dimasukkan dalam kelompok 82920.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(99, 0, '11031', 1, NULL, 0, 'INDUSTRI MINUMAN BERALKOHOL HASIL FERMENTASI MALT', 'mencakup industri minuman beralkohol dari malt, seperti bir, ale, porter dan stout. Usaha pembotolan saja tanpa melakukan usaha pengolahan minuman dimasukkan dalam kelompok 82920. Termasuk Industri bir beralkohol rendah atau tanpa alkohol.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(100, 0, '11032', 1, NULL, 0, 'INDUSTRI MALT', 'mencakup industri pembuatan malt (kecambah barley atau sereal lainnya yang dikeringkan).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(101, 0, '11040', 1, '11040', 84, 'INDUSTRI MINUMAN RINGAN', 'mencakup usaha industri minuman yang tidak mengandung alkohol, kecuali bir dan anggur tanpa alkohol. Termasuk industri minuman ringan beraroma tanpa alkohol dan atau rasa manis, seperti lemonade, orangeade, cola, minuman buah, air tonik, limun, air soda, krim soda dan air anggur.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(102, 0, '11050', 1, '11050', 85, 'INDUSTRI AIR MINUM DAN AIR MINERAL', 'mencakup usaha pembuatan air minum dalam kemasan dan air mineral, air mineral alami, air demineral, termasuk industri air isi ulang.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(103, 0, '11090', 1, '11090', 86, 'INDUSTRI MINUMAN LAINNYA', 'mencakup usaha Industri minuman lainnya, seperti minuman penyegar, nira, dan air tebu.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(104, 0, '12011', 1, '12011', 87, 'INDUSTRI KRETEK', 'mencakup usaha pembuatan kretek yang mengandung tembakau rajangan, krosok rajang, cengkeh rajang, dan tambahan bahan-bahan perisa, yang menghasilkan campuran beraroma khas, dilinting dengan berbagai bahan pembungkus (ambri/papir/tipping). Termasuk industri kretek tangan, kretek tangan filter, dan kretek mesin. Usaha pembungkusan/pengepakan rokok tanpa melakukan pembuatan rokok dimasukkan dalam kelompok 82920.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(105, 0, '12012', 1, '12012', 88, 'INDUSTRI ROKOK PUTIH', 'mencakup usaha pembuatan rokok putih yang tidak mengandung komponen cengkeh. Usaha pembungkusan/pengepakan rokok putih tanpa melakukan pembuatan rokok dimasukkan dalam kelompok 82920.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(106, 0, '12019', 1, '12019', 89, 'INDUSTRI ROKOK LAINNYA', 'mencakup usaha pembuatan rokok lainnya, selain kretek atau rokok putih, seperti cerutu, rokok kelembak menyan dan rokok klobot/kawung, tembakau iris (TIS), cerutek, dan hasil pengolahan tembakau lainnya (HPTL). Termasuk industri tembakau pipa, tembakau yang dikunyah dan tembakau sedot (snuff).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(107, 0, '12091', 1, '12091', 90, 'INDUSTRI PENGERINGAN DAN PENGOLAHAN TEMBAKAU', 'mencakup usaha pengeringan daun tembakau dengan pengasapan atau dengan cara lain termasuk juga usaha perajangan daun tembakau.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(108, 0, '12099', 1, '12099', 91, 'INDUSTRI BUMBU ROKOK SERTA KELENGKAPAN ROKOK LAINNYA', 'mencakup industri pengolahan tembakau yang belum diklasifikasikan ditempat lain, seperti industri homogenisasi atau rekonstitusi tembakau dan tembakau bersaus. Termasuk pembuatan bumbu rokok, serta kelengkapan rokok lainnya, seperti kelembak menyan, saus rokok/tembakau, uwur, klobot, kawung serta pembuatan filter.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(109, 0, '13111', 5, '13111', 92, 'INDUSTRI PERSIAPAN SERAT TEKSTIL', 'mencakup usaha persiapan serat tekstil, seperti reeling (pilin/menggulung) dan pencucian serat sutera, degreasasi (penghilangan lemak) dan karbonisasi wol dan pencelupan bulu domba, termasuk proses penyusunan dan penyisiran (carding atau combing) serat semua jenis binatang, tumbuhan dan serat buatan manusia.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(110, 0, '13112', 5, '13112', 93, 'INDUSTRI PEMINTALAN BENANG', 'mencakup usaha pemintalan serat menjadi benang, kecuali benang jahit. Termasuk kegiatan penteksturan, penyimpulan, pelipatan dan pencucian benang rajutan filamen buatan atau sintetis dan industri benang rajutan dari bubur kayu.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(111, 0, '13113', 5, '13113', 94, 'INDUSTRI PEMINTALAN BENANG JAHIT', 'mencakup usaha pembuatan benang jahit, baik dengan bahan baku serat maupun benang. termasuk kegiatan penteksturan, penyimpulan, pelipatan dan pencucian benang jahit.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(112, 0, '13121', 5, '13121', 95, 'INDUSTRI PERTENUNAN (BUKAN PERTENUNAN KARUNG GONI DAN KARUNG LAINNYA', 'mencakup usaha pertenunan, baik yang dibuat dengan alat gedogan, alat tenun bukan mesin (ATBM), alat tenun mesin (ATM) ataupun alat tenun lainnya, kecuali industri kain tenun ikat. Usaha pertenunan karung goni dan karung lainnya dimasukkan dalam kelompok 13995 atau 13996.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(113, 0, '13122', 5, '13122', 96, 'INDUSTRI KAIN TENUN IKAT', 'mencakup usaha pembuatan kain tenun ikat dan usaha pewarnaan benang dengan cara mengikat terlebih dahulu.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(114, 0, '13123', 5, '13123', 97, 'INDUSTRI BULU TIRUAN TENUNAN', 'mencakup usaha pembuatan bulu tiruan dengan penenunan.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(115, 0, '13131', 5, '13131', 98, 'INDUSTRI PENYEMPURNAAN BENANG', 'mencakup usaha pengelantangan, pencelupan dan penyempurnaan lainnya untuk benang maupun benang jahit.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(116, 0, '13132', 5, '13132', 99, 'INDUSTRI PENYEMPURNAAN KAIN', 'mencakup usaha pengelantangan, pencelupan dan penyempurnaan lainnya untuk kain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(117, 0, '13133', 5, '13133', 100, 'INDUSTRI PENCETAKAN KAIN', 'mencakup usaha pencetakan kain, termasuk juga pencetakan kain motif batik.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(118, 0, '13134', 5, '13134', 101, 'INDUSTRI BATIK', 'mencakup usaha pembatikan dengan proses malam (lilin), baik yang dilakukan dengan tulis, cap maupun kombinasi antara cap dan tulis.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(119, 0, '13911', 5, '13911', 102, 'INDUSTRI KAIN RAJUTAN', 'mencakup usaha pembuatan kain yang dibuat dengan cara rajut ataupun renda.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(120, 0, '13912', 5, '13912', 103, 'INDUSTRI KAIN SULAMAN/BORDIR', 'mencakup usaha kain sulaman/bordir, baik yang dikerjakan dengan tangan maupun dengan mesin.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(121, 0, '13913', 5, '13913', 104, 'INDUSTRI BULU TIRUAN RAJUTAN', 'mencakup usaha pembuatan bulu tiruan rajutan.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(122, 0, '13921', 5, '13921', 105, 'INDUSTRI BARANG JADI TEKSTIL UNTUK KEPERLUAN RUMAH TANGGA', 'mencakup usaha pembuatan barang-barang jadi tekstil, seperti selimut, seprei, taplak meja, sarung bantal, bed cover, gorden, handuk, selubung mobil dan selimut listrik dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(123, 0, '13922', 5, '13922', 106, 'INDUSTRI BARANG JADI TEKSTIL SULAMAN', 'mencakup usaha barang jadi tekstil sulaman, baik yang dikerjakan dengan tangan maupun dengan mesin, seperti pakaian/barang jadi sulaman dan badge.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(124, 0, '13923', 5, '13923', 107, 'INDUSTRI BANTAL DAN SEJENISNYA', 'mencakup usaha pembuatan bantal dan sejenisnya, seperti bantal dan guling, selimut kapas, bantal kursi, kantong tidur dan lain-lain dari kapok, dakron dan sejenisnya', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(125, 0, '13924', 5, '13924', 108, 'INDUSTRI BARANG JADI RAJUTAN DAN SULAMAN', 'mencakup usaha pembuatan barang jadi rajutan, seperti kaos lampu, deker, bando.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(126, 0, '13925', 5, NULL, 0, 'INDUSTRI KARUNG GONI', 'mencakup usaha pembuatan karung goni', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(127, 0, '13926', 5, NULL, 0, 'INDUSTRI KARUNG BUKAN GONI', 'mencakup usaha pembuatan karung bagor (karung terigu/gula blacu) dan karung lainnya. Kecuali pembuatan karung plastik masuk dalam kelompok 22220.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(128, 0, '13929', 5, '13929', 109, 'INDUSTRI BARANG JADI TEKSTIL LAINNYA', 'mencakup usaha pembuatan barang jadi tekstil lainnya, seperti layar, tenda, bendera, terpal, parasut, pelampung penyelamat dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(129, 0, '13930', 5, '13930', 110, 'INDUSTRI KARPET DAN PERMADANI', 'mencakup usaha pembuatan karpet dan permadani dan sejenisnya, yang terbuat dari serat, baik serat alam, sintetis maupun serat campuran, baik yang dikerjakan dengan proses tenun (woven), tufting, braiding, flocking dan needle punching. Termasuk industri penutup lantai dari lakan atau bulu kempa yang dibuat dengan jarum tenun. Karpet yang terbuat dari bahan-bahan gabus, karet atau plastik masing-masing dimasukkan dalam kelompok 16299, 22191 atau 22210. Kain alas lantai dengan lapisan permukaan keras dimasukkan dalam kelompok 13999.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(130, 0, '13941', 5, '13941', 111, 'INDUSTRI TALI', 'mencakup usaha pembuatan berbagai macam tali, baik terbuat dari serat alam maupun serat sintetis atau serat campuran, seperti tali rami, tali goni (yute), tali sisal (agave), tali rafia dan tali nylon.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(131, 0, '13942', 5, '13942', 112, 'INDUSTRI BARANG DARI TALI', 'mencakup usaha pembuatan barang-barang dari tali, seperti jaring ikan, jala ikan, tali kapal, tali sepatu, sumbu kompor dan sumbu lampu, baik terbuat dari tali serat alam, tali serat sintetis atau tali serat campuran.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(132, 0, '13991', 5, '13991', 113, 'INDUSTRI KAIN PITA (NARROW FABRIC)', 'mencakup usaha pembuatan kain pita, seperti kain pita, kain label, valcro, badges dan kain tulle.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(133, 0, '13992', 5, '13992', 114, 'INDUSTRI YANG MENGHASILKAN KAIN KEPERLUAN INDUSTRI', 'mencakup usaha pembuatan kain dilapisi/ditutupi/diresapi dengan plastik atau karet dan selanjutnya digunakan untuk keperluan industri, seperti kain terpal, kain layar, kain tenda, kain payung, kain kanvas untuk melukis dan kulit imitasi dari media tekstil. Industri kulit imitasi dengan media selain tekstil dimasukkan dalam kelompok 15114', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(134, 0, '13993', 5, '13993', 115, 'INDUSTRI NON WOVEN (BUKAN TENUNAN)', 'mencakup usaha industri kain yang dibuat tanpa dengan proses anyaman atau perajutan, seperti kain kempa, kain felting dan kain laken.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(135, 0, '13994', 5, '13994', 116, 'INDUSTRI KAIN BAN', 'mencakup usaha pembuatan kain ban dari benang sintetik kekuatan tinggi, seperti kain ban dari nylon dan kain ban dari polyester', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(136, 0, '13995', 5, '13925', 0, 'INDUSTRI KAPUK', 'mencakup usaha pengolahan kapuk', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(137, 0, '13999', 5, '13999', 120, 'INDUSTRI TEKSTIL LAINNYA YTDL', 'mencakup usaha industri tekstil lainnya yang belum/tidak tercakup dalam golongan industri tekstil manapun, seperti benang karet, benang logam dan pipa/selang kain dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(138, 0, '14111', 5, '14111', 121, 'INDUSTRI PAKAIAN JADI (KONVEKSI) DARI TEKSTIL', 'mencakup usaha pembuatan pakaian jadi (konveksi) dari tekstil/kain (tenun maupun rajutan) dengan cara memotong dan menjahit sehingga siap dipakai, seperti kemeja, celana, kebaya, blus, rok, baju bayi, pakaian tari dan pakaian olahraga, baik dari kain tenun maupun kain rajut yang dijahit.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(139, 0, '14112', 5, '14112', 122, 'INDUSTRI PAKAIAN JADI (KONVEKSI) DARI KULIT', 'mencakup usaha pembuatan pakaian jadi (konveksi) dari kulit atau kulit imitasi, dengan cara memotong dan menjahit sehingga siap pakai, seperti jaket, mantel, rompi, celana dan rok. Termasuk pembuatan aksesori pakaian dari kulit seperti welders leather aprons atau pakaian kerja tukang las dari kulit.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(140, 0, '14120', 5, '14120', 123, 'PENJAHITAN DAN PEMBUATAN PAKAIAN SESUAI PESANAN', 'mencakup usaha penjahitan dan pembuatan pakaian sesuai pesanan yang melayani masyarakat umum dengan tujuan komersil.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(141, 0, '14131', 5, '14131', 124, 'INDUSTRI PERLENGKAPAN PAKAIAN DARI TEKSTIL', 'mencakup usaha pembuatan perlengkapan pakaian jadi (konveksi) tekstil dan dari kain dengan cara memotong dan menjahit sehingga siap dipakai, seperti topi, peci, dasi, sarung tangan, mukena, selendang, kerudung, ikat pinggang, syal, bando, dasi tuksedo dan lain-lain, baik dari kain tenun maupun kain rajut yang dijahit. Termasuk industri alas kaki dari bahan kain tanpa sol dan bagian-bagian dari produk yang disebutkan sebelumnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(142, 0, '14132', 5, '14132', 125, 'INDUSTRI PERLENGKAPAN PAKAIAN DARI KULIT', 'mencakup usaha pembuatan perlengkapan pakaian jadi dari kulit atau kulit imitasi, dengan cara memotong dan menjahit sehingga siap pakai, seperti topi, sarung tangan, ikat pinggang dan lain-lain. Termasuk industri penutup kepala dari kulit berbulu dan bagian-bagian dari produk yang disebutkan sebelumnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(143, 0, '14200', 5, '14200', 126, 'INDUSTRI PAKAIAN JADI DAN BARANG DARI KULIT BERBULU', 'mencakup usaha pembuatan pakaian jadi/barang jadi dari kulit berbulu dan atau perlengkapannya, seperti mantel berbulu, berbagai barang dari kulit berbulu, misalnya gambar, tikar, keset dan barang lain dari kulit berbulu, seperti permadani, kain kilap industri.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(144, 0, '14301', 5, '14301', 127, 'INDUSTRI PAKAIAN JADI RAJUTAN', 'mencakup usaha pembuatan pakaian jadi, seperti sweater, kardigan, baju kaos, mantel, dan barang sejenisnya, termasuk topi yang dibuat dengan cara dirajut ataupun renda, kecuali industri rajutan kaos kaki.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(145, 0, '14302', 5, '14302', 128, 'INDUSTRI PAKAIAN JADI SULAMAN/BORDIR', 'mencakup usaha pakaian jadi sulaman, baik yang dikerjakan dengan tangan maupun dengan mesin', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(146, 0, '14303', 5, '14303', 129, 'INDUSTRI RAJUTAN KAOS KAKI DAN SEJENISNYA', 'mencakup usaha pembuatan kaos kaki yang dibuat dengan cara rajut ataupun renda, seperti kaos kaki, termasuk kaos kaki, stocking, pantyhose.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1);
INSERT INTO `m_kbli` (`id`, `server_id`, `kode`, `direktorat_id`, `kode2009`, `kbli2009_id`, `kbli`, `deskripsi`, `created`, `modified`, `ipaddress`, `dataactive`) VALUES
(147, 0, '15111', 5, '15111', 130, 'INDUSTRI PENGAWETAN KULIT', 'mencakup usaha pengawetan kulit yang berasal dari hewan besar, hewan kecil, reptil, ikan dan hewan lainnya, baik yang dilakukan dengan pengeringan, penggaraman, maupun pengasaman (pikel), seperti kulit hewan besar (sapi, kerbau), kulit hewan kecil (domba, kambing), kulit reptil (buaya, ular, biawak), kulit ikan (ikan pari,hiu/cucut, kakap, belut) dan kulit hewan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(148, 0, '15112', 5, '15112', 131, 'INDUSTRI PENYAMAKAN KULIT', 'mencakup usaha penyamakan kulit yang berasal dari ternak besar (sapi, kerbau), ternak kecil (domba, kambing), reptil (buaya, ular, biawak), ikan (ikan pari, hiu cucut, kakap, belut) dan hewan lainnya yang dimasak dengan chrome nabati, sintetis, samak minyak dan samak kombinasi menjadi kulit tersamak, seperti wet blue, crust, sol, vache raam, kulit box, kulit beludru, kulit gelase dan kulit hiasan, kulit berbulu, kulit laminasi, kulit patent, kulit jaket, kulit sarung tangan, kulit chamois dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(149, 0, '15113', 5, '15113', 132, 'INDUSTRI PENCELUPAN KULIT BULU', 'mencakup usaha pemberian warna atau pencelupan pada kulit bulu yang digunakan pada pakaian jadi tekstil.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(150, 0, '15114', 5, '15114', 133, 'INDUSTRI KULIT BUATAN/IMITASI', 'mencakup usaha pembuatan kulit buatan atau kulit imitasi yang berbahan dasar kulit asli. Industri kulit buatan/imitasi dengan media tekstil dimasukkan dalam kelompok 13992.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(151, 0, '15121', 5, '15121', 134, 'INDUSTRI BARANG DARI KULIT DAN KULIT BUATAN UNTUK KEPERLUAN PRIBADI', 'mencakup usaha pembuatan barang-barang dari kulit dan kulit buatan atau bahan lain seperti plastik, tekstil, serat yang divulkanisir atau paperboard untuk keperluan pribadi, seperti kopor, ransel, tas, dompet, kotak rias, sarung senjata, tempat kaca mata dan tali jam. Termasuk industri tali sepatu kulit.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(152, 0, '15122', 5, '15122', 135, 'INDUSTRI BARANG DARI KULIT DAN KULIT BUATAN UNTUK KEPERLUAN TEKNIK/INDUSTRI', 'mencakup usaha pembuatan barang-barang dari kulit dan kulit buatan untuk keperluan teknik/industri, seperti klep, packing, rem pickers, sarung tangan kerja, kulit pompa, kulit ban mesin (belt), kulit apron dan sisir kulit pada mesin (combing leather).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(153, 0, '15123', 5, '15123', 136, 'INDUSTRI BARANG DARI KULIT DAN KULIT BUATAN UNTUK KEPERLUAN HEWAN', 'mencakup usaha pembuatan barang-barang dari kulit dan kulit buatan untuk keperluan hewan, seperti ikat leher hewan, tali kekang hewan, pelana hewan, brongsong mulut hewan, cambuk dan sepatu hewan.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(154, 0, '15129', 5, '15129', 137, 'INDUSTRI BARANG DARI KULIT DAN KULIT BUATAN UNTUK KEPERLUAN LAINNYA', 'mencakup usaha pembuatan barang-barang dari kulit dan kulit buatan untuk keperluan yang belum terliput dalam kelompok 15121 sampai dengan 15123, seperti jok, sabuk pengaman, alat pengepak dan kerajinan tatah sungging (hiasan, wayang dan kap lampu) dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(155, 0, '15201', 5, '15201', 138, 'INDUSTRI ALAS KAKI UNTUK KEPERLUAN SEHARI-HARI', 'mencakup usaha pembuatan alas kaki keperluan sehari-hari dari kulit dan kulit buatan, karet, kanvas dan kayu, seperti sepatu harian, sepatu santai (casual shoes), sepatu sandal, sandal kelom dan selop. Termasuk juga usaha pembuatan bagian-bagian dari alas kaki tersebut, seperti atasan, sol dalam, sol luar, penguat depan, penguat tengah, penguat belakang, lapisan dan aksesori dari kulit dan kulit buatan.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(156, 0, '15202', 5, '15202', 139, 'INDUSTRI SEPATU OLAHRAGA', 'mencakup usaha pembuatan sepatu untuk olahraga dari kulit dan kulit buatan, karet dan kanvas, seperti sepatu sepak bola, sepatu atletik, sepatu senam, sepatu jogging dan sepatu ballet. Termasuk juga usaha pembuatan bagian bagian dari sepatu olahraga tersebut, meliputi atasan, sol luar, sol dalam, lapisan dan aksesori.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(157, 0, '15203', 5, '15203', 140, 'INDUSTRI SEPATU TEKNIK LAPANGAN/KEPERLUAN INDUSTRI', 'mencakup usaha pembuatan sepatu termasuk pembuatan bagian-bagian dari sepatu untuk keperluan teknik lapangan/industri dari kulit, kulit buatan, karet dan plastik, seperti sepatu tahan kimia, sepatu tahan panas, sepatu pengaman.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(158, 0, '15209', 5, '15209', 141, 'INDUSTRI ALAS KAKI LAINNYA', 'mencakup usaha pembuatan alas kaki lainnya yang belum termasuk golongan manapun, seperti sepatu kesehatan dan sepatu lainnya, misalnya sepatu dari gedebog (pelepah batang pisang) dan eceng gondok. Termasuk industri gaiter, legging dan barang sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(159, 0, '16101', 2, '16101', 142, 'INDUSTRI PENGGERGAJIAN KAYU', 'mencakup usaha penggergajian, penyerutan, pengirisan, pengulitan dan pemotongan kayu gelondongan menjadi balok, kaso (usuk), reng, papan dan sebagainya. Termasuk industri kayu untuk bantalan rel kereta, kayu untuk lantai dan wol kayu, tepung kayu, irisan dan partikel kayu.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(160, 0, '16102', 2, '16102', 143, 'INDUSTRI PENGAWETAN KAYU', 'mencakup usaha pengawetan kayu dengan cara pengeringan kayu, pengolahan kimia dan perendaman kayu dengan bahan pengawet atau bahan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(161, 0, '16103', 2, '16103', 144, 'INDUSTRI PENGAWETAN ROTAN, BAMBU, DAN SEJENISNYA       ', 'mencakup usaha pengawetan rotan, bambu dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(162, 0, '16104', 2, '16104', 145, 'INDUSTRI PENGOLAHAN ROTAN', 'mencakup usaha pengolahan rotan menjadi bahan setengah jadi, seperti rotan poles, hati rotan dan kulit rotan.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(163, 0, '16211', 2, '16211', 146, 'INDUSTRI KAYU LAPIS', 'mencakup usaha pembuatan kayu lapis biasa, seperti kayu lapis tripleks, multipleks, kayu lapis interior, eksterior dan sejenisnya. Termasuk juga kayu lapis konstruksi, seperti kayu lapis cetak beton, kayu lapis tahan air dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(164, 0, '16212', 2, '16212', 147, 'INDUSTRI KAYU LAPIS LAMINASI, TERMASUK DECORATIVE PLYWOOD', 'mencakup usaha pembuatan kayu lapis yang dilaminasi, seperti teak wood, rose wood, polyester plywood dan sejenisnya. Termasuk juga bambu lapis yang dilaminasi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(165, 0, '16213', 2, '16213', 148, 'INDUSTRI PANEL KAYU LAINNYA', 'mencakup usaha pembuatan panel kayu lainnya, seperti block board, particle board, chip board, lamin board, fibre board, Medium Density Fibreboard (MDF) dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(166, 0, '16214', 2, '16214', 149, 'INDUSTRI VENEER', 'mencakup usaha pembuatan serutan pelapis (veneer) dengan cara pengupasan (rotary), penyayatan (slicer) dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(167, 0, '16221', 2, '16221', 150, 'INDUSTRI BARANG BANGUNAN DARI KAYU', 'mencakup usaha pengerjaan kayu untuk bahan bangunan, seperti dowels, moulding, kusen, lis, daun pintu/jendela, tiang penopang yang dibuat dari kayu, lantai/lantai dari papan yang bergambar (lantai hias) atau kepingan atau potongan lantai dan lainnya yang terpasang menjadi panel, langit-langit, atap, kerei, tangga dari kayu dan susurannya, manik-manik dari kayu dan papan penghias tembok dan papan nama dan pengerjaan kayu untuk bahan bangunan lainnya. Termasuk industri rumah bergerak dan partisi kayu (tidak termasuk penyekat ruangan yang berdiri sendiri/furnitur).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(168, 0, '16222', 2, '16222', 151, 'INDUSTRI BANGUNAN PRAFABRIKASI DARI KAYU', 'mencakup usaha pengerjaan kayu untuk bangunan prafabrikasi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(169, 0, '16230', 2, '16230', 152, 'INDUSTRI WADAH DARI KAYU', 'mencakup usaha pembuatan segala macam wadah atau peti/kotak dari kayu untuk pengemasan, seperti kotak kemas, boks, peti kayu, drum kayu dan kemasan sejenisnya dari kayu; palet (pallets), kotak palet dan papan muat dari kayu lainnya; barel, tong, ember dan produk dari kayu lainnya; dan gulungan kawat dari kayu.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(170, 0, '16291', 7, '16291', 153, 'INDUSTRI BARANG ANYAMAN DARI ROTAN DAN BAMBU', 'mencakup usaha pembuatan macam-macam tikar, webbing, lampit, tas, topi, tampah, kukusan, bakul, kipas, tatakan, bilik/gedek dan sejenisnya yang bahan utamanya dari rotan atau bambu.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(171, 0, '16292', 7, '16292', 154, 'INDUSTRI BARANG ANYAMAN DARI TANAMAN BUKAN ROTAN DAN BAMBU', 'mencakup usaha pembuatan macam-macam tikar, keset, tas, topi, tatakan dan kerajinan tangan lainnya yang bahan utamanya bukan rotan dan bambu, seperti pandan, mendong, serat, rumput dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(172, 0, '16293', 7, '16293', 155, 'INDUSTRI KERAJINAN UKIRAN DARI KAYU BUKAN MEBELLER', 'mencakup usaha pembuatan macam-macam barang kerajinan dan ukir-ukiran dari kayu, seperti relief, topeng, patung, wayang, vas bunga, pigura dan kap lampu.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(173, 0, '16294', 7, '16294', 156, 'INDUSTRI ALAT DAPUR DARI KAYU, ROTAN DAN BAMBU', 'mencakup usaha pembuatan macam-macam barang kerajinan dan ukir-ukiran dari kayu, seperti relief, topeng, patung, wayang, vas bunga, pigura dan kap lampu.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(174, 0, '16295', 2, '16295', 157, 'INDUSTRI KAYU BAKAR DAN PELET KAYU', 'mencakup industri kayu bakar dan pelet kayu yang dibuat dari serbuk kayu atau bahan substitusi seperti ampas kopi atau biji kedelai yang dipres.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(175, 0, '16299', 2, '16299', 158, 'INDUSTRI BARANG DARI KAYU, ROTAN, GABUS LAINNYA YTDL', 'mencakup usaha pembuatan barang-barang dari kayu, rotan dan gabus lainnya yang belum tercakup sebelumnya. Barang-barang dari kayu misalnya alat tenun, gantungan baju, chopstik, tusuk gigi, sempoa (alat hitung), penggaris dan papan tulis. Termasuk juga pembuatan alat-alat kerja dari kayu, seperti plesteran, palu, rumah serutan kayu, gagang pegangan perkakas, palet, papan cucian dan sejenisnya. Barang dari gabus misalnya gabus lembaran, sumbat, piringan, cincin, pelapis, pelampung dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(176, 0, '17011', 2, '17011', 159, 'INDUSTRI BUBUR KERTAS (PULP)', 'mencakup usaha pembuatan bubur kertas dengan bahan dari kayu atau serat lainnya dan atau kertas bekas. Kegiatannya mencakup industri bubur kertas yang diputihkan, separuh putihkan atau yang tidak diputihkan baik melalui proses mekanis, kimia (pelarutan atau non pelarutan), maupun semi kimia, industri bubur kertas cotton-linters dan penghilangan tinta dan industri bubur kertas dari kertas bekas', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(177, 0, '17012', 2, '17012', 160, 'INDUSTRI KERTAS BUDAYA', 'elompok ini mencakup usaha pembuatan kertas koran dan kertas tulis cetak.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(178, 0, '17013', 6, '17013', 161, 'INDUSTRI KERTAS BERHARGA', 'mencakup usaha pembuatan kertas bandrol, bank notes, cheque paper, security paper, watermark paper, meterai, perangko dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(179, 0, '17014', 6, '17014', 162, 'INDUSTRI KERTAS KHUSUS', 'mencakup usaha pembuatan kertas khusus, seperti cardiopan, kertas litmus/lakmus, metalic paper, acid proof paper, kertas pola, kertas tersalut, kertas celopan dan sejenisnya. Pengerjaan kertas yang melapisi dengan segala cara, seperti coating, glazing, gumming, dan laminating serta pembuatan kertas karbon dan stensil dimasukkan dalam kelompok 17099, jika dalam bentuk potongan siap dijual ke konsumen. Pembuatan kertas fotografi dimasukkan dalam kelompok 20299. Pembuatan kertas penggosok/amplas (abrasive paper) dimasukkan dalam kelompok 23990.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(180, 0, '17019', 6, '17019', 163, 'INDUSTRI KERTAS LAINNYA', 'mencakup usaha pembuatan kertas magnetik, kertas kerut (crep) dan gumpalan selulosa dan webs serat selulosa', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(181, 0, '17021', 6, '17021', 164, 'INDUSTRI KERTAS DAN PAPAN KERTAS BERGELOMBANG', 'mencakup usaha pembuatan kertas konstruksi (kertas isolasi, condensor, roofing board, building board dan lain-lain), kertas bungkus dan pengepakan (kraftliner, medium liner/corrugating medium, ribbed kraft paper/kertas payung, kraft paper), board (post card karthotek, kertas londen, triplex, multiplex, bristol, straw board, chip board, duplex).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(182, 0, '17022', 6, '17022', 165, 'INDUSTRI KEMASAN DAN KOTAK DARI KERTAS DAN KARTON', 'mencakup usaha pembuatan segala macam kemasan dan kotak dari kertas/karton yang digunakan untuk pembungkus/pengepakan, termasuk juga pembuatan kotak untuk rokok dan barang lainnya. Misalnya kemasan dan kotak dari kertas dan papan kertas bergelombang, kemasan dan kotak papan kertas yang dapat dilipat, kemasan dan kotak dari papan padat, kemasan dan kotak lain dari kertas dan papan kertas, sak dan kantong kertas dan kotak file kantor dan barang sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(183, 0, '17091', 6, '17091', 166, 'INDUSTRI KERTAS TISSUE', 'mencakup usaha pembuatan kertas untuk kertas rumah tangga, kertas kebersihan pribadi dan barang kertas kapas selulosa, seperti tisu pembersih, facial tissue, toilet tissue, lens tissue, sapu tangan, handuk, serbet, kertas toilet, napkin dan napkin untuk bayi dan cangkir, piring dan baki dan usaha pembuatan kertas kapas dan barang dari kertas kapas, seperti handuk/lap, tampon dan sebagainya dan kertas sigaret dan cork tipping paper.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(184, 0, '17099', 6, '17099', 167, 'INDUSTRI BARANG DARI KERTAS DAN PAPAN KERTAS LAINNYA YTDL', 'mencakup usaha pembuatan barang dari kertas dan papan kertas atau karton yang belum tercakup dalam subgolongan lain, seperti industri kertas tulis dan kertas cetak siap pakai, industri kertas printout komputer siap pakai, industri kertas kopi siap pakai, industri kertas tempel atau berperekat siap pakai, industri buku register, buku akuntansi, binder, album dan alat-alat tulis baik yang bersifat komersil atau untuk pendidikan sejenisnya, industri kotak, kantong, dompet dan buku catatan yang mengandung susunan kertas, industri wallpaper (kertas dinding) dan jenis pelapis dinding lainnya, termasuk wallpaper berlapis vinyl dan tekstil, industri label, industri kertas filter dan papan kertas filter, industri gulungan kertas dan papan kertas, gelendong kertas dan papan kertas dan sebagainya, industri tempat telur dan barang lainnya yang dibuat dari cetakan bubur kertas dan sebagainya, dan industri kertas kreasi baru. Termasuk di sini pengerjaan kertas dan karton dengan segala cara, seperti coating, glazing, gumming, laminating, pembuatan kertas karbon dan kertas stensil sheet dalam bentuk potongan siap dijual ke konsumen. Termasuk juga pembuatan alat tulis kantor (stationeries) yang tidak dicetak, seperti amplop, kertas surat, kertas pembersih, dinner ware dari kertas dan sejenisnya. Pembuatan alat tulis kantor dan kartu yang dicetak dimasukkan dalam kelompok 58110.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(185, 0, '18111', 6, '18111', 168, 'INDUSTRI PENCETAKAN UMUM', 'mencakup kegiatan industri percetakan surat kabar, majalah dan periodik lainnya seperti tabloid, surat kabar, majalah, jurnal, pamflet, buku dan brosur, naskah musik, peta, atlas, poster, katalog periklanan, prospektus dan iklan cetak lainnya, buku harian, kalender, formulir bisnis dan barang-barang cetakan komersial lainnya, kertas surat atau alat tulis pribadi dan barang-barang cetakan lainnya hasil mesin cetak, offset, klise foto, fleksografi dan sejenisnya, mesin pengganda, printer komputer, huruf timbul dan sebagainya termasuk alat cetak cepat; pencetakan langsung ke bahan tekstil, plastik, kaca, logam, kayu dan keramik, kecuali pencetakan tabir sutera pada kain dan pakaian jadi; dan pencetakan pada label atau tanda pengenal (litografi, pencetakan tulisan di makam, pencetakan fleksografi dan sebagainya). Termasuk pula mencetak ulang melalui komputer, mesin stensil dan sejenisnya. Barang cetakan ini biasanya merupakan hak cipta. Industri label kertas atau karton termasuk kelompok 17099.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(186, 0, '18112', 6, '18112', 169, 'INDUSTRI PENCETAKAN KHUSUS', 'mencakup industri pencetakan perangko pos, perangko perpajakan, dokumen, cek dan kertas rahasia lainnya, materai, uang kertas, blangko cek, giro, surat andil, obligasi surat saham, surat berharga lainnya, paspor, tiket pesawat terbang dan cetakan khusus lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(187, 0, '18120', 6, '18120', 170, 'KEGIATAN JASA PENUNJANG PENCETAKAN', 'mencakup usaha penjilidan lembar cetakan, misalnya menjadi buku, brosur, majalah, katalog dan sebagainya, dengan melipat, memasang, menjahit, merekatkan, menyatukan, penjilidan dengan perekat, perapihan dan gold stamping; produksi composed type, plates atau cylinders, penjilidan buku; komposisi, pemasangan huruf, pemasangan foto, input data mencakup scanning dan pengenalan karakter atau huruf optik, penyusunan elektronik; pembuatan gambar mencakup pemasangan image atau gambar (untuk proses pencetakan mesin cetak dan offset); pengukiran atau sketsa cylinders untuk gravure; proses pembuatan gambar langsung di atas pelat (temasuk pelat fotopolimer); pembuatan gambar untuk pencetakan dan pengecapan relief; pembuatan cetakan untuk percobaan; pekerjaan artistik mencakup penyiapan batu litho dan woodblocks (produksi batu lithographic, untuk digunakan dalam kegiatan percetakan di unit lain); pembuatan barang reprografi; desain barang cetakan seperti sketsa, layout, barang contoh dan sebagainya; dan kegiatan grafis lainnya seperti die-sinking dan die-stamping, penggandaan huruf braille, pemukulan dan pengeboran, penyulaman timbul, pemvernisan dan pelapisan, penyisipan dan pelipatan.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(188, 0, '18201', 10, '18201', 171, 'REPRODUKSI MEDIA REKAMAN SUARA DAN PIRANTI LUNAK', 'mencakup usaha reproduksi dari kopi master pelat atau piringan gramofon, compact disk atau CD dan pita yang berisikan musik atau rekaman suara (audio) dan reproduksi dari kopi master perangkat lunak atau software dan data pada disk dan pita magnetik. Pembuatan piringan hitam kosong, pita kaset kosong, pita komputer dan disket kosong untuk merekam data dimasukkan dalam kelompok 26800. Industri rekaman suara di piringan hitam, pita kaset dan sejenisnya dimasukkan dalam kelompok 59201.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(189, 0, '18202', 10, '18202', 172, 'REPRODUKSI MEDIA REKAMAN FILM DAN VIDEO', 'mencakup usaha reproduksi dari kopi master rekaman, compact disk atau CD dan tape yang berisikan gambar bergerak atau film dan rekaman video lainnya. Penerbitan rekaman film dan video dimasukkan dalam kelompok 59111 dan 59112.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(190, 0, '19100', 6, '19100', 173, 'INDUSTRI PRODUK DARI BATU BARA', 'mencakup usaha industri pengolahan gas, kokas dari batu bara, termasuk juga destilasi batu bara yang bukan merupakan bagian pabrik gas atau besi dan baja, atau destilasi batu bara yang menjadi bagian pabrik besi dan baja yang pembukuannya dapat dipisahkan. Termasuk pengoperasian tungku kokas, produksi kokas dan semi kokas, produksi pitch kokas, produksi kokas mentah dan ter lignit dan pengaglomerasian kokas. Usaha destilasi gas oleh pabrik gas yang penyalurannya melalui pipa saluran dimasukkan dalam kelompok 35202. Usaha pembuatan gas dan kokas yang tergabung dalam kegiatan pengolahan besi dan baja dimasukkan dalam kelompok 24101 sampai dengan 24103.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(191, 0, '19211', 6, '19211', 174, 'INDUSTRI BAHAN BAKAR DARI PEMURNIAN DAN PENGILANGAN MINYAK BUMI', 'mencakup usaha pemurnian dan pengilangan minyak bumi yang menghasilkan bahan bakar seperti Avigas, Avtur, Gasoline, Minyak Tanah atau Kerosin, Minyak Solar, Minyak Diesel, Minyak Bakar atau Bensin, Solvent/Pelarut, termasuk LPG dari hasil pengilangan minyak bumi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(192, 0, '19212', 6, NULL, 0, 'INDUSTRI PEMBUATAN MINYAK PELUMAS', 'mencakup usaha pembuatan minyak pelumas, oli dan gemuk yang berbahan dasar minyak.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(193, 0, '19213', 6, '19212', 175, 'INDUSTRI PENGOLAHAN KEMBALI MINYAK PELUMAS BEKAS', 'mencakup usaha pengolahan kembali minyak pelumas bekas untuk dapat digunakan sebagai minyak pelumas', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(194, 0, '19291', 6, '19291', 178, 'INDUSTRI PRODUK DARI HASIL KILANG MINYAK BUMI', 'mencakup usaha industri pengolahan aspal/ter, bitumen dan lilin (dapat digunakan untuk lapisan jalan, atap, kayu, kertas dan sebagainya) serta Petroleum Coke. Termasuk industri produk untuk industri petrokimia, industri bermacam-macam produk, seperti white spirit, vaseline, lilin parafin, jeli minyak bumi (petroleum jelly), industri briket minyak bumi dan pencampuran biofuel, seperti pencampuran alkohol dengan minyak bumi (misalnya gasohol).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(195, 0, '19292', 6, '19292', 179, 'INDUSTRI BRIKET BATU BARA', 'mencakup usaha pembuatan briket dari batu bara atau lignit, baik di lokasi penambangan maupun di luar lokasi penambangan. Termasuk pula pembuatan briket yang menggunakan batu bara atau lignit yang dibeli dari pihak lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(196, 0, '20111', 4, '20111', 180, 'INDUSTRI KIMIA DASAR ANORGANIK KHLOR DAN ALKALI', 'mencakup usaha industri kimia dasar yang menghasilkan bahan kimia khlor dan alkali, seperti soda kostik, soda abu, natrium khlorida, kalium hidroksida dan senyawa khlor lainnya. Termasuk juga usaha industri yang menghasilkan logam alkali, seperti lithium, natrium dan kalium, serta senyawa alkali lainnya. Industri pembuatan garam dapur dimasukkan dalam kelompok 10774.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(197, 0, '20112', 4, '20112', 181, 'INDUSTRI KIMIA DASAR ANORGANIK GAS INDUSTRI', 'mencakup usaha industri kimia dasar yang menghasilkan bahan kimia gas industri, seperti zat asam, zat lemas, zat asam arang, amoniak dan dry ice. Termasuk juga usaha industri kimia dasar yang menghasilkan gas mulia, seperti helium, neon, argon dan radon; serta jenis-jenis gas industri lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(198, 0, '20113', 4, '20113', 182, 'INDUSTRI KIMIA DASAR ANORGANIK PIGMEN', 'mencakup usaha industri kimia dasar yang menghasilkan bahan anorganik pigment, seperti meni merah, chrome yellow, zinc yellow, barium sulphate, pigmen serbuk aluminium, oker dan pigment dengan dasar titanium.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(199, 0, '20114', 4, '20114', 183, 'INDUSTRI KIMIA DASAR ANORGANIK LAINNYA', 'mencakup usaha industri kimia dasar anorganik yang belum tercakup dalam golongan industri kimia dasar anorganik di atas, seperti fosfor dengan turunannya, belerang dengan turunannya, nitrogen dengan turunannya. Termasuk juga industri kimia dasar yang menghasilkan senyawa halogen dengan turunannya, logam kecuali logam alkali, senyawa oksida kecuali pigmen.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(200, 0, '20115', 4, '20115', 184, 'INDUSTRI KIMIA DASAR ORGANIK YANG BERSUMBER DARI HASIL PERTANIAN', 'mencakup usaha industri kimia dasar organik yang menghasilkan bahan kimia dari hasil pertanian termasuk kayu dan dan getah (gum), seperti asam alufamat, asam asetat, asam citrat, asam benzoat, fatty acid, fatty alkohol, furfucal, sarbilol dan bahan kimia organik lainnya dari hasil pertanian. Termasuk pembuatan biofuel, arang kayu, arang batok kelapa, dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(201, 0, '20116', 4, '20116', 185, 'INDUSTRI KIMIA DASAR ORGANIK UNTUK BAHAN BAKU ZAT WARNA DAN PIGMEN, ZAT WARNA DAN PIGMEN', 'mencakup usaha industri kimia dasar yang menghasilkan bahan kimia organik, zat warna dan pigment dengan hasil antara siklisnya, seperti hasil antara phenol dan turunannya, zat warna tekstil dan zat warna untuk makanan dan obat-obatan.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(202, 0, '20117', 4, '20117', 186, 'INDUSTRI KIMIA DASAR ORGANIK YANG BERSUMBER DARI MINYAK BUMI, GAS ALAM DAN BATU BARA', 'mencakup usaha industri kimia dasar organik yang menghasilkan bahan kimia, yang bahan bakunya berasal dari minyak bumi dan gas bumi maupun batu bara, seperti ethylene, propilene, benzena, toluena, caprolactam termasuk pengolahan coaltar.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(203, 0, '20118', 4, '20118', 187, 'INDUSTRI KIMIA DASAR ORGANIK YANG MENGHASILKAN BAHAN KIMIA KHUSUS', 'mencakup usaha industri kimia dasar organik yang menghasilkan bahan kimia khusus, seperti bahan kimia khusus untuk minyak dan gas bumi, pengolahan air, karet, kertas, konstruksi, otomotif, bahan tambahan makanan (food additive), tekstil, kulit, elektronik, katalis, minyak rem (brake fluid), serta bahan kimia khusus lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(204, 0, '20119', 4, '20119', 188, 'INDUSTRI KIMIA DASAR ORGANIK LAINNYA', 'mencakup usaha industri Kimia Dasar Organik yang belum tercakup dalam golongan Industri Kimia Dasar Organik, seperti plasticizer, bahan untuk bahan baku pestisida, zat aktif permukaan, bahan pengawet.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(205, 0, '20121', 4, '20121', 189, 'INDUSTRI PUPUK ALAM/NON SINTETIS HARA MAKRO PRIMER', 'mencakup usaha pembuatan pupuk hara makro primer jenis pupuk alam seperti pupuk fosfat alam (pupuk alam anorganik).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(206, 0, '20122', 4, '20122', 190, 'INDUSTRI PUPUK BUATAN TUNGGAL HARA MAKRO PRIMER', 'mencakup usaha pembuatan pupuk hara makro primer jenis pupuk buatan tunggal seperti urea, ZA, TSP, DSP dan Kalsium Sulfat. Termasuk juga pembuatan gas CO2, asam sulfat, amoniak, asam fosfat, asam nitrat dan lain-lain yang berkaitan dengan pembuatan pupuk dan tidak dapat dilaporkan secara terpisah.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(207, 0, '20123', 4, '20123', 191, 'INDUSTRI PUPUK BUATAN MAJEMUK HARA MAKRO PRIMER', 'mencakup usaha pembuatan pupuk yang mengandung minimal 2 unsur hara makro primer melalui proses reaksi kimia seperti Mono Amonium Fosfat (pupuk buatan majemuk nitrogen fosfat), Kalium Amonium Khlorida (pupuk buatan majemuk nitrogen kalium), Kalium Metafosfat (pupuk buatan majemuk fosfat kalium) dan Amonium Kalium Fosfat (pupuk buatan majemuk nitrogen fosfat kalium). Total kandungan unsur hara makro primer minimal 10 persen sampai dengan 30 persen', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(208, 0, '20124', 4, '20124', 192, 'INDUSTRI PUPUK BUATAN CAMPURAN HARA MAKRO PRIMER', 'mencakup usaha pembuatan pupuk yang mengandung minimal 2 unsur hara makro primer melalui pencampuran pupuk secara fisik tanpa merubah sifat kimia dan sifat pupuk aslinya. Total kandungan unsur hara makro primer minimal 10 persen.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(209, 0, '20125', 4, '20125', 193, 'INDUSTRI PUPUK HARA MAKRO SEKUNDER', 'mencakup usaha pembuatan pupuk yang mengandung unsur hara makro sekunder jenis Ca, Mg, dan S seperti Kiserit (Mg, S), Oksida Magnio (Mg).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(210, 0, '20126', 4, '20126', 194, 'INDUSTRI PUPUK HARA MIKRO', 'mencakup usaha pembuatan pupuk yang mengandung unsur hara mikro seperti Seng, Besi, Tembaga, Mangan, Boron dan Molybdenum.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(211, 0, '20127', 4, '20127', 195, 'INDUSTRI PUPUK PELENGKAP', 'mencakup usaha pembuatan pupuk yang mengandung mikro organisme atau formula pupuk yang berasal dari hasil samping industri yang mempunyai kandungan hara mikro sebagai komponen utama serta mengandung total unsur hara makro primer dalam jumlah rendah sampai sedang (kurang dari 30 persen).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(212, 0, '20128', 4, NULL, 0, 'INDUSTRI MEDIA TANAM', 'mencakup usaha pembuatan media tanam dengan tanah gemuk/gambut sebagai unsur pokok. Termasuk juga usaha pembuatan media tanam campuran dari tanah alami, pasir, tanah liat dan mineral.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(213, 0, '20129', 4, '20129', 196, 'INDUSTRI PUPUK LAINNYA', 'mencakup usaha pembuatan pupuk yang belum termasuk dalam kelompok manapun.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(214, 0, '20131', 4, '20131', 197, 'INDUSTRI DAMAR BUATAN (RESIN SINTETIS) DAN BAHAN BAKU PLASTIK', 'mencakup usaha pembuatan damar buatan dan bahan baku plastik (bijih plastik murni), seperti alkid, poliester, aminos, poliamid, epoksid, silikon, poliuretan, polietilen (PE), polipropilen (PP), polistiren, polivinil klorid, selulosa asetat dan selulosa nitrat. Pengolahan lanjutan dari damar buatan dan bahan plastik yang dibeli untuk menghasilkan barang dari bahan baku tersebut, seperti barang plastik, film dan lembaran film yang belum peka terhadap sinar dimasukkan dalam kelompok 26800.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(215, 0, '20132', 4, '20132', 198, 'INDUSTRI KARET BUATAN', 'mencakup usaha pembuatan karet buatan, seperti styrene butadiene rubber (SBR), polychloroprene (neoprene), acrylonitrile butadine rubber (nitrile rubber), silicone rubber (polysiloxane) dan isoprene rubber.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(216, 0, '20211', 4, '20211', 199, 'INDUSTRI BAHAN BAKU PEMBERANTAS HAMA (BAHAN AKTIF)', 'mencakup usaha pembuatan bahan baku untuk pestisida, seperti buthyl phenyl methyl carbamat (BPMC), methyl isopropyl carbamat (MIPC), diazinon, carbofuran, glyphosate, monocrotophos, arsentrioxyde dan copper sulphate.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(217, 0, '20212', 4, '20212', 200, 'INDUSTRI PEMBERANTAS HAMA (FORMULASI)', 'mencakup usaha pengolahan bahan aktif menjadi pemberantas hama (pestisida) dalam bentuk siap dipakai seperti insektisida, fungisida, rodentisida, herbisida, nematisida, molusida dan akarisida. Termasuk juga pembuataan disinfektan untuk pertanian dan kegunaan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(218, 0, '20213', 4, '20213', 201, 'INDUSTRI ZAT PENGATUR TUMBUH', 'mencakup usaha pengolahan bahan kimia menjadi zat pengatur tumbuh, seperti atonik, ethrel, cepha, dekamon, mixtalol, hidrasil dan sitozim', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(219, 0, '20214', 4, '20214', 202, 'INDUSTRI BAHAN AMELIORAN (PEMBENAH TANAH)', 'mencakup usaha pembuatan bahan amelioran (pembenah tanah) seperti kapur pertanian, kapur fosfat, dolomit, zeolit dan bahan amelioran yang mengandung bahan organik.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(220, 0, '20221', 4, '20221', 203, 'INDUSTRI  CAT DAN TINTA CETAK', 'mencakup usaha pembuatan macam-macam cat, seperti cat dasar, cat logam, cat kayu, cat tembok, cat kapal, cat epoksi dan email dan lacquer. Termasuk Industri pigmen dan bahan celup olahan, pewarna dan opacifier (pembuat tidak jelas), industri email pengkilap dan pelapis dan preparat sejenisnya, tinta cetak dan cat untuk melukis.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(221, 0, '20222', 4, '20222', 204, 'INDUSTRI PERNIS (TERMASUK MASTIK)', 'mencakup usaha pembuatan berbagai macam pernis, seperti pelarut komposit organik dan tiner dan penghapus cat atau pernis. Termasuk Mastik.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(222, 0, '20223', 4, '20223', 205, 'INDUSTRI LAK', 'mencakup usaha pembuatan lak. Termasuk industri dempul dan plamur atau senyawa dempul dan dempul non refraktori atau bahan penutup permukaan sejenis.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(223, 0, '20231', 4, '20231', 206, 'INDUSTRI SABUN DAN BAHAN PEMBERSIH KEPERLUAN RUMAH TANGGA', 'mencakup usaha pembuatan sabun dalam berbagai bentuk, baik padat, bubuk, cream atau cair, industri pembuatan deterjen dan bahan pembersih rumah tangga lainnya, seperti pembersih lantai organik; kertas, gumpalan kapas, laken dan sebagainya yang dilapisi dengan sabun atau deterjen seperti tisue basah; gliserol mentah; pembersih permukaan, seperti bubuk pencuci baik padat maupun cair dan deterjen, preparat pencuci piring dan pelembut bahan pakaian; produk pembersih dan pengkilap, seperti pengharum dan deodorant ruangan, lilin buatan dan lilin olahan (wax), pengilap dan krim untuk barang dari kulit, pengilap dan krim untuk kayu, pengilap kaca dan logam, pasta dan bubuk gosok, termasuk kertas, gumpalan dan lain-lain yang dilapisi dengan pasta dan bubuk penggosok.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(224, 0, '20232', 4, '20232', 207, 'INDUSTRI KOSMETIK, TERMASUK PASTA GIGI', 'mencakup usaha pembuatan kosmetik, seperti tata rias muka, wangi-wangian atau parfum, produk perawatan rambut seperti shampo, obat pengeriting dan pelurus rambut, produk perawatan kuku atau menikur dan pedikur, produk perawatan kulit seperti krim atau lotion pencegah terbakar sinar matahari dan krim atau lotion agar kulit terlihat cokelat setelah berjemur, produk untuk kebersihan badan seperti sabun mandi, deodorant, garam mandi dan obat perontok bulu, krim cukur dan kosmetik tradisional. Termasuk pasta gigi dan produk untuk menjaga higienitas, termasuk produk pengkilap gigi dan perekat gigi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(225, 0, '20291', 4, '20291', 208, 'INDUSTRI PEREKAT/LEM', 'mencakup usaha pembuatan perekat/lem untuk keperluan industri atau alat rumah tangga yang berasal dari tanaman, hewan atau plastik, seperti starch, perekat dari tulang, cellulose ester dan ether, phenol formaldehyde, urea formaldehyde, melamine formaldehyde dan perekat epoksi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(226, 0, '20292', 4, '20292', 209, 'INDUSTRI BAHAN PELEDAK', 'mencakup usaha pembuatan barang peledak, seperti mesiu, dinamit, detonator, kembang api, petasan, mercuri fulminat dan bahan pendorong roket.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(227, 0, '20293', 4, '20293', 210, 'INDUSTRI TINTA', 'mencakup usaha pembuatan macam-macam tinta, seperti tinta tulis dan tinta khusus', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(228, 0, '20294', 4, '20294', 211, 'INDUSTRI MINYAK ATSIRI', 'mencakup usaha pembuatan minyak atsiri, seperti minyak jahe, minyak keningar, minyak ketumbar, minyak cengkeh, minyak kapol, minyak pala, minyak melati, minyak kenanga, minyak mawar, minyak akar wangi, minyak sereh, minyak nilam, minyak cendana, minyak kayu putih, minyak permen, minyak rempah-rempah, minyak jarak dan minyak dari rumput-rumputan/semak, daun dan kayu yang belum termasuk kelompok manapun.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(229, 0, '20295', 4, '20295', 212, 'INDUSTRI KOREK API', 'mencakup usaha pembuatan korek api dalam bentuk batangan (matches). Pembuatan batu korek api (flint) dimasukkan dalam kelompok 23990. Industri korek api dari logam (lighter) dimasukkan dalam kelompok 32909', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(230, 0, '20299', 4, '20299', 213, 'INDUSTRI BARANG KIMIA LAINNYA YTDL', 'mencakup usaha pembuatan bermacam-macam bahan-bahan dan barang-barang kimia yang belum diklasifikasikan dalam kelompok manapun seperti gelatin, bahan isolasi panas selain plastik dan karet, bahan semir/polish. Termasuk juga pembuatan film yang peka terhadap cahaya dan kertas fotografi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(231, 0, '20301', 4, '20301', 214, 'INDUSTRI SERAT/BENANG/STRIP FILAMEN BUATAN', 'mencakup usaha pembuatan serat (tow), benang (yarn) atau strip filamen buatan, seperti poliamid, polipropilen, akrilik, selulosa asetat dan sebagainya untuk diolah lebih lanjut dalam industri tekstil.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(232, 0, '20302', 4, '20302', 215, 'INDUSTRI SERAT STAPEL BUATAN', 'mencakup usaha pembuatan serat stapel buatan, seperti poliamid, poliester, rayon viscose, akri lik, selulosa asetat dan sebagainya (kecuali serat gelas dan serat optik) untuk diolah lebih lanjut dalam industri tekstil. Serat stapel adalah serat buatan yang putus-putus.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(233, 0, '21011', 4, '21011', 216, 'INDUSTRI BAHAN FARMASI', 'mencakup usaha pembuatan dan pengolahan bahan obat, bahan pembantu dan bahan pengemas, yang berasal dari bahan kimia, bahan alam, hewan dan tumbuh-tumbuhan termasuk yang berasal dari hasil biologis, seperti bahan obat-obatan, seperti antisera dan fraksi darah lainnya, vaksin dan preparat homeopatik. Termasuk industri substansi aktif obat untuk bahan farmakologi dalam industri obat-obatan, seperti antibiotik, vitamin, salisilik dan asam o-asetilsalsilik dan lain-lain, pengolahan darah, industri gula murni kimia dan pengolahan kelenjar dan industri ekstraksi kelenjar dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(234, 0, '21012', 4, '21012', 217, 'INDUSTRI PRODUK FARMASI UNTUK MANUSIA', 'mencakup usaha pembuatan dan pengolahan obat-obatan, suplemen kesehatan, yang berbentuk jadi (sediaan) untuk manusia, misalnya dalam bentuk tablet, kapsul, salep, bubuk, larutan, larutan parenteral dan suspensi, sabun antiseptic serta benang bedah. Termasuk industri produk kontrasepsi untuk penggunaan eksternal dan obat kontrasepsi hormonal, industri alat-alat diagnosa medis, termasuk uji kehamilan, industri substansi diagnosa in-vivo radioaktif, industri farmasi bioteknologi dan industri pembalut medis, perban dan sejenisnya dan kapas kosmetik.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(235, 0, '21013', 4, NULL, 0, 'INDUSTRI PRODUK FARMASI UNTUK HEWAN', 'mencakup usaha pembuatan dan pengolahan obat-obatan yang berbentuk jadi (sediaan) untuk hewan, misalnya dalam bentuk tablet, kapsul, salep, bubuk, larutan, dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(236, 0, '21021', 4, '21021', 218, 'INDUSTRI BAHAN BAKU OBAT TRADISIONAL', 'mencakup usaha pengolahan macam-macam ekstrak dan simplisia, sediaan galenik, bahan tambahan atau bahan lainnya, baik yang berkhasiat maupun yang tidak berkhasiat, yang berubah maupun yang tidak berubah, yang digunakan dalam pengolahan obat tradisional, walaupun tidak semua bahan tersebut masih terdapat di dalam produk ruahan.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(237, 0, '21022', 4, '21022', 219, 'INDUSTRI PRODUK OBAT TRADISIONAL', 'mencakup usaha pengolahan macam-macam produk obat tradisional yang bahannya berasal dari tumbuh-tumbuhan, bahan hewan, bahan mineral, sediaan sarian (galenik), atau campuran dari bahan tersebut yang berbentuk serbuk, rajangan, pil, dodol/jenang, pastiles, tablet, kapsul, cairan, larutan, emulsi dan suspensi, salep, krim dan gel, supositoria. Termasuk industri minuman jamu seperti temulawak, beraskencur, kunyit asam dan lainnya', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(238, 0, '22111', 4, '22111', 220, 'INDUSTRI BAN LUAR DAN BAN DALAM', 'mencakup usaha pembuatan ban luar dan ban dalam dengan bahan utamanya dari karet alam ataupun karet buatan untuk semua jenis kendaraan bermotor, sepeda, kendaraan angkutan lainnya dan peralatan yang memakai ban.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(239, 0, '22112', 4, '22112', 221, 'INDUSTRI VULKANISIR BAN', 'mencakup usaha perbaikan ban yang telah terpakai (ban bekas) menjadi seperti ban baru, sehingga dapat digunakan lagi untuk kendaraan bermotor, sepeda, kendaraan angkutan lainnya dan peralatan yang memakai ban.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(240, 0, '22121', 4, '22121', 222, 'INDUSTRI PENGASAPAN KARET', 'mencakup usaha pengasapan karet yang dilakukan dengan tujuan mengawetkan karet, seperti Ribbed Smoked Sheet (RSS) dan brown crepe dari pengasapan.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(241, 0, '22122', 4, '22122', 223, 'INDUSTRI REMILLING KARET', 'mencakup usaha pengolahan karet dengan cara digiling sehingga menghasilkan karet dalam bentuk lembaran, seperti sheet (lembaran karet halus) dan crepe (lembaran karet yang berkeriput).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(242, 0, '22123', 4, '22123', 224, 'INDUSTRI KARET REMAH (CRUMB RUBBER)', 'mencakup usaha pengolahan karet yang menghasilkan karet remah, termasuk karet spon (busa).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(243, 0, '22191', 4, '22191', 225, 'INDUSTRI BARANG DARI KARET UNTUK KEPERLUAN RUMAH TANGGA', 'mencakup usaha pembuatan barang-barang dari karet, untuk keperluan rumah tangga, seperti karpet karet, selang karet, tabung, pipa atau selang air, benang dan tali karet, benang rajut atau tenun dan kain berlapis karet, penutup bingkai penggulung dari karet, matras karet yang bisa dipompa, balon yang bisa dipompa, sikat dari karet dan matras waterbed (kasur air) dari karet. Termasuk keset, tali timba dan pot bunga.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(244, 0, '22192', 4, '22192', 226, 'INDUSTRI BARANG DARI KARET UNTUK KEPERLUAN INDUSTRI', 'mencakup usaha pembuatan barang-barang dari karet, untuk keperluan industri, seperti belt conveyor, fan belt, dock fender, engine mounting, lining dari karet, karet berbentuk plat, lembaran, potongan, batangan dan bentuk profil, perkakas, cincin dan segel dari karet, batang pipa untuk uap panas dari karet keras dan bahan repair dari karet.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(245, 0, '22199', 4, '22199', 227, 'INDUSTRI BARANG DARI KARET LAINNYA YTDL', 'mencakup usaha pembuatan barang lainnya dari karet, seperti pembuatan barang dari ban bekas dan sisa macam-macam barang dari karet, antara lain sarung kontrasepsi (KB)/kondom, dot, botol air panas dan sarung tangan karet. Termasuk barang-barang karet untuk pakaian (jika hanya disatukan bersama, bukan dijahit), sisir, jepit rambut, rol rambut dan sejenisnya dari karet keras, kain tekstil yang diresapi, dilapisi atau dilaminasi dengan karet, di mana karet adalah bahan pokok, topi dan baju mandi dari karet, jas hujan dan pakaian menyelam dari karet dan alat-alat seks dari karet.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(246, 0, '22210', 4, '22210', 228, 'INDUSTRI BARANG DARI PLASTIK UNTUK BANGUNAN', 'mencakup usaha pembuatan barang dari plastik untuk bangunan, seperti pintu, jendela, kusin, daun penutup jendela, kerai, skirting boards dari plastik, tangki, tandon air dari plastik, penutup lantai, dinding dan langit-langit plastik dalam bentuk gulungan atau lembaran dan peralatan kebersihan dari plastik, seperti hordeng plastik, shower, wastafel, lavatory pan, bak penyiram (flushing) dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(247, 0, '22220', 4, '22220', 229, 'INDUSTRI BARANG DARI  PLASTIK UNTUK PENGEMASAN', 'mencakup usaha pembuatan kemasan dari plastik, seperti tas atau kantong plastik, sak atau karung plastik, kemasan kosmetik, kemasan film, kemasan obat, kemasan makanan dan kemasan lainnya dari plastik (wadah, botol, boks, kotak, rak dan lain-lain)', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(248, 0, '22230', 4, '22230', 230, 'INDUSTRI PIPA PLASTIK DAN PERLENGKAPANNYA', 'mencakup usaha pembuatan pipa dan selang dari plastik, seperti pipa PVC/PE/PP dan selang plastik PVC/PE/PP. Termasuk tabung plastik dan perlengkapan pipa.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(249, 0, '22291', 4, '22291', 231, 'INDUSTRI BARANG PLASTIK LEMBARAN', 'mencakup usaha pembuatan barang plastik lembaran, seperti plastik lembaran berbagai jenis PE/PP/PVC, kulit imitasi, formika, kaca plastik dan plastik lembaran lainnya. Termasuk plate plastik, lembaran plastik, balok plastik, film, foil, potongan plastik dan lain-lain (baik berperekat atau tidak).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(250, 0, '22292', 4, '22292', 232, 'INDUSTRI PERLENGKAPAN DAN PERALATAN RUMAH TANGGA (TIDAK TERMASUK FURNITUR)', 'mencakup usaha pembuatan barang-barang perlengkapan dan peralatan rumah tangga dari plastik, seperti tikar, karpet, ember, sikat gigi, vas dan peralatan rumah tangga lainnya. Termasuk industri peralatan makan, peralatan dapur dan barang-barang toilet plastik serta industri penutup lantai elastis, seperti vynil, linoleum dan sebagainya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(251, 0, '22293', 4, '22293', 233, 'INDUSTRI BARANG DAN PERALATAN TEKNIK/INDUSTRI DARI PLASTIK', 'mencakup usaha pembuatan barang-barang dan peralatan teknik/industri dari plastik, seperti bagian-bagian mesin dari plastik, botol-botol, pipa-pipa dan lemari plastik untuk keperluan teknik/industri. Termasuk industri ban berjalan pembawa barang (conveyer belt).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(252, 0, '22299', 4, '22299', 234, 'INDUSTRI BARANG PLASTIK LAINNYA YTDL', 'mencakup usaha pembuatan barang-barang yang belum diklasifikasikan dimanapun, seperti peralatan kantor/pendidikan, peralatan kesehatan/laboratorium dari plastik, film atau lembaran kertas kaca (cellophane), batu buatan dari plastik, tanda dari plastik (bukan listrik), berbagai barang plastik, seperti tutup kepala, peralatan penyekat, bagian dari peralatan penerangan, barang-barang kantor atau sekolah, barang-barang pakaian (jika hanya disegel atau disatukan, tidak dijahit), perlengkapan untuk furnitur, patung, tape perekat dari plastik, kertas dinding plastik, alas sepatu dari plastik, pegangan cerutu dan rokok dari plastik, sisir, pengeriting rambut dari plastik, barang kesenangan dari plastik dan sebagainya. Termasuk juga pembuatan barang dari busa plastik. Pembuatan barang-barang peralatan olahraga dimasukkan dalam kelompok 32300. Pembuatan mainan anak-anak dari plastik dimasukkan dalam kelompok 32402. Pembuatan tas, buku saku dan sejenisnya dari kulit dan kulit buatan diklasifikasikan dalam kelompok 15121', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(253, 0, '23111', 4, '23111', 235, 'INDUSTRI KACA LEMBARAN', 'mencakup usaha pembuatan macam-macam kaca lembaran, seperti kaca lembaran bening tak berwarna, kaca lembaran bening berwarna, kaca lembaran buram berwarna, kaca patri, kaca berukir dan kaca cermin.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(254, 0, '23112', 4, '23112', 236, 'INDUSTRI KACA PENGAMAN', 'mencakup usaha pembuatan macam-macam kaca pengaman seperti kaca pengaman diperkeras, kaca pengaman berlapis, kaca pengaman isolasi dan kaca pengaman lainnya', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(255, 0, '23119', 4, '23119', 237, 'INDUSTRI KACA LAINNYA', 'mencakup usaha pembuatan macam-macam kaca yang belum termasuk kelompok 23111 dan 23112, seperti tubes, rods, kaca batangan atau kaca pipa', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(256, 0, '23121', 4, '23121', 238, 'INDUSTRI PERLENGKAPAN DAN PERALATAN RUMAH TANGGA DARI KACA', 'mencakup usaha pembuatan macam-macam perlengkapan rumah tangga dari kaca , seperti cangkir, piring, mangkok, teko, stoples, asbak dan botol susu bayi. Termasuk juga usaha pembuatan barang-barang pajangan dari kaca, seperti patung atau arca dari kaca, vas, lampu kristal, semprong lampu tekan dan semprong lampu tempel.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(257, 0, '23122', 4, '23122', 239, 'INDUSTRI ALAT-ALAT LABORATORIUM, FARMASI DAN KESEHATAN DARI KACA', 'mencakup usaha pembuatan macam-macam alat laboratorium, farmasi dan kesehatan dari gelas, seperti botol serum/infus, ampul, tabung uji, tabung ukur, kaca sorong mikroskop, cuvet dan dessicator.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(258, 0, '23123', 4, '23123', 240, 'INDUSTRI KEMASAN DARI KACA', 'mencakup usaha pembuatan macam-macam barang untuk kemasan dari kaca, seperti botol dan guci. Termasuk wadah lain dari kaca atau kristal.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(259, 0, '23129', 4, '23129', 241, 'INDUSTRI BARANG LAINNYA DARI KACA', 'mencakup usaha pembuatan macam-macam barang lainnya dari gelas yang belum tercakup dalam kelompok 23121 s.d. 23123 seperti tasbih, rosario, manik gelas, gelas enamel dan aquarium, serat kaca (fiberglass), termasuk produk-produk dari wol kaca dan non woven kaca, kaca jam dinding atau kaca arloji, kaca dan elemen optik yang tidak bekerja secara optis, barang kaca yang digunakan pada perhiasan imitasi dan kaca isolasi dan perlengkapan isolasi kaca. Termasuk juga usaha pembuatan bahan bangunan dari gelas seperti bata, ubin, genteng, paving blocks dan sekat dinding dari kaca.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(260, 0, '23911', 4, '23911', 242, 'INDUSTRI BATA, MORTAR, SEMEN, DAN SEJENISNYA YANG TAHAN API', 'mencakup usaha pembuatan macam-macam bata tahan api, mortar tahan api dan semen tahan api, beton dan komposit sejenisnya yang tahan api, seperti alumina, silica dan basic.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1);
INSERT INTO `m_kbli` (`id`, `server_id`, `kode`, `direktorat_id`, `kode2009`, `kbli2009_id`, `kbli`, `deskripsi`, `created`, `modified`, `ipaddress`, `dataactive`) VALUES
(261, 0, '23919', 4, '23919', 243, 'INDUSTRI BARANG TAHAN API DARI TANAH LIAT/KERAMIK LAINNYA', 'mencakup usaha pembuatan macam-macam barang tahan api, selain bata tahan api. Termasuk barang keramik penyekat panas dari tepung fossil siliceous; ubin dan balok refraktori; tabung kimia atau labu destilasi, wadah tempat melebur logam, penyaring, tabung, pipa dan sebagainya; dan barang refraktori yang mengandung magnet, dolomit atau kromit.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(262, 0, '23921', 4, '23921', 244, 'INDUSTRI BATU BATA DARI TANAH LIAT/KERAMIK', 'mencakup usaha pembuatan macam-macam batu bata seperti bata pres, bata berongga, bata hiasan, bata bukan pres dan bata lubang. Termasuk juga pembuatan semen merah dan kerikil tanah liat.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(263, 0, '23922', 4, '23922', 245, 'INDUSTRI GENTENG DARI TANAH LIAT/KERAMIK', 'mencakup usaha pembuatan macam-macam genteng tanah liat/keramik, seperti genteng pres, genteng biasa, genteng kodok dan genteng yang diglazur.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(264, 0, '23923', 4, '23923', 246, 'INDUSTRI PERALATAN SANITER DARI PORSELEN', 'mencakup usaha pembuatan macam-macam peralatan saniter dari porselen seperti kloset, bidet, wastafel, urinoir, bak cuci, bak mandi dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(265, 0, '23929', 4, '23929', 247, 'INDUSTRI BAHAN BANGUNAN DARI TANAH LIAT/KERAMIK BUKAN BATU BATA DAN GENTENG', 'mencakup usaha pembuatan barang dari tanah liat/keramik untuk keperluan bahan bangunan bukan batu bata, genteng dan peralatan saniter dari porselen, seperti saluran air, ubin, lubang angin dan buis (cincin untuk sumur). Termasuk tungku keramik atau ubin dinding non refraktori, kubus mosaik dan sebagainya, paving atau ubin keramik non refraktori, ubin untuk atap, cerobong asap, pipa, saluran keramik dan sebagainya dan balok lantai dari tanah liat yang dibakar.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(266, 0, '23931', 4, '23931', 248, 'INDUSTRI PERLENGKAPAN RUMAH TANGGA DARI PORSELEN', 'mencakup usaha pembuatan macam-macam perlengkapan rumah tangga dari porselen, seperti piring, tatakan, cangkir, mangkok, teko, kendi, sendok , asbak, barang toilet dan toples dan barang-barang sejenis yang digunakan untuk pengangkutan atau pengepakan barang. Termasuk juga usaha pembuatan barang pajangan dari porselen seperti arca atau patung dan barang keramik ornamental lainnya, tempat bunga, kotak rokok dan guci.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(267, 0, '23932', 4, '23932', 249, 'INDUSTRI PERLENGKAPAN RUMAH TANGGA DARI TANAH LIAT/KERAMIK', 'mencakup usaha pembuatan macam-macam barang dari tanah liat untuk perlengkapan rumah tangga, pajangan/hiasan dan sejenisnya, seperti piring, cangkir, mangkok, kendi, teko, periuk, tempayan, patung, vas bunga, tempat sirih, kotak sigaret, celengan, toples, dan barang-barang sejenis yang digunakan untuk pengangkutan atau pengepakan barang dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(268, 0, '23933', 4, '23933', 250, 'INDUSTRI ALAT LABORATORIUM DAN ALAT LISTRIK/TEKNIK DARI PORSELEN', 'mencakup usaha membuatan macam-macam alat laboratorium, listrik dan teknik serta perlengkapan dari porselen seperti lumpang dan alu, piring penapis, tabung kimia, botol/guci, cawan, rumah sekering, insulator, isolator tegangan rendah dan isolator tegangan tinggi. Termasuk magnet ferit dan keramik dan barang-barang keramik laboratorium, kimia dan industrial.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(269, 0, '23939', 4, '23939', 251, 'INDUSTRI BARANG TANAH LIAT/KERAMIK DAN PORSELEN LAINNYA BUKAN BAHAN BANGUNAN', 'mencakup usaha pembuatan macam-macam barang dari tanah liat/keramik dan porselen lainnya bukan bahan bangunan yang belum tercakup dalam kelompok 23931 sampai dengan 23933. Termasuk furnitur keramik dan barang-barang keramik lainnya, ytdl.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(270, 0, '23941', 4, '23941', 252, 'INDUSTRI SEMEN', 'mencakup usaha pembuatan macam-macam semen (semen hidrolik dan arang atau kerak besi), seperti portland, natural, semen mengandung alumunium, semen terak dan semen superfosfat dan jenis semen lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(271, 0, '23942', 4, '23942', 253, 'INDUSTRI KAPUR', 'mencakup usaha pembuatan macam-macam kapur dari batu kapur, seperti kapur tohor, kapur tembok dan kapur lepaan. Termasuk kapur slaked lime dan kapur hidrolik.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(272, 0, '23943', 4, '23943', 254, 'INDUSTRI GIPS', 'mencakup usaha pembuatan gips, yang terbentuk dari calcined gipsum atau calsium sulphate. Termasuk calcined dolomite.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(273, 0, '23951', 4, '23951', 255, 'INDUSTRI  BARANG DARI SEMEN', 'mencakup usaha pembuatan macam-macam barang dari semen, seperti patung, pot kembang dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(274, 0, '23952', 4, '23952', 256, 'INDUSTRI BARANG DARI KAPUR', 'mencakup usaha pembuatan macam-macam barang dari kapur, seperti kapur tulis, kapur gambar, batako dan dempul.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(275, 0, '23953', 4, '23953', 257, 'INDUSTRI BARANG DARI SEMEN DAN KAPUR UNTUK KONSTRUKSI', 'mencakup usaha pembuatan macam-macam barang dari semen dan atau kapur atau batu buatan untuk keperluan konstruksi seperti ubin, bata/dinding, pipa beton dan beton praktekan, papan, lembaran, panel, tonggak dan sebagainya, komponen struktur prafabrik untuk gedung atau bangunan sipil dan bahan-bahan bangunan dari substansi tumbuh-tumbuhan (wol kayu, alang-alang, jerami dan lain-lain) yang disatukan dengan semen atau bahan pencampur mineral lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(276, 0, '23954', 4, '23954', 258, 'INDUSTRI BARANG DARI GIPS UNTUK KONSTRUKSI', 'mencakup pembuatan barang dari gips yang digunakan dalam konstruksi, seperti papan, lembaran, panel dan lain-lain. Termasuk Industri bahan bangunan dari substansi tumbuh-tumbuhan (wol kayu, alang-alang, jerami dan lain-lain) yang disatukan plester gips.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(277, 0, '23955', 4, '23955', 259, 'INDUSTRI BARANG DARI ASBES UNTUK KEPERLUAN BAHAN BANGUNAN', 'mencakup usaha pembuatan macam-macam barang dari asbes untuk keperluan bahan bangunan seperti asbes gelombang, asbes rata, pipa asbes bertekanan dan asbes berlapis.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(278, 0, '23956', 4, '23956', 260, 'INDUSTRI BARANG DARI ASBES UNTUK KEPERLUAN INDUSTRI', 'mencakup usaha pembuatan macam-macam barang dari asbes untuk keperluan industri.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(279, 0, '23957', 4, '23957', 261, 'INDUSTRI MORTAR ATAU BETON SIAP PAKAI', 'mencakup usaha pembuatan mortar atau beton siap pakai (ready mixed and dry mixed concrete and mortar).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(280, 0, '23959', 4, '23959', 262, 'INDUSTRI BARANG DARI SEMEN, KAPUR, GIPS DAN ASBES LAINNYA', 'mencakup usaha pembuatan macam-macam barang dari semen, kapur, gips dan asbes lainnya, yang belum tercakup dalam kelompok 23951 sampai dengan 23957, seperti industri barang dari semen serat selulosa atau sejenisnya, seperti reservoir, palung atau bak, kolam, bak cuci piring, guci, mebel, rangka jendela dan lain-lain, barang lainnya dari beton, plester gips, semen atau batu buatan, seperti patung, furnitur, relief gambar timbul dan sebagainya dan mortar bubuk.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(281, 0, '23961', 4, '23961', 263, 'INDUSTRI BARANG DARI MARMER DAN GRANIT UNTUK KEPERLUAN RUMAH TANGGA DAN PAJANGAN', 'mencakup usaha pembuatan macam-macam barang dari marmer/granit untuk keperluan rumah tangga dan pajangan, seperti daun meja, ornamen dan patung. Termasuk pembuatan furnitur dari marmer dan granit.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(282, 0, '23962', 4, '23962', 264, 'INDUSTRI BARANG DARI MARMER DAN GRANIT UNTUK KEPERLUAN BAHAN BANGUNAN', 'mencakup usaha pembuatan macam-macam barang dari marmer/granit untuk keperluan bahan bangunan, seperti ubin dan bak mandi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(283, 0, '23963', 4, '23963', 265, 'INDUSTRI BARANG DARI BATU UNTUK KEPERLUAN RUMAH TANGGA, PAJANGAN, DAN BAHAN BANGUNAN', 'mencakup usaha pembuatan macam-macam barang dari batu untuk keperluan rumah tangga, pajangan, dan bahan bangunan, seperti lumpang, cobek, batu pipisan, batu asah, batu lempengan, batu pecah-pecahan, abu batu dan kubus mozaik.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(284, 0, '23969', 4, '23969', 266, 'INDUSTRI BARANG DARI MARMER, GRANIT DAN BATU LAINNYA', 'mencakup usaha pembuatan macam-macam barang dari batu marmer, granit atau batu lainnya untuk keperluan lainnya yang belum tercakup dalam kelompok 23961 hingga 23963, seperti industri batu monumen.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(285, 0, '23990', 4, '23990', 267, 'INDUSTRI BARANG GALIAN BUKAN LOGAM LAINNYA YTDL', 'mencakup usaha pembuatan macam-macam barang dari bahan galian lainnya yang belum tercakup di tempat lain, seperti tepung kaolin, tepung gips, dan tepung talk. Termasuk juga usaha pembuatan kertas penggosok (abrasive paper) dan gerinda, penajaman dan pengilapan batu dan batu abrasi atau penggosok baik alami atau buatan, batu korek api (lighter flint); bahan friksi dan barang tak berbingkai dengan bahan pokok substansi mineral atau selulosa; bahan penyekat dari mineral, seperti wol terak, wol batu dan jenis wol lainnya; exfoliated vermiculate, tanah liat yang dikembangkan dan sejenis penyekat dengan panas, bahan penyerap suara; barang dari berbagai substansi mineral, seperti mika dan barang dari mika, barang dari tanah gemuk (peat) sebagai bahan pembakar, barang dari grafit (barang elektris); barang dari aspal atau material sejenisnya, misalnya perekat berbahan dasar aspal, ter batu bara dan sebagainya; dan karbon dan serat grafit dan barang turunannya (kecuali elektroda dan peralatan elektris).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(286, 0, '24101', 4, '24101', 268, 'INDUSTRI BESI DAN BAJA DASAR (IRON AND STEEL MAKING)', 'mencakup usaha pembuatan besi dan baja dalam bentuk dasar, seperti pellet bijih besi, besi spons, besi kasar (pig iron) dan pembuatan besi dan baja dalam bentuk baja kasar seperti ingot baja, billet baja, baja bloom dan baja slab. Termasuk juga pembuatan besi dan baja paduan. Termasuk kegiatan tungku pembakar, steel converter, pabrik penggulungan dan finishing; produksi besi kasar dalam bentuk dasar seperti balok; produksi besi campuran; produksi produk besi yang direduksi langsung dari bijih besi dan produk besi berongga lainnya; produksi besi dari hasil pemurnian dengan proses elektrolisis dan proses kimia lainnya; produksi butir besi dan bubuk besi; produksi baja batangan (ingot) atau bentuk dasar lainnya; peleburan kembali ingot sisaan besi atau baja; dan produksi baja setengah jadi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(287, 0, '24102', 4, '24102', 269, 'INDUSTRI PENGGILINGAN BAJA (STEEL ROLLING)', 'mencakup usaha penggilingan baja, baik penggilingan panas maupun dingin, yang membuat produk-produk gilingan batang kawat baja, baja tulangan, baja profil (H-beam, I-beam dan sejenisnya), baja strip, baja rel, pelat baja, baja lembaran hasil gilingan panas (hot rolled sheet) dan baja lembaran hasil gilingan dingin (cold rolled sheet) dilapisi atau tidak dilapisi dengan logam atau non logam lainnya termasuk penggilingan baja scrap. Termasuk industri baja balok atau potongan gulungan panas, industri baja open section gulungan panas, industri baja balok dan baja solid section hasil proses cold drawing, grinding dan turning, industri baja open section hasil pembentukan dingin progresif pada mesin penggulung atau pelipatan pada mesin pres atau pada penggulungan flat baja, industri kawat baja hasil cold drawing atau stretchuing, industri lembaran tiang pancang baja atau baja las open section, industri material rel kereta api baja (rel belum terpasang).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(288, 0, '24103', 8, '24103', 270, 'INDUSTRI PIPA DAN SAMBUNGAN PIPA DARI BAJA DAN BESI', 'mencakup usaha pembuatan tabung, pipa dan sambungan pipa dari besi dan baja. Termasuk Industri tabung, pipa dan profile berongga baja tanpa kelim hasil pembentukan gulungan panas, hot drawing atau hot extruding, gulungan dingin atau cold drawing; industri tabung dan pipa baja las hasil pengelasan dan pembentukan panas atau dingin, sebagai proses lanjutan dari gulungan dingin atau cold drawing; dan industri fittings pipa baja, seperti flat flanges dan flanges with forged collar, butt-welded fittings, threaded fittings dan socket-welded fiitings.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(289, 0, '24201', 8, '24201', 271, 'INDUSTRI PEMBUATAN LOGAM DASAR MULIA', 'mencakup usaha pemurnian, peleburan, pemaduan dan penuangan logam mulia dalam bentuk dasar (ingot, billet, slab, batang, pellet, block, sheet, pig, paduan dan bubuk) seperti ingot perak, ingot emas, pellet platina dan sebagainya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(290, 0, '24202', 8, '24202', 272, 'INDUSTRI PEMBUATAN LOGAM DASAR BUKAN BESI', 'mencakup usaha pemurnian, peleburan, pemaduan dan penuangan logam-logam bukan besi dalam bentuk dasar (ingot, billet, slab, batang, pellet, block, sheet, pig, paduan dan bubuk) seperti ingot kuningan, ingot aluminium, ingot seng, ingot tembaga, ingot timah, billet kuningan, billet aluminium, slab kuningan, slab aluminium, batang (rod) kuningan, batang aluminium, pellet kuningan, pellet aluminium, paduan perunggu, paduan nikel dan logam anti gesekan (bearing metal).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(291, 0, '24203', 8, '24203', 273, 'INDUSTRI PENGGILINGAN LOGAM BUKAN BESI', 'mencakup usaha penggilingan logam bukan besi, baik penggilingan panas maupun penggilingan dingin, seperti pelat tembaga, pelat aluminium, sheet (lembaran) tembaga, sheet aluminium, strip (jalur) perak, strip seng, strip aluminium, sheet tembaga, sheet magnesium, tin foil dan strip platina. Termasuk pembuatan kawat logam.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(292, 0, '24204', 8, '24204', 274, 'INDUSTRI EKSTRUSI LOGAM BUKAN BESI', 'mencakup usaha ekstrusi logam bukan besi, seperti ekstrusi tembaga dan paduannya, ekstrusi aluminium dan ekstrusi tungsten.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(293, 0, '24205', 8, '24205', 275, 'INDUSTRI PIPA DAN SAMBUNGAN PIPA DARI LOGAM BUKAN BESI DAN BAJA', 'mencakup usaha pembuatan tabung, pipa dan sambungan pipa dari logam bukan besi dan baja', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(294, 0, '24206', 8, '24206', 276, 'INDUSTRI PENGOLAHAN URANIUM DAN BIJIH URANIUM', 'mencakup pemurnian logam uranium dari bijih uranium atau bijih lainnya yang mengandung uranium, pengolahan uranium alam dan persenyawaannya, pengayaan uranium dan persenyawaannya, plutonium dan persenyawaannya, atau pemisahan dan penggabungan persenyawaan tersebut.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(295, 0, '24310', 8, '24310', 277, 'INDUSTRI PENGECORAN BESI DAN BAJA', 'mencakup usaha peleburan, pencampuran dan pengecoran atau penuangan logam besi dan baja yang menghasilkan produk-produk tuangan dalam bentuk kasar, seperti besi tuang, baja tuang dan baja tuang paduan. Termasuk pengecoran produk besi setengah jadi, pengecoran besi tuang abu-abu, pengecoran besi tuang grafit spheroid, pengecoran besituang yang dapat ditempa, pengecoran produk baja setengah jadi, pengecoran baja tuang, industri tabung, pipa dan profile berongga serta fittings tabung dan pipa yang terbuat dari besi tuang, industri tabung dan pipa baja tanpa kelim dari proses pengecoran sentrifugal dan industri tabung dan pipa fittings yang terbuat dari baja tuang.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(296, 0, '24320', 8, '24320', 278, 'INDUSTRI PENGECORAN LOGAM BUKAN BESI DAN BAJA', 'mencakup usaha peleburan, pemaduan dan pengecoran atau penuangan logam-logam bukan besi dalam bentuk dasar, seperti tuangan tembaga dan paduannya, tuangan aluminium dan paduannya, tuangan nikel dan paduannya. Termasuk Pengecoran produk setengah jadi dari aluminium, magnesium, titanium, seng dan lain-lain, pengecoran logam ringan tuang, pengecoran logam berat tuang, pengecoran logam mulia tuang dan die-casting logam bukan besi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(297, 0, '25111', 8, '25111', 279, 'INDUSTRI BARANG DARI LOGAM BUKAN ALUMINIUM SIAP PASANG UNTUK BANGUNAN', 'mencakup usaha pembuatan bahan bangunan siap pasang dari logam bukan aluminium, seperti pagar besi, teralis, pintu/jendela, lubang angin, tangga dan produk-produk konstruksi ringan lainnya. Industri pembuatan bahan konstruksi berat siap pasang dari baja, seperti untuk jembatan, menara listrik tegangan tinggi, pintu air dan sejenisnya dimasukkan dalam kelompok 25113, sedangkan industri pembuatan ketel uap, bejana tekan dan sejenisnya dimasukkan dalam kelompok 25120.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(298, 0, '25112', 8, '25112', 280, 'INDUSTRI BARANG DARI LOGAM ALUMINIUM SIAP PASANG UNTUK BANGUNAN', 'mencakup usaha pembuatan bahan bangunan siap pasang dari logam aluminium, seperti kusen jendela, kusen pintu, teralis aluminium, atap aluminium (awning), rolling door, krei aluminium dan produk-produk konstruksi ringan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(299, 0, '25113', 8, '25113', 281, 'INDUSTRI KONSTRUKSI BERAT SIAP PASANG DARI BAJA UNTUK BANGUNAN', 'mencakup usaha pembuatan bahan bangunan konstruksi berat siap pasang dari baja untuk jembatan, bangunan hanggar, menara listrik tegangan tinggi, pintu air dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(300, 0, '25119', 8, '25119', 282, 'INDUSTRI BARANG DARI LOGAM SIAP PASANG UNTUK KONSTRUKSI LAINNYA', 'mencakup usaha pembuatan barang-barang dari logam siap pasang untuk konstruksi yang belum tercakup dalam kelompok 25111 s.d. 25113.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(301, 0, '25120', 8, '25120', 283, 'INDUSTRI TANGKI, TANDON AIR DAN WADAH DARI LOGAM', 'mencakup usaha pembuatan ketel uap untuk proses pengolahan (industri boiler), ketel untuk keperluan pembangkit tenaga (utility boiler), bejana tekan (presure vessel), scrubber dan sejenisnya. Termasuk pula usaha pembuatan tangki-tangki lainnya yang bertekanan seperti autoclave, tabung gas bertekanan (tabung gas LPG), tangki-tangki silo, alat penukar panas (heat exchanger) dan berbagai jenis alat penghasil uap gas lainnya. Termasuk tandon, tangki dan wadah dari logam yang secara umum dibuat untuk perlengkapan/tempat penyimpanan atau untuk keperluan industri dan ketel pemanas dan radiator.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(302, 0, '25130', 8, '25130', 284, 'INDUSTRI GENERATOR UAP, BUKAN KETEL PEMANAS', 'mencakup usaha pembuatan generator uap, termasuk komponen dan perlengkapannya, seperti steam accumulatator, economizer dan sejenisnya. Termasuk industri mesin uap lainnya, mesin tambahan yang digunakan dengan generator uap (kondenser, economizer, superheater, steam collectors dan accumulators), reaktor nuklir kecuali pemisah isotop dan suku cadang ketel kapal laut atau ketel tenaga.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(303, 0, '25200', 8, '25200', 285, 'INDUSTRI SENJATA DAN AMUNISI', 'mencakup pembuatan senjata berat (meriam, mobile guns, peluncur roket, tabung torpedo, senjata mesin berat), pembuatan senjata ringan/kecil (revolver, senapan, senapan mesin ringan) baik untuk militer atau polisi, pembuatan senjata gas dan amunisinya, senapan angin atau pistol dan amunisi perang. Termasuk pembuatan senjata api untuk berburu, olahraga atau perlindungan dan amunisinya, alat peledak seperti bom, granat, torpedo, ranjau, roket dan sebagainya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(304, 0, '25910', 8, '25910', 286, 'INDUSTRI PENEMPAAN, PENGEPRESAN, PENCETAKAN DAN PEMBENTUKAN LOGAM; METALURGI BUBUK', 'mencakup pembuatan berbagai barang jadi dan setengah jadi dari logam baik baja, besi maupun logam bukan besi menjadi logam dalam bentuk logam tempaan, pres-an dan atau logam gulungan.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(305, 0, '25920', 8, '25920', 287, 'JASA INDUSTRI UNTUK BERBAGAI PENGERJAAN KHUSUS LOGAM DAN BARANG DARI LOGAM', 'mencakup kegiatan jasa industri untuk pelapisan, pemolesan, pewarnaan, pengukiran, pengerasan, pengkilapan, pengelasan, pemotongan dan berbagai pekerjaan khusus terhadap logam atau barang-barang dari logam. Kegiatannya termasuk industri penyepuhan logam, anodizing dan lain-lain; industri pengolahan panas logam; deburring, penyemprotan pasir (sandbalasting), perobohan (tumbling) dan pembersihan logam; industri pewarnaan dan pengukiran atau pemahatan logam; industri pelapisan bukan metalik logam, seperti pelapisan dengan plastik, email atau porselain, lak/pernis dan lain-lain; industri pengerasan dan pengkilapan logam; industri pengeboran, pengolahan, penggilingan, pengikisan, pembentukan, pemutaran, broaching, leveling, penggergajian, penghalusan, penajaman, penyemiran, pengelasan, penyambungan dan lain-lain bagian pekerjaan logam; dan industri pemotongan atau penulisan pada logam dengan sinar laser.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(306, 0, '25931', 8, '25931', 288, 'INDUSTRI ALAT POTONG DAN PERKAKAS TANGAN UNTUK PERTANIAN', 'mencakup usaha pembuatan alat-alat/perkakas tangan pertanian yang tidak digerakkan dengan tenaga dari logam, seperti cangkul, sekop, bajak, garu, sabit, ani-ani, alat perontok padi, alat pemipil jagung dan hand sprayer.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(307, 0, '25932', 8, '25932', 289, 'INDUSTRI ALAT POTONG DAN PERKAKAS TANGAN PERTUKANGAN', 'mencakup usaha pembuatan alat-alat pertukangan dari logam, seperti water pass, siku-siku, beliung, pahat, obeng, martil, serut/ketam, gergaji dan mata gergaji, mata gergaji bundar dan mata gergaji rantai, mata bor dan sejenisnya, kampak dan pisau pemotong kaca. Termasuk industri pisau dan mata pisau untuk mesin atau untuk peralatan mekanik, perkakas tangan (tang, obeng dan lain-lain), perkakas tangan pertanian yang tidak digerakkan dengan tenaga, alat yang dapat dipertukarkan untuk perkakas tangan, baik yang tidak digerakkan dengan tenaga atau mesin perkakas (seperti bor, pemukul, pisau penggiling dan lain-lain), perkakas pengepres, perkakas pandai besi (seperti alat tempa, landasan tempa dan lain-lain), kotak cetakan dan cetakan (kecuali cetakan ingot) dan perkakas kelim.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(308, 0, '25933', 8, '25933', 290, 'INDUSTRI ALAT POTONG DAN PERKAKAS TANGAN YANG DIGUNAKAN DALAM RUMAH TANGGA', '4mencakup usaha pembuatan bermacam-macam pisau, parang/golok, pisau bergerigi, pisau cukur, silet, gunting, hair clipper, gunting rambut, gunting kuku, sendok, garpu dan peralatan sejenisnya yang digunakan di dapur dan meja makan. Industri alat-alat dapur (misalnya periuk, panci, dandang dan kompor) dimasukkan dalam kelompok 25992.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(309, 0, '25934', 8, '25934', 291, 'INDUSTRI PERALATAN UMUM', 'mencakup usaha pembuatan peralatan lainnya dari logam yang belum termasuk dalam kelompok 25931 s.d. 25933, misalnya kunci, gembok, kunci pintu, engsel, gerendel dan peralatan sejenisnya untuk bangunan, furnitur dan lainnya. Termasuk industri pisau pendek atau belati, pedang, bayonet dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(310, 0, '25940', 8, '25940', 292, 'INDUSTRI EMBER, KALENG, DRUM DAN WADAH SEJENIS DARI LOGAM', 'mencakup usaha pembuatan wadah dari logam/kaleng, seperti kaleng makanan/minuman, kaleng cat/bahan kimia lainnya, tong, drum, ember, kotak, jerrycan dan sejenisnya. Termasuk industri metallic closure.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(311, 0, '25951', 8, '25951', 293, 'INDUSTRI BARANG DARI KAWAT', 'mencakup usaha pembuatan macam-macam barang dari kawat logam, termasuk tali kawat logam, seperti kawat berduri, pagar kawat, kasa kawat, jaring kawat dan alat pemanggang (grill). Industri kabel listrik dan komunikasi dimasukkan dalam kelompok 27310. Termasuk industri pegas (selain pegas jam), seperti leaf springs, helical springs, torsion bar springs dan lembaran untuk pegas dan industri rantai (kecuali power transmission chain).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(312, 0, '25952', 8, '25952', 294, 'INDUSTRI PAKU, MUR DAN BAUT', 'mencakup usaha pembuatan paku, mur, baut dan barang berulir sejenis yang terbuat dari besi, baja, tembaga, alumunium dan logam lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(313, 0, '25991', 8, '25991', 295, 'INDUSTRI BRANKAS, FILLING KANTOR DAN SEJENISNYA', 'mencakup pembuatan alat-alat kantor dari logam, seperti brankas, filling cabinet, tidak termasuk furnitur dari logam. Termasuk industri peti besi, lemari besi, pintu lapis baja dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(314, 0, '25992', 8, '25992', 296, 'INDUSTRI PERALATAN DAPUR DAN PERALATAN MEJA DARI LOGAM', 'mencakup usaha pembuatan alat-alat dapur baik dari alumunium maupun dari logam bukan alumunium seperti peralatan makan, piring, piring ceper, mangkok, teko, panci, wajan ketel, periuk, dandang, ketel masak, rantang, baskom, baki, pot dan sejenisnya. Termasuk peralatan bukan listrik lainnya yang digunakan di meja atau di dapur, peralatan kecil dapur lainnya yang digerakkan dengan tangan dan aksesorinya dan alat penggosok dari logam.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(315, 0, '25993', 8, '25993', 297, 'INDUSTRI KEPERLUAN RUMAH TANGGA DARI LOGAM BUKAN PERALATAN DAPUR DAN PERALATAN MEJA', 'mencakup usaha pembuatan alat-alat untuk keperluan rumah tangga lainnya baik dari alumunium maupun dari logam bukan alumunium seperti jemuran, tangga, lemari dapur dan lain-lain. Termasuk industri bak mandi, bak cuci (piring), wastafel dan peralatan sejenis.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(316, 0, '25994', 8, '25994', 298, 'INDUSTRI PEMBUATAN PROFIL', 'mencakup usaha pembuatan baja profil dengan cara las, seperti profil H (H-Beam), profil I (I-Beam) dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(317, 0, '25995', 8, '25995', 299, 'INDUSTRI LAMPU DARI LOGAM', 'mencakup usaha pembuatan macam-macam lampu yang bahan utamanya dari logam, seperti lampu mercu suar, lampu tekan dan lampu gantung termasuk komponennya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(318, 0, '25999', 8, '25999', 300, 'INDUSTRI BARANG LOGAM LAINNYA YTDL', 'mencakup usaha pembuatan macam-macam barang dari logam, yang belum tercakup di subgolongan manapun seperti jepitan rambut, peniti, stapless, paper clips, jarum, jarum jahit, jarum bordir dan jarum sejenisnya, kepala gesper, rantai logam, bel, bingkai (lis) gambar, papan nama logam dan berbagai barang logam yang kecil. Termasuk baling-baling, rantai kapal, jangkar kapal, lonceng, perlengkapan tetap (fixture) rel kereta api yang terpasang, kabel logam yang dijalin pembalut sejenisnya, kabel logam yang tidak terisolasi atau kabel logam terisolasi yang tidak dapat digunakan sebagai konduktor listrik, paku dan paku payung, paku sumbat/keling, cincing penutup dan barang-barang tidak berulir sejenis, screw machine product, kantong timah, magnet logam permanen, botol atau kendi logam hampa udara, tanda logam (bukan listrik), lencana logam dan lencana militer logam dan pengeriting rambut dan sisir logam, kerangka dan pegangan payung.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(319, 0, '26110', 10, '26110', 301, 'INDUSTRI TABUNG ELEKTRON DAN KONEKTOR ELEKTRONIK', 'mencakup pembuatan tabung gambar televisi, tabung kamera televisi, tabung dan katup amplifier dan receiver. Termasuk tabung elektron, konektor elektronik, kabel printer, kabel monitor, kabel USB, konektor dan lain-lain, katup elektonik dan tabung lampu.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(320, 0, '26120', 10, '26120', 302, 'INDUSTRI SEMI KONDUKTOR DAN KOMPONEN ELEKTRONIK LAINNYA', 'mencakup pembuatan semi konduktor dan komponen elektronik lainnya, seperti transistor dan peralatan semi konduktor yang sejenis, integrated circuits, printed circuits, induktor, resistor, kapasitor dan berbagai komponen elektronik lainnya. Termasuk industri mikroprosesor, induktor jenis komponen elektronik (misalnya cok, gulungan, trafo), kristal elektronik dan crystal assemblies, solenoida, switch dan transducer untuk aplikasi elektronik, interface cards (misalnya sound (kartu suara), video (kartu video), kontroler, kartu jaringan, modem), komponen layar (plasma, polimer, LCD), light emitting diodes (LED), IC atau integrated circuit (analog, digital, maupun hibrid) dan dioda. Termasuk juga pembuatan sel fotovoltaik dan chip smartcard.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(321, 0, '26210', 10, '26210', 303, 'INDUSTRI KOMPUTER DAN/ATAU PERAKITAN KOMPUTER', 'mencakup usaha pembuatan berbagai macam mesin komputasi, seperti komputer desktop, komputer laptop, komputer mainframe, komputer ukuran tangan (misal PDA), tablet, dan server komputer. Termasuk kegiatan perakitan komputer.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(322, 0, '26220', 10, '26220', 304, 'INDUSTRI PERLENGKAPAN KOMPUTER', 'mencakup pembuatan perlengkapan komputer, seperti disk drive magnetik, flash drive dan alat penyimpanan lainnya, disk drive optik (misalnya CD-RW, CD-ROM, DVD-ROM, DVD-RW), printer, monitor, keyboard, mouse, joystick, dan aksesori trackball, terminal komputer, scanner, bar code scanner, smart card reader, virtual reality helmets, proyektor komputer (video beamer). Termasuk industri terminal komputer, seperti anjungan tunai mandiri (ATM), terminal point of sale (POS), yang tidak dioperasikan secara mekanis dan peralatan kantor multifungsi, seperti kombinasi faks-scanner-fotokopi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(323, 0, '26310', 10, '26310', 305, 'INDUSTRI PERALATAN TELEPON DAN FAKSIMILI', 'mencakup pembuatan alat-alat transmisi komunikasi, seperti peralatan pesawat telepon dan faksimili, termasuk di dalamnya mesin penjawab dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(324, 0, '26320', 10, '26320', 306, 'INDUSTRI PERALATAN KOMUNIKASI TANPA KABEL (WIRELESS)', 'mencakup pembuatan alat-alat transmisi komunikasi, seperti peralatan Ipager, telepon selular dan peralatan komunikasi bergerak (mobile) dan lainnya', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(325, 0, '26391', 10, NULL, 0, 'INDUSTRI KARTU CERDAS (SMART CARD)', 'mencakup pembuatan smart card, seperti perencanaan design chip (design house), perencanaan tata letak sirkuit smart card, industri chip foundry, industri chip module packaging, pembuatan firmware dan software yang berkaitan langsung dengan smart card, chip packaging. Contoh smart card seperti simcard, Nerd Field Communications (NFC), dengan teknologi 2G, 3G, 4G, 5G dst, kartu perbankan, kartu akses, micro dan macro payment, kartu kredit dan semua kartu yang menggunakan pengaman data dan atau komunikasi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(326, 0, '26399', 10, NULL, 0, 'INDUSTRI PERALATAN KOMUNIKASI LAINNYA', 'mencakup pembuatan alat-alat transmisi komunikasi lainnya, peralatan Private Branch Exchange (PBX), peralatan komunikasi data (bridge, router, gateway), pesawat telepon tanpa kabel, peralatan TV kabel, antena transmisi (pemancar) dan penerima, peralatan studio televisi dan radio dan peralatan siaran termasuk kamera televisi, modem peralatan carrier, sistem alarm kebakaran dan pencurian, transmitor radio dan televisi, peralatan infrared (misalnya remote kontrol) dan lainnya. Termasuk juga pembuatan set top box untuk terestrial dan satelit.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(327, 0, '26410', 10, '26410', 308, 'INDUSTRI TELEVISI DAN/ATAU PERAKITAN TELEVISI', 'mencakup pembuatan televisi, seperti pesawat penerima televisi dan kombinasi, monitor televisi dan pertunjukan. Termasuk perakitan televisi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(328, 0, '26420', 10, '26420', 309, 'INDUSTRI PERALATAN PEREKAM, PENERIMA DAN PENGGANDA AUDIO DAN VIDEO, BUKAN INDUSTRI TELEVISI', 'mencakup pembuatan peralatan audio dan video elektronik untuk hiburan di rumah (home entertainment) untuk rumah tangga dan kendaraan bermotor, seperti pesawat penerima radio dan kombinasi, tape recorder dan video recorder. Termasuk industri peralatan stereo, pemutar CD dan VCD/DVD, kamera video jenis rumah tangga dan jukebox.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(329, 0, '26490', 10, '26490', 310, 'INDUSTRI PERALATAN AUDIO DAN VIDEO ELEKTRONIK LAINNYA', 'mencakup pembuatan peralatan elektronika untuk rumah tangga, seperti mikrofon, loudspeaker, headphone, amplifier dan sebagainya. Termasuk industri mesin karaoke, headphone (radio, stereo, komputer) dan console video game dan lainnya', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(330, 0, '26511', 10, '26511', 311, 'INDUSTRI ALAT UKUR DAN ALAT UJI MANUAL', 'mencakup usaha pembuatan alat-alat pengukur, pemeriksa dan pengujian manual, baik yang ada maupun yang tidak ada hubungannya dengan penyelidikan ilmu pengetahuan, seperti pesawat ukur, mikroskop (kecuali mikroskop optis), thermometer, barometer, kompas, timbangan presisi, pesawat terapi mekanis, meteran air ledeng dan gas, serta instrumen ukur tanah. Termasuk juga perlengkapan dari peralatan-peralatan tersebut', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(331, 0, '26512', 10, '26512', 312, 'INDUSTRI ALAT UKUR DAN ALAT UJI ELEKTRIK', 'mencakup usaha pembuatan alat-alat pengukur, pemeriksa dan pengujian elektrik, baik yang ada maupun yang tidak ada hubungannya dengan penyelidikan ilmu pengetahuan, seperti meteran arus listrik. Termasuk juga perlengkapan dari peralatan-peralatan tersebut.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(332, 0, '26513', 10, '26513', 313, 'INDUSTRI ALAT UKUR DAN ALAT UJI ELEKTRONIK', 'mencakup usaha pembuatan alat-alat laboratorium, alat-alat pengukur dan pemeriksa elektronik, baik yang ada maupun yang tidak ada hubungannya dengan penyelidikan ilmu pengetahuan, seperti pesawat pengatur elektronik otomatis, speedometer, argometer, elektronik sinar katoda, radar, radio kontrol dan instrumen navigasi, meteorologi, geofisika, hidrologi dan spectofotometer. Termasuk juga perlengkapan dari peralatan-peralatan tersebut.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(333, 0, '26514', 10, '26514', 314, 'INDUSTRI ALAT UJI DALAM PROSES INDUSTRI', 'mencakup pembuatan berbagai peralatan pengukuran dan kontrol dari barang-barang yang sedang diproses, baik alat ukur panas, tekanan, kekentalan, maupun alat ukur sifat-sifat barang.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(334, 0, '26520', 10, '26520', 315, 'INDUSTRI ALAT UKUR WAKTU', 'mencakup usaha pembuatan macam-macam jam seperti arloji tangan, arloji saku, arloji kalung, jam dinding, jam beker dan lonceng. Termasuk juga usaha pembuatan bagian-bagian dari jam/arloji, seperti movement part, dial plate/hand, pegas, batu baterai, lempeng jam, jarum dan bagian lainnya, case (badan) jam dan arloji, termasuk case (badan) dari logam mulia, alarm for watch, instrumen panel clocks, crono meter, stop watch, pencatat waktu parking, pencatat waktu datang dan pulang pegawai (pencatat waktu absen), Time/date stamps dan pencatat waktu proses,Time locks (pengunci waktu) dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(335, 0, '26601', 10, '26601', 316, 'INDUSTRI PERALATAN IRADIASI/SINAR X, PERLENGKAPAN DAN SEJENISNYA', 'mencakup usaha pembuatan peralatan dan tabung iradiasi (penyinaran) yang didasarkan pada penggunaan radiasi sinar X, Alpha, Beta, atau Gamma, baik yang digunakan pada manusia maupun hewan, seperti peralatan industri, peralatan iradiasi susu dan makanan, diagnosa medis, terapi medis, penelitian dan ilmu pengetahuan. Misalnya peralatan radiasi sinar X, beta, gamma dan sinar lainnya. Termasuk pula pembuatan tabung sinar X, kontrol panel, screen dan yang terkait, serta peralatan sterilisasi dengan sinar ultra violet.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(336, 0, '26602', 10, '26602', 317, 'INDUSTRI PERALATAN ELEKTROMEDIKAL DAN ELEKTROTERAPI', 'mencakup pembuatan peralatan dan perlengkapan elektromedikal dan elektroterapi, seperti peralatan electrocardiograph, peralatan test mata (termasuk reflektor, endoscope dan lain-lain), ozone therapy, oxygen therapy, Termasuk CT scanner, PET scanner, peralatan MRI (magnetic resonce imaging), peralatan ultrasound medis, peralatan endoskopi elektromedikal, peralatan laser medis, peralatan alat bantu dengar dan peralatan alat pacu jantung.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(337, 0, '26710', 10, '26710', 318, 'INDUSTRI PERALATAN FOTOGRAFI', 'mencakup usaha pembuatan macam-macam kamera fotografi, seperti kamera foto biasa, kamera langsung jadi, kamera untuk micro film, kamera digital, kamera untuk still picture dan kamera untuk penelitian udara.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(338, 0, '26791', 10, '26791', 319, 'INDUSTRI KAMERA CINEMATOGRAFI PROYEKTOR DAN PERLENGKAPANNYA', 'mencakup usaha pembuatan macam-macam kamera cinematografi, proyektor, seperti kamera cinematografi, proyektor cinematografi, image proyektor, slide projector, overhead transparancy projector, aparat cahaya kilat fotografi, frame kamera, tempat film dan lensa kamera zoom. Termasuk alat pengukur cahaya untuk fotografi.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(339, 0, '26792', 10, '26792', 320, 'INDUSTRI TEROPONG DAN INSTRUMEN OPTIK BUKAN KACA MATA', 'mencakup usaha pembuatan teropong dan alat optik serta bagian-bagiannya untuk ilmu pengetahuan dan percetakan seperti teropong monoculer, teropong astronomi, elbow telescope, periscope, optik, spectroscope, spectograph, lensa berlapis diasah, lensa prisma. Termasuk mikroskop optik, binokular dan teleskop, cermin optik, peralatan kaca pembesar optik, peralatan presisi (ketepatan) masinis optik, komparator optik, peralatan pembidik senjata optik, peralatan positioning optik, peralatan dan instrumen pengukuran dan pemeriksaan optik (misalnya peralatan pengontrol api/fire control equipment, pengukur jarak) dan peralatan laser. juga mencakup industri pelapisan, penggosokan lensa dan mounting lensa (bukan opthalmik) dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(340, 0, '26800', 10, '26800', 321, 'INDUSTRI MEDIA MAGNETIK DAN MEDIA OPTIK', 'mencakup usaha pembuatan media rekam magnetik dan optik untuk suara, gambar maupun data, yang bahan utamanya dari plastik, seperti pita audio dan video magnetik kosong, kaset audio dan video magnetik kosong, piringan hitam kosong, film yang belum peka terhadap cahaya, pita untuk merekam data dan disk/diskette kosong dan disk optik kosong dan media hard drive. Usaha pembuatan film yang peka terhadap cahaya dimasukkan dalam kelompok 20299. Usaha rekaman suara dengan media pita kaset, piringan hitam dimasukkan dalam kelompok 59201. Sedangkan rekaman gambar film dan pita video dimasukkan dalam subgolongan 5911 (Produksi gambar Bergerak, Video dan Program Televisi). Usaha rekaman data dengan pita, disk/diskette dan sejenisnya yang menggunakan jasa komputer dimasukkan dalam kelompok 62090.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(341, 0, '27111', 10, '27111', 322, 'INDUSTRI MOTOR LISTRIK', 'mencakup usaha pembuatan motor listrik dan komponen/bagiannya, seperti motor AC, motor DC, stator, rotor, brush dan commutator, kecuali mesin pembakaran dalam untuk menyalakan motor.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(342, 0, '27112', 10, '27112', 323, 'INDUSTRI MESIN PEMBANGKIT LISTRIK', 'mencakup usaha pembuatan generator dan komponen/bagiannya seperti generator arus bolak-balik, generator arus searah, generator set, stator, rotor, commutator dan rotary converter. Termasuk generator tenaga (kecuali alternator pengisi baterai untuk mesin pembakaran dalam), perangkat generator motor (kecuali perangkat generator turbin) dan perangkat generator penggerak utama.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(343, 0, '27113', 10, '27113', 324, 'INDUSTRI PENGUBAH TEGANGAN (TRANSFORMATOR), PENGUBAH ARUS (RECTIFIER) DAN PENGONTROL TEGANGAN (VOLTAGE STABILIZER)', 'mencakup usaha pembuatan transformator, pengubah arus, pengontrol tegangan dan komponen/bagiannya, seperti transformator distribusi, transformator tenaga, pengubah arus AC ke DC , pengontrol tegangan, radiator, ring bike lite dan commutator. Usaha pembuatan generator kendaraan dan cranking motor dimasukkan dalam kelompok 27403. Termasuk transformator distribusi listrik, transformator arc-welding, flourescent ballast atau lighting ballast, transformator sub stasiun untuk distribusi tenaga listrik dan pengatur transmisi dan distribusi voltase listrik.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(344, 0, '27120', 10, '27120', 325, 'INDUSTRI PERALATAN PENGONTROL DAN PENDISTRIBUSIAN LISTRIK', 'mencakup usaha pembuatan panel listrik dan switch gear serta komponen/bagiannya, seperti control panel otomatis, ligthing distribution board, pemutus aliran listrik, pemutus arus dan control desk, control panel dan pengaliran sakelar tertutup. Termasuk sakelar pemutus aliran listrik, angker dinamo untuk untuk pabrik, surge suppressor/penindas sentakan listrik (untuk distribusi tingkat voltase), panel kontrol untuk distribusi tenaga listrik, relay listrik, pipa/saluran peralatan papan penghubung/switchboard aliran listrik, sekering listrik, peralatan pemindah tenaga (power switching), saklar tenaga listrik (kecuali tombol tekan, snap, solenoida, tumbler) dan KWH meter.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(345, 0, '27201', 10, '27201', 326, 'INDUSTRI BATU BATERAI', 'mencakup usaha pembuatan segala macam batu baterai, seperti sel dan baterai listrik primer, baterai alkali, dan baterai mercury. Termasuk baterai dan sel-sel utama, baik yang mengandung mangan dioksida, merkuri dioksida, perak oksida atau lainnya, baterai asam timah, baterai Ni-Cad, baterai Ni-Mh, baterai Lithium, baterai cell kering dan baterai cell basah. Termasuk penggunaan untuk baterai HP dan baterai laptop.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(346, 0, '27202', 10, '27202', 327, 'INDUSTRI AKUMULATOR LISTRIK', 'mencakup usaha pembuatan macam-macam akumulator listrik, aki dan komponennya seperti aki dari 6V atau 12V dengan kekuatan 200 amper atau kurang, pelat aki, separator, wadah, penutup, pole dan jepitan aki (tipe gigi).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(347, 0, '27310', 10, '27310', 328, 'INDUSTRI KABEL SERAT OPTIK', 'mencakup usaha pembuatan kabel serat optik', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(348, 0, '27320', 10, '27320', 329, 'INDUSTRI KABEL LISTRIK DAN ELEKTRONIK LAINNYA', 'mencakup usaha pembuatan macam-macam kabel listrik dan kabel elektronik yang dibalut dengan isolator atau berpenyekat dari baja, tembaga atau aluminium, seperti kabel komunikasi atau telepon, kabel listrik jaringan tegangan rendah/menengah/ tinggi. Usaha pembuatan kawat/kabel logam tanpa dibalut dimasukkan dalam kelompok 24202.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(349, 0, '27330', 10, '27330', 330, 'INDUSTRI PERLENGKAPAN KABEL', 'mencakup usaha pembuatan fitting, sakelar, stop kontak dan sebagainya, seperti batang penghantar, konduktor listrik (kecuali jenis switchgear), GFCI (ground fault circuit interrupter), lamp holder, penangkal petir dan koil, steker untuk untuk perangkat kawat listrik (misalnya penekan, tombol tekan, snap, tumbler switcher), outlet dan socket listrik (stop kontak), kotak untuk peralatan kawat listrik (seperti junction, outlet, switch box), kabel dan peralatan listrik, kutub transmisi dan line hardware dan plastik untuk peralatan kawat bukan pembawa arus termasuk kotak plastik junction, face plates dan sejenisnya dan peralatan pole line plastik.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(350, 0, '27401', 10, '27401', 331, 'INDUSTRI BOLA LAMPU PIJAR, LAMPU PENERANGAN TERPUSAT DAN LAMPU ULTRAVIOLET', 'mencakup usaha pembuatan macam-macam lampu pijar untuk penerangan, seperti bohlam tidak termasuk fitting dan perlengkapannya, penerangan fotografi (flash bulbs) dan penerangan untuk panggung/lampu sorot (spot light). Termasuk lampu ultra violet dan infra red, lampu senter, penerangan pada alat-alat kedokteran. Usaha pembuatan peralatan penerangan pada sepeda dan kendaraan bermotor dimasukkan pada kelompok 27403', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(351, 0, '27402', 10, '27402', 332, 'INDUSTRI LAMPU TABUNG GAS (LAMPU PEMBUANG LISTRIK)', 'mencakup usaha pembuatan macam-macam lampu tabung gas dan discharge, seperti lampu neon, lampu helium, lampu argon, lampu natrium dan lampu mercury. Termasuk lampu listrik serangga.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(352, 0, '27403', 10, '27403', 333, 'INDUSTRI PERALATAN PENERANGAN UNTUK ALAT TRANSPORTASI', 'mencakup pembuatan peralatan penerangan untuk alat transportasi motor, mobil, pesawat, kapal dan alat transportasi lainnya (lampu rem, lampu tanda berbelok, lampu interior dan sebagainya). Termasuk usaha pembuatan komponen dan perlengkapannya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(353, 0, '27404', 10, NULL, 0, 'INDUSTRI LAMPU LED', 'mencakup usaha pembuatan lampu LED, baik berupa lampu LED terpisah maupun dirakit menjadi lampu untuk kebutuhan tertentu. Misalnya lampu LED lampu senter, kendaraan mauapu pencahayaan umum.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(354, 0, '27409', 10, '27409', 334, 'INDUSTRI PERALATAN PENERANGAN LAINNYA', 'mencakup usaha pembuatan atau industri peralatan penerangan yang dipasang di langit-langit, tempat lilin (chandeliers), lampu meja, perangkat lampu hias pohon natal, batang perapian listrik, lentera (dengan bahan bakar karbit, listrik, gas, bensin, minyak tanah), peralatan lampu jalan (kecuali rambu-rambu lalu lintas) dan peralatan penerangan bukan listrik. Termasuk komponen lampu listrik seperti stater, filamen dan reflektor. Industri ballast tercakup di kelompok 27113.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(355, 0, '27510', 10, '27510', 335, 'INDUSTRI PERALATAN LISTRIK RUMAH TANGGA', 'mencakup pembuatan selimut listrik, penghisap debu (vacuum cleaners), pengkilat lantai (floor polishers), tempat sampah listrik, peralatan untuk mengolah dan mempersiapkan makanan (grinders, blenders, pembuka kaleng, juicers, dan sebagainya) dan peralatan listrik lainnya seperti sikat gigi listrik, alat-alat cukur listrik dan alat-alat perawatan tubuh listrik lainnya, pengasah pisau listrik dan sebagainya. Termasuk kulkas (refrigerator), mesin pencuci piring, mesin pencuci dan pengering pakaian, unit pembuangan/tempat sampah dan kap ventilasi. Pembuatan mesin cuci, mesin pengering dan sejenisnya dalam bentuk yang besar atau untuk kepentingan niaga dimasukkan dalam kelompok 28262. Pembuatan mesin jahit baik untuk keperluan rumah tangga maupun tidak dimasukkan dalam kelompok 28262.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(356, 0, '27520', 10, '27520', 336, 'INDUSTRI PERALATAN ELEKTROTERMAL RUMAH TANGGA', 'mencakup pembuatan kompor (misalnya oven, microwave oven, cookers, hot plates, toasters, pembuat kopi dan teh, frypans, roasters, penggorengan dan pemanggang listrik dan hoods dan sebagainya), alat pemanas dan alat masak dengan menggunakan arus listrik, kipas angin dan pemanas ruangan. Termasuk industri peralatan elektrotermal rumah tangga, seperti alat pemanas air listrik, selimut listrik, alat listrik untuk perawatan rambut (pengering, sisir, sikat, pengeriting), setrika listrik, alat resistor pemanas listrik dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(357, 0, '27530', 10, '27530', 337, 'INDUSTRI PERALATAN PEMANAS DAN MASAK BUKAN LISTRIK RUMAH TANGGA', 'mencakup pembuatan atau industri peralatan masak dan pemanas bukan listrik rumah tangga, seperti kompor masak, panggangan, pemanas air, peralatan masak lain, penghangat makanan, penghangat piring dan lain-lain dan pemanas ruangan bukan listrik, seperti tungku atau perapian.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1);
INSERT INTO `m_kbli` (`id`, `server_id`, `kode`, `direktorat_id`, `kode2009`, `kbli2009_id`, `kbli`, `deskripsi`, `created`, `modified`, `ipaddress`, `dataactive`) VALUES
(358, 0, '27900', 10, '27900', 338, 'INDUSTRI PERALATAN LISTRIK LAINNYA', 'mencakup pembuatan dinamo lampu sepeda, dinamo magnetik, busi, alat-alat peringatan suara (sirine, klakson, alarm, bel, dan sebagainya), peralatan sinyal listrik seperti alat-alat pengatur lalu-lintas jalan raya, jalan kereta api, di pelabuhan laut dan udara dan sinyal untuk pejalan kaki, berbagai peralatan listrik dan elektronik yang tidak termasuk kelompok manapun, seperti charger (pengisi) baterai padat, alat pembuka dan penutup pintu listrik, mesin pembersih ultrasonik (kecuali untuk laboratorium, dokter gigi), penyamak kasur (tanning beds), peralatan solid state inverter, peralatan rektifikasi, fuel cells, penyuplai daya teregulasi dan tidak teregulasi, UPS (uninterruptible power supllies), supresor gelombang (kecuali untuk distribusi level voltase), kabel peralatan, kabel sambungan, perangkat kabel listrik lainnya yang berpenyekat dan berkonektor, karbon dan grafit elektroda, kontak dan produk karbon dan grafit listrik lainnya, akselerator partikel, kapasitor, resistor, kondenser listrik dan komponen sejenisnya, elektromagnet, papan skor listrik, reklame listrik, insulator (penyekat) listrik (kecuali penyekat kaca atau porselen), peralatan patri dan solder listrik, besi solder tangan dan pembuatan peralatan modul fotovoltaik (panel surya). Termasuk usaha pembuatan komponen dan perlengkapannya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(359, 0, '28111', 10, '28111', 339, 'INDUSTRI MESIN UAP, TURBIN DAN KINCIR', 'mencakup usaha pembuatan motor penggerak yang bukan berupa motor bakar dalam, seperti mesin uap, turbin dan bagian-bagiannya, turbin uap dan turbin sejenis lainnya, turbin hidrolik, kincir air dan regulatornya, turbin angin dan turbin gas/udara, kecuali turbojet atau turbo baling-baling untuk pesawat terbang; perangkat turbin-ketel (boiler-turbine), perangkat generator-turbin dan kincir angin.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(360, 0, '28112', 10, '28112', 340, 'INDUSTRI MOTOR PEMBAKARAN DALAM', 'mencakup usaha pembuatan motor penggerak mula dengan bahan pembakaran dalam, baik berupa motor bakar cetus api maupun motor bakar nyala kompresi, seperti motor diesel, motor bensin, motor bakar dalam dengan bahan bakar gas/alkohol, dan sejenisnya. Termasuk Industri mesin piston pembakaran dalam (kecuali mesin kendaraan bermotor, pesawat terbang dan mesin penggerak putaran), seperti mesin kapal laut dan mesin kereta api. Usaha pembuatan motor pembakaran dalam untuk kendaraan bermotor roda empat atau lebih dimasukkan dalam kelompok 29300. Usaha pembuatan motor pembakaran dalam untuk kendaraan bermotor roda dua dan tiga dimasukkan dalam kelompok 30912, dan motor pembakaran dalam untuk pesawat terbang dimasukan dalam', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(361, 0, '28113', 10, '28113', 341, 'INDUSTRI KOMPONEN DAN SUKU CADANG MESIN DAN TURBIN', 'mencakup usaha pembuatan komponen/suku cadang, dari mesin-mesin penggerak mula (kelompok 28111 dan 28112), seperti engine block, piston, cincin piston, karburator cylinder head dan sejenisnya untuk semua jenis mesin pembakaran dalam, mesin diesel dan sebagainya dan inlet dan klep/katup pelepas gas dari mesin pembakaran dalam.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(362, 0, '28120', 10, '28120', 342, 'INDUSTRI PERALATAN TENAGA ZAT CAIR DAN GAS', 'mencakup usaha pembuatan komponen hidrolik dan pneumatik, termasuk didalamnya pompa hidrolik, motor hidrolik, silinder hidrolik dan pneumatik, klep/katup hidrolik dan pneumatik, perkakas dan pipa karet hidrolik dan pneumatik; peralatan pengolahan udara yang digunakan dalam sistem pneumatik; sistem tenaga zat cair dan gas; dan peralatan transmisi hidrolik.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(363, 0, '28130', 10, '28130', 343, 'INDUSTRI POMPA LAINNYA, KOMPRESOR, KRAN DAN KLEP/KATUP', 'mencakup usaha pembuatan kompresor udara dan gas, kompresor untuk refrigerator dan AC, kompresor untuk kendaraan bermotor, pompa laboratorium, pompa air, pompa udara, pompa vakum atau pompa udara, kompresor udara dan gas lainnya, pompa untuk zat cair baik terpasang alat pengukur ataupun tidak, pompa yang didesain untuk mesin pembakaran dalam, seperti pompa bahan bakar, oli, dan air untuk kendaraan bermotor dan sebagainya. Termasuk katup dan keran air dari logam, seperti klep/katup dan kran untuk keperluan industri, mencakup klep/katup regulasi dan kran pipa masuk; kran dan katup untuk kebersihan (sanitasi); kran dan katup untuk pemanasan; dan pompa tangan. Katup dari karet dimasukkan ke subgolongan 2219. Keran dari porselen dimasukkan ke subgolongan 23932.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(364, 0, '28140', 10, '28140', 344, 'INDUSTRI BEARING, RODA GIGI DAN ELEMEN PENGGERAK MESIN', 'mencakup usaha pembuatan bola dan bantalan poros (ball and roller bearings), termasuk bola, bantalan guling, ring dan bagian-bagian lain dari bearings. Termasuk pula pembuatan komponen dan suku cadang peralatan transmisi mekanik, antara lain cam shafts, poros engkol (crank shafts), engkol, kerangka bearing dan bearing poros sederhana, persneling, roda gigi, bantalan blok, kopling dan poros kopling, roda gendeng dan kerek/katrol, mata rantai bersambung, rantai transmisi tenaga (rantai keteng) dan sebagainya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(365, 0, '28151', 10, '28151', 345, 'INDUSTRI OVEN, PERAPIAN DAN TUNGKU PEMBAKAR SEJENIS YANG TIDAK MENGGUNAKAN ARUS LISTRIK', 'mencakup usaha pembuatan tungku dan alat sejenis yang tidak menggunakan arus listrik, untuk memanaskan, memanggang dan melelehkan bijih besi, logam dan sejenisnya, tungku pembakar, peralatan pemanas rumah tangga bukan listrik permanen untuk daerah pegunungan, seperti peralatan pemanas solar, pemanas uap, pemanas minyak dan peralatan pemanas dan tungku sejenisnya. Termasuk pembuatan mechanical stokers, mechanical grates, mechanical ash discharges dan sejenisnya', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(366, 0, '28152', 10, '28152', 346, 'INDUSTRI OVEN, PERAPIAN DAN TUNGKU PEMBAKAR SEJENIS YANG MENGGUNAKAN ARUS LISTRIK', 'mencakup usaha pembuatan tungku, oven dan alat pemanas lainnya yang penggunaannya memerlukan arus listrik, misalnya peralatan induksi listrik untuk industri dan laboratorium termasuk incinerator, tungku pembakar, peralatan pemanas ruangan listrik permanen untuk daerah pegunungan, pemanas kolam renang listrik dan tungku listrik untuk rumah tangga. Alat pengatur panas untuk makanan, minuman dan tembakau termasuk pula non-electric oven untuk pembuat roti dimasukkan dalam kelompok 28250, sedangkan alat pengukur panas untuk pulp, kertas dan bahan industri lainnya dimasukkan dalam kelompok 28292 dan 28299.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(367, 0, '28160', 10, '28160', 347, 'INDUSTRI ALAT PENGANGKAT DAN PEMINDAH', 'mencakup pembuatan mesin pengangkat dan pemindah (pemuat dan pembongkar) barang dan orang yang digerakkan dengan tangan atau tenaga yang digunakan di pabrik, gudang, pelabuhan, terminal, stasiun kereta api dan sebagainya, seperti katrol kerek (alat kerek), winches, putaran/paksi jangkar dan dongkrak; derrick, crane, mobile lifting frame, staddle carriers dan lain-lain; truk kerja, baik yang memakai alat angkut dan alat angkat maupun tidak, baik yang tidak dilengkapi dengan pendorong maupun yang tidak, dan truk kerja yang digunakan dalam pabrik (termasuk alat angkut dengan tangan dan gerobak tangan); manipulator mekanik dan robot yang khusus dibuat untuk mengangkut, mengangkat, memuat dan membongkar. Termasuk alat pembawa barang, teleferics (kereta gantung) dan lain-lain, lift, eskalator dan pemindah pejalan kaki (lantai bergerak) dan bagian-bagian, komponen dan peralatan khusus alat angkut dan alat angkat. Alat pengangkat dan pemindah seperti traktor yang digunakan di sektor pertanian dimasukkan dalam kelompok 28210. Alat pengangkut dan pemindah yang dibuat khusus untuk penggunaan di bawah tanah dimasukkan dalam kelompok 28240.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(368, 0, '28171', 10, '28171', 348, 'INDUSTRI MESIN KANTOR DAN AKUNTANSI MANUAL', 'mencakup usaha pembuatan macam-macam mesin kantor dan akuntansi secara manual, seperti mesin hitung manual, mesin tik manual, mesin stensil manual, mesin peruncing pensil, sempoa, alat timbang pos (postage meters), mesin pengelola surat (pengisi amplop, penyegel dan mesin pemberi alamat, membuka, mengurutkan, menscan), mesin pemeriksa, mesin stenografi, alat penjilid (penjilid plastik atau pita), mesin penghitung koin dan pembungkus koin, stapler dan pembersih stapler, mesin pemungutan suara, mesin isolasi (tape dispencer) dan mesin pembuat lubang kertas dan sejenisnya. Termasuk pembuatan komponen dan suku cadangnya. Jasa pemeliharaan dan perbaikannya tercakup dalam kelompok 33121.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(369, 0, '28172', 10, '28172', 349, 'INDUSTRI MESIN KANTOR DAN AKUNTANSI ELEKTRIK', 'mencakup usaha pembuatan macam-macam mesin kantor dan akuntansi elektrik, seperti mesin hitung elektrik, mesin tik elektrik, mesin stensil elektrik dan sejenisnya, kalkulator, alat timbang pos (postage meters), mesin pengelola surat (pengisi amplop, penyegel dan mesin pemberi alamat, membuka, mengurutkan, menscan), mesin pemeriksa, mesin stenografi, alat penjilid (contoh penjilid plastik atau pita), mesin pemeriksa tulisan, mesin penghitung koin dan pembungkus koin, peruncing pensil, stapler dan pembersih stapler, mesin pemungutan suara, mesin pembuat lubang kertas. Termasuk usaha pembuatan komponen dan suku cadangnya. Jasa pemeliharaan dan perbaikannya tercakup dalam kelompok 33121.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(370, 0, '28173', 10, '28173', 350, 'INDUSTRI MESIN KANTOR DAN AKUNTANSI ELEKTRONIK', 'mencakup usaha pembuatan macam-macam mesin kantor dan akuntansi elektronik, seperti mesin hitung elektronik, cash register dan sejenisnya. Usaha pembuatan sub assembly dan komponen elektronik mesin komputasi dimasukkan dalam kelompok 26120.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(371, 0, '28174', 10, '28174', 351, 'INDUSTRI MESIN FOTOKOPI', 'mencakup usaha pembuatan mesin fotocopi, mesin electronic sheet, mesin lightdruk dengan sistem optik atau contact type, termasuk perlengkapan dari mesin-mesin tersebut.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(372, 0, '28179', 10, '28179', 352, 'INDUSTRI MESIN DAN PERALATAN KANTOR LAINNYA', 'mencakup usaha pembuatan macam-macam mesin kantor lainnya, seperti toner cartridge, papan tulis, seperti white board dan marker board dan mesin pendikte.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(373, 0, '28180', 10, '28180', 353, 'INDUSTRI PERKAKAS TANGAN YANG DIGERAKKAN TENAGA', 'mencakup usaha pembuatan perkakas tangan (pertukangan) yang digerakkan tenaga, baik dengan motor listrik atau motor bukan listrik atau yang digerakkan dengan tekanan udara, seperti gergaji sirkular dan reciprocating, bor dan bor palu, penabur pasir yang digerakkan dengan tangan, alat pemaku (pneumatik), penyangga (buffers), router, penggerinda, stepler, alat paku tembak, alat ketam/serut, gunting dan catut, kunci inggris dan alat pemaku (powder actuated).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(374, 0, '28191', 10, '28191', 354, 'INDUSTRI MESIN UNTUK PEMBUNGKUS, PEMBOTOLAN DAN PENGALENGAN', 'mencakup pembuatan mesin pembungkus, pembotolan, dan pengalengan yang berfungsi sebagai pengisi, penutup, penyegel, pembungkus dan pemberian label di botol, kaleng dan kotak. Termasuk mesin untuk pengering dan pembersih botol minuman, mesin untuk mencampur udara ke dalam minuman dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(375, 0, '28192', 9, '28192', 355, 'INDUSTRI MESIN TIMBANGAN', 'mencakup pembuatan mesin-mesin timbangan (bukan untuk laboratorium), seperti timbangan untuk keperluan toko, kantor dan rumah tangga, alat penimbang yang menyatu dengan kalkulator, timbangan stasiun, scale for continuous weighing, jembatan timbang dan timbangan lainnya, baik bergerak atau tidak. Termasuk pembuatan komponen dan perlengkapannya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(376, 0, '28193', 9, '28193', 356, 'INDUSTRI MESIN PENDINGIN', 'mencakup pembuatan mesin pendingin dan pembeku (cold storage) untuk tujuan komersial dan perakitan komponen utamanya, seperti lemari pamer (display cases), mesin-mesin penjual (dispense cases), mesin AC (air conditioning) termasuk untuk kendaraan bermotor, kipas angin dan exhaust hood untuk keperluan industri dan laboratorium termasuk pembuatan komponen dan perlengkapannya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(377, 0, '28199', 9, '28199', 357, 'INDUSTRI MESIN UNTUK KEPERLUAN UMUM LAINNYA YTDL', 'mencakup pembuatan mesin umum lainnya, seperti fire sprinklers, mesin penyaring dan pembersih cairan dan gas, unit penyulingan cairan, peralatan untuk proyeksi, penyebaran atau penyemprotan cairan atau bubuk, seperti pistol semprot, pemadam api, mesin penyemprot pasir, mesin pembersih dengan uap air dan lain-lain, mesin penyulingan atau rektifikasi untuk kilang minyak, industry kimia, industry minuman dan lain-lain, mesin penukar panas (heat exchanger), mesin untuk mencairkan udara atau gas, generator gas, mesin penggulung lainnya dan silindernya (kecuali untuk logam dan kaca) termasuk calendering machine (mesin pres), mesin sentrifugal (kecuali mesin pemisah krim dan pengering pakaian), mesin paking dan tali untuk isolasi dan sejenisnya yang terbuat dari kombinasi bahan atau lapisan bahan yang sama, mesin penjual barang otomatis, kipas ventilasi loteng (kipas gable/dinding, ventilasi atap dan lain-lain), meteran pita dan perkakas tangan sejenis, alat presisi masinis (bukan optik) dan peralatan patri dan solder bukan listrik. Termasuk pembuatan komponen dan peralatannya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(378, 0, '28210', 9, '28210', 358, 'INDUSTRI MESIN PERTANIAN DAN KEHUTANAN', 'mencakup usaha pembuatan mesin-mesin untuk penyiapan dan pengolahan lahan pertanian dan kehutanan misalnya traktor dan mesin bajak; mesin-mesin penanam, pemupuk, pemeliharaan tanaman dan pemanenan hasil-hasil (misalnya mesin penabur benih, mesin penugal, mesin penabur pupuk, mesin pemanen, mesin penyemprot, mesin pemotong rumput dan mesin penuai); serta mesin-mesin untuk pengolahan awal hasil pertanian (misalnya mesin perontok, mesin pengupas, mesin penyosoh dan mesin penggilingan gabah), trailer (kereta gandeng) atau semi trailer bongkar muat secara otomatis untuk pertanian, mesin pembersih dan pemilih atau penyortir telur, buah-buahan dan hasil perkebunan, mesin pemerah susu, mesin penghangat unggas, mesin beternak lebah, peralatan untuk penyiapan makanan ternak dan mesin lainnya untuk keperluan tanaman pangan, peternakan, perkebunan dan kehutanan. Termasuk mesin pembuatan komponen dan perlengkapan/implement mesin-mesin pertanian.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(379, 0, '28221', 9, '28221', 359, 'INDUSTRI MESIN DAN PERKAKAS MESIN UNTUK PENGERJAAN LOGAM', 'mencakup pembuatan mesin-mesin/peralatan untuk pengolahan dan pengerjaan logam, seperti mesin perkakas (misalnya mesin bubut, mesin freis, mesin gerinda, mesin gergaji, mesin press, mesin gunting), serta perlengkapan dan komponennya (seperti cutting tools, mould and dies, jig and fixture).', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(380, 0, '28222', 9, '28222', 360, 'INDUSTRI MESIN DAN PERKAKAS MESIN UNTUK PENGERJAAN KAYU', 'mencakup pembuatan mesin-mesin/peralatan untuk pengolahan dan pengerjaan kayu, bambu, rotan, gabus dan sejenisnya, seperti berbagai mesin/peralatan, baik yang sederhana maupun modern, yang digunakan untuk pabrik sawmill, plywood, pabrik pengolahan rotan dan sejenisnya. Termasuk pula usaha pembuatan komponen dan perlengkapannya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(381, 0, '28223', 9, '28223', 361, 'INDUSTRI MESIN DAN PERKAKAS MESIN UNTUK PENGERJAAN BAHAN BUKAN LOGAM DAN KAYU', 'mencakup pembuatan mesin-mesin/peralatan untuk pengolahan dan pengerjaan bahan selain logam dan kayu, seperti mesin/peralatan untuk pengolahan karet yang diperkeras (hardened rubber), plastik tebal (hard plastic), kaca, tulang dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(382, 0, '28224', 9, '28224', 362, 'INDUSTRI MESIN DAN PERKAKAS MESIN UNTUK PENGELASAN YANG MENGGUNAKAN ARUS LISTRIK', 'mencakup pembuatan mesin/peralatan untuk pengelasan dengan gas atau arus listrik, seperti mesin las listrik AC maupun DC. Termasuk pula pembuatan mesin sejenis yang menggunakan laser, photon beam, gelombang ultrasonic, electron beam dan magnetic pulse.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(383, 0, '28230', 9, '28230', 363, 'INDUSTRI MESIN METALURGI', 'mencakup pembuatan mesin dan perlengkapannya untuk pengerjaan logam panas, seperti mesin pengubah (converter), cetakan baja (ingot moulds), pencedok dan penuang dan mesin peleburan, mesin penggilingan penggulung logam dan penggulung untuk penggilingan sejenisnya. Termasuk pula pembuatan mesin canai logam baik panas maupun dingin.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(384, 0, '28240', 9, '28240', 364, 'INDUSTRI MESIN PENAMBANGAN, PENGGALIAN DAN KONSTRUKSI', 'mencakup pembuatan mesin-mesin peralatan untuk kegiatan pertambangan, penggalian, dan konstruksi, seperti alat pengangkat dan alat pengangkut (misalnya conveyor), mesin untuk menyaring, mensortir, memisahkan, mencuci, menghancurkan bahan-bahan mineral, mesin pengeboran, pemotongan dan mesin terowongan dan sinking (baik untuk penggunaan di bawah tanah atau tidak), traktor yang digunakan dalam kegiatan pertambangan dan konstruksi, mesin pemindah tanah, seperti bulldozer, angle dozer, graders, scrapers, leveler, sekop, sekop pemuatan dan perlengkapannya, dan berbagai mesin untuk kegiatan konstruksi, dan mesin pencampur beton dan mortar, mesin pile-driver dan pile ekstraktor, penyebar mortar dan aspal, mesin penghalus permukaan beton dan lain-lain, traktor tracklaying dan traktor yang digunakan dalam konstruksi atau pertambangan, pisau bulldozer dan angle dozer dan truk dumping off-road. Termasuk pembuatan bagian/komponen dan perlengkapannya. Pembuatan traktor untuk pertanian dimasukkan dalam kelompok 28210.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(385, 0, '28250', 9, '28250', 365, 'INDUSTRI MESIN PENGOLAHAN MAKANAN, MINUMAN DAN TEMBAKAU', 'mencakup pembuatan mesin-mesin untuk pengolahan berbagai makanan, minuman dan tembakau, seperti mesin pengolah makanan dan susu, mesin pengering pertanian, mesin pemisah krim, mesin pengolahan susu (misalnya homogenizers), mesin pengubah susu (misalnya pembuat keju, dan mesin pencetak keju) dan mesin pembuat keju (misalnya homogenizers, pencetakan, pengepresan), mesin untuk industri penggilingan padi atau biji-bjian, seperti mesin untuk membersihkan, memilih atau memilah benih padi atau biji-bijian dan sayuran kacang-kacangan yang dikeringkan (mesin penampi, lajur penyaring, pemisah, mesin penyikat biji-bijian dan lain-lain); dan mesin untuk memproduksi tepung dan bahan makanan dan lain-lain (mesin penggilingan biji-bijian, penyaring, pengayak tepung, pengisi, blender, pembersih kulit padi, penggilingan padi, pemecah kacang kapri dan lainnya), mesin pembuat minuman anggur dan juice buah, mesin pembuat roti, mie dan spaghetti dan sejenis seperti oven roti, mixer, pembuat adonan, cetakan, pemotong, mesin pembuat roti dan lain-lain, mesin pembuat rokok dan berbagai mesin pengolahan makanan yang lain. Termasuk mesin untuk industri roti atau pembuat macaroni, mesin dan peralatan untuk pengolahan berbagai makanan, seperti mesin untuk membuat gula-gula, kokoa atau coklat, mesin untuk industri gula, mesin untuk pembuatan bir, mesin untuk pengolahan daging dan unggas, mesin untuk pengolahan buah-buahan, kacang-kacangan dan sayuran, mesin untuk pengolahan ikan, kerang-kerangan dan hasil laut lainnya; mesin untuk penyulingan dan pemurnian; dan mesin lainnya untuk industri dan pengolahan makanan dan minuman; mesin pengambilan dan pengolahan minyak dan lemah hewan dan tumbuhan; mesin untuk pengolahan tembakau dan untuk pembuatan rokok dan cerutu atau untuk tembakau pipa atau tembakau kunyah atau snuff; mesin pengolahan makanan di hotel dan restoran.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(386, 0, '28261', 9, '28261', 366, 'INDUSTRI KABINET MESIN JAHIT', 'mencakup pembuatan kabinet mesin jahit, baik dari kayu, plywood, maupun dari logam.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(387, 0, '28262', 9, '28262', 367, 'INDUSTRI MESIN JAHIT SERTA MESIN CUCI DAN MESIN PENGERING UNTUK KEPERLUAN NIAGA', 'mencakup pembuatan mesin jahit dan kepala mesin jahit, baik untuk keperluan rumah tangga maupun untuk untuk keperluan niaga, termasuk pembuatan mesin obras, mesin bordir, mesin oversum dan mesin-mesin untuk binatu dan dry cleaning (mesin cuci, mesin pengering, mesin penyeterika dan lain-lain). Pembuatan mesin cuci, mesin pengering dan sejenisnya untuk keperluan rumah tangga dimasukkan dalam kelompok 27510.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(388, 0, '28263', 9, '28263', 368, 'INDUSTRI MESIN TEKSTIL', 'mencakup usaha pembuatan mesin-mesin tekstil, seperti mesin persiapan pengolahan serat, mesin pintal, mesin persiapan pembuatan kain, mesin tenun, mesin rajut, mesin pemeriksa kesalahan kain, mesin-mesin penyelesaian (finishing), mesin konveksi dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(389, 0, '28264', 9, '28264', 369, 'INDUSTRI JARUM MESIN JAHIT, RAJUT, BORDIR DAN SEJENISNYA', 'mencakup pembuatan jarum untuk mesin jahit, rajut, bordir dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(390, 0, '28265', 9, '28265', 370, 'INDUSTRI MESIN PENYIAPAN DAN PEMBUATAN PRODUK KULIT', 'mencakup pembuatan mesin produk kulit, seperti mesin untuk penyiapan, penyamakan, atau pengerjaan kulit atau kulit jangat dan mesin untuk membuat atau memperbaiki alas kaki atau produk lainnya dari kulit, kulit jangat dan kulit berbulu.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(391, 0, '28291', 9, '28291', 371, 'INDUSTRI MESIN PERCETAKAN', 'mencakup pembuatan mesin-mesin percetakan, seperti mesin press sederhana, mesin press silinder, mesin press putar dan mesin cetak lainnya. Termasuk mesin-mesin perlengkapan percetakan dan mesin penjilid, seperti mesin jahit buku, mesin penjilid dengan menggunakan spiral dan mesin penomor halaman.', '2017-03-12 22:18:29', '2017-05-30 21:13:45', NULL, 1),
(392, 0, '28292', 9, '28292', 372, 'INDUSTRI MESIN PABRIK KERTAS', 'mencakup pembuatan mesin pabrik kertas,seperti mesin untuk pengolahan pulp, kertas dan karton misalnya mesin pembuatan bubur kertas, mesin pembuatan kertas dan papan kertas, mesin pengeringan kayu, bubur kertas, kertas atau papan kertas, dan mesin untuk pembuatan barang-barang dari kertas atau papan kertas, seperti mesin pemotong kertas, pembuat amplop, kantong kertas dan sejenisnya dan mesin-mesin lainnya', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(393, 0, '28299', 9, '28299', 373, 'INDUSTRI MESIN KEPERLUAN KHUSUS LAINNYA', 'mencakup industri berbagai mesin-mesin industri khusus lainnya yang belum termasuk kelompok sebelumnya, seperti mesin untuk pengerjaan karet atau plastik lunak atau untuk pembuatan produk dari bahan tersebut, seperti mesin extrude, pencetak, mesin pembuatan ban angin (pneumatik) atau ban vulkanisir, mesin lainnya untuk pembuatan produk dari plastik atau karet khusus, mesin cetak dan penjilidan buku dan mesin untuk pendukung pencetakan pada berbagai macam bahan, mesin untuk memproduksi ubin, batu bata, perekat keramik potongan, pipa, grafit elektroda, kapur tulis, cetakan besi tuang dan lain-lain, mesin pabrik semi konduktor, robot industri yang menjalankan berbagai tugas untuk keperluan khusus, mesin untuk merakit lampu listrik dan lampu elektronik, tabung atau bola lampu, mesin untuk memproduksi atau pekerjaan panas dari kaca atau barang-barang dari kaca, serat kaca atau benang dan mesin atau peralatan untuk pemisahan isotopik, peralatan meluruskan dan menyeimbangkan ban (kecuali penyeimbang roda), sistem pelumasan pusat, persneling pesawat terbang (launching gear), pelontar pembawa pesawat terbang (carrier catapult) dan peralatan yang terkait, peralatan arena bowling otomatis (pin-setter), peralatan jalan berputar (roundabouts), ayunan, galeri menembak, gelanggang hiburan atau permainan lainnya dan mesin-mesin khusus lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(394, 0, '29100', 11, '29100', 374, 'INDUSTRI KENDARAAN BERMOTOR RODA EMPAT ATAU LEBIH', 'mencakup usaha pembuatan atau perakitan kendaraan bermotor untuk penumpang atau barang, seperti sedan, jeep, truck, pick up, bus dan stasion wagon. Termasuk pembuatan kendaraan untuk keperluan khusus, seperti mobil pemadam kebakaran, mobil toko, mobil penyapu jalan, ambulans, mobil salju, mobil golf, kendaraan amfibi, perpustakaan mobil (travelling libraries), mobil berlapis baja, lori pencampur beton dan ATV, go cart, mobil balap dan sejenisnya. juga mencakup usaha pembuatan mesin kendaraan bermotor, chasis mesin dan industri pembangunan kembali mesin kendaraan bermotor.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(395, 0, '29200', 11, '29200', 375, 'INDUSTRI KAROSERI KENDARAAN BERMOTOR RODA EMPAT ATAU LEBIH DAN INDUSTRI TRAILER DAN SEMI TRAILER', 'mencakup usaha pembuatan bagian-bagian mobil atau karoseri kendaraan bermotor, seperti bak truk, bodi bus, bodi pick up, bodi untuk kendaraan penumpang, dan kendaraan bermotor untuk penggunaan khusus, seperti kontainer, caravan dan mobil tangki. Termasuk pembuatan trailer, semi trailer dan bagian-bagiannya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(396, 0, '29300', 11, '29300', 376, 'INDUSTRI SUKU CADANG DAN AKSESORI KENDARAAN BERMOTOR RODA EMPAT ATAU LEBIH', 'mencakup usaha pembuatan komponen dan suku cadang kendaraan bermotor roda empat atau lebih, seperti leaf sporing, radiator, fuel tank, muffle, rem, gearboxes/persnelling, AS roda, road wheel, suspension shock absorber, radiator, silencer, pipa pembuangan, kataliser pengubah, kopling, roda kemudi, sistem kolom kemudi dan kotak kemudi; suku cadang dan aksesori untuk bodi karoseri kendaraan bermotor, seperti sabuk pengaman, pintu, bamper, airbag; tempat duduk mobil; peralatan listrik kendaraan bermotor, seperti generator, alternator, busi, ignition wiring harnesses/starter, sistem buka tutup pintu dan jendela otomatis, pemasangan argometer ke dalam panel instrumen, pengatur voltawse; dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(397, 0, '30111', 11, '30111', 377, 'INDUSTRI KAPAL DAN PERAHU', 'mencakup usaha pembuatan atau perakitan macam-macam kapal dan perahu komersil, yang terbuat dari baja, fibre glass, kayu atau ferro cement, baik yang bermotor maupun yang tidak bermotor, seperti kapal penumpang, kapal ferry, kapal kargo, kapal tanker, kapal penyeret, kapal layar untuk komersil, kapal perang, kapal untuk penelitian, kapal penangkap ikan dan kapal untuk pabrik pengolahan ikan.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(398, 0, '30112', 11, '30112', 378, 'INDUSTRI BANGUNAN LEPAS PANTAI DAN BANGUNAN TERAPUNG', 'mencakup usaha pembuatan konstruksi atau bangunan lepas pantai dan bangunan terapung, termasuk peralatan dan perlengkapannya, seperti konstruksi platform, bangunan terapung atau penyelaman untuk kegiatan pengeboran; konstruksi bangunan terapung, seperti dok terapung, sekoci dan kran apung, jembatan apung, ponton, coffer-dam, bangunan tempat pendaratan terapung, living quarter, jacket, platform dan morring buoy, pelampung/buoys, tangki terapung, kapal barkas, tongkang, kapal derek, rakit yang dapat diisi udara bukan untuk rekreasi dan lain-lain. Termasuk pembuatan hovercraft, kecuali hovercraft jenis rekreasi.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(399, 0, '30113', 11, '30113', 379, 'INDUSTRI PERALATAN, PERLENGKAPAN DAN BAGIAN KAPAL', 'mencakup usaha pembuatan perlengkapan, peralatan dan bagian kapal, seperti perlengkapan lambung, akomodasi kerja mesin geladak, alat kemudi dan alat bongkar muat.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(400, 0, '30120', 11, '30120', 380, 'INDUSTRI PEMBUATAN KAPAL DAN PERAHU UNTUK TUJUAN WISATA ATAU REKREASI DAN OLAHRAGA', 'mencakup usaha pembuatan kapal pesiar dan perahu untuk santai dan olahraga, seperti perahu dan rakit karet yang dapat diisi udara, kapal atau perahu layar (yatch) dengan atau tanpa motor penggerak, motor boats, hovercraft untuk rekreasi, kendaraan air pribadi, perahu untuk olahraga dan kapal pesiar yang lain, seperti kano, kayak, perahu dayung, sampan dan lain-lain.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(401, 0, '30200', 11, '30200', 381, 'INDUSTRI LOKOMOTIF DAN GERBONG KERETA', 'mencakup usaha pembuatan atau perakitan lokomotif kereta api listrik, diesel, uap dan lainnya; gerbong kereta api self propelled (pendorong sendiri) atau gerbong kereta api listrik atau trem, vans dan truk, termasuk perawatan atau perbaikannya; gerbong keretra api atau kereta api listrik, tidak self-propelled (pendorong sendiri), seperti gerbong penumpang, gerbong barang, gerbong tangki, gerbong bengkel, gerbong mobil derek, gerbong dan kereta pembongkar, gerobak dan lain-lain; suku cadang khusus kereta api atau kereta api listrik atau gerbong, seperti bogies, as dan roda, rem dan suku cadang rem, peralatan kopling dan hook, buffer dan suku cadang buffer, sok breker, kerangka lokomotif dan gerbong; bodi karoseri, penghubung antarkoridor dan lain-lain; peralatan signal mekanik dan elektromagnetik, peralatan pengaman dan pengontrol rambu-rambu kereta api, kereta api listrik, lalu lintas air, jalan raya, fasilitas parkir, lapangan udara dan lain-lain; lokomotif', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(402, 0, '30300', 11, '30300', 382, 'INDUSTRI PESAWAT TERBANG DAN PERLENGKAPANNYA', 'mencakup usaha pembuatan atau perakitan dan modifikasi pesawat terbang untuk penumpang atau barang, seperti pesawat terbang bermesin jet, pesawat terbang propeller, helikopter, balon udara dan pesawat layang. juga mencakup usaha pembuatan pesawat terbang untuk angkatan bersenjata, olahraga atau tujuan lain, pesawat peluncur dan pesawat peluncur gantung, kapal seplin/balon berkemudi dan balon udara panas, suku cadang dan aksesori pesawat terbang, seperti rakitan utama seperti badan pesawat terbang, sayap, pintu, pengontrol permukaan, roda gigi untuk mendarat, tanki bahan bakar, nacelles dan lain-lain; baling-baling, pisau rotor helikopter dan rotor pendorong; berbagai macam motor dan mesin yang terdapat di pesawat terbang; dan suku cadang jet turbo dan pendorong turbo untuk pesawat terbang, pesawat terbang latih darat, pesawat ruang angkasa dan pesawat peluncuran, satelit, satelit yang berhubungan dengan planet, stasiun orbit, shuttles dan intercontinental ballistic missiles (ICBM)/roket antarbenua. Termasuk pemeriksaan dan konversi pesawat atau mesin pesawat dan pembuatan tempat duduk pesawat terbang.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(403, 0, '30400', 11, '30400', 383, 'INDUSTRI KENDARAAN PERANG', 'mencakup pembuatan tank dan kendaraan lapis baja. Termasuk pembuatan kendaraan militer amfibi lapis baja dan kendaraan perang militer lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(404, 0, '30911', 11, '30911', 384, 'INDUSTRI SEPEDA MOTOR RODA DUA DAN TIGA', 'mencakup usaha pembuatan dan perakitan secara lengkap dari macam-macam kendaraan bermotor roda dua dan tiga, seperti sepeda motor, moped, skuter, bemo, a side-cars dan sejenisnya. Termasuk sepeda yang dilengkapi motor.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(405, 0, '30912', 11, '30912', 385, 'INDUSTRI KOMPONEN DAN PERLENGKAPAN SEPEDA MOTOR RODA DUA DAN TIGA', 'mencakup usaha pembuatan komponen dan suku cadang kendaraan bermotor roda dua dan tiga, seperti motor pembakaran dalam, suspensi dan knalpot.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(406, 0, '30921', 11, '30921', 386, 'INDUSTRI SEPEDA DAN KURSI RODA TERMASUK BECAK', 'mencakup usaha pembuatan dan perakitan macam-macam sepeda dan becak, seperti sepeda tanpa motor, sepeda roda tiga (pengantar), tandem (sepeda gandeng), dan sepeda anak-anak baik roda dua maupun roda tiga, termasuk pula pembuatan kendaraan orang cacat atau kursi roda baik bermotor maupun tidak.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(407, 0, '30922', 11, '30922', 387, 'INDUSTRI PERLENGKAPAN SEPEDA DAN KURSI RODA TERMASUK BECAK', 'mencakup usaha pembuatan suku cadang atau komponen dan aksesori sepeda, kursi roda dan becak, seperti sadel, pedal, velg, rem, jari-jari, roda dan tire ventil. Usaha pembuatan ban sepeda (luar dan dalam) dimasukkan dalam kelompok 22111 dan 22112.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(408, 0, '30990', 11, '30990', 388, 'INDUSTRI ALAT ANGKUTAN LAINNYA YTDL', 'mencakup usaha pembuatan alat angkut yang belum termasuk kelompok lainnya, baik kendaran yang didorong oleh tangan maupun kendaraan yang ditarik binatang, seperti truk barang, handcart, sledge, troli, gerobak, delman, lori, kereta dorong, wheel barrows, kereta balap (sulkies), pedati yang ditarik keledai, kereta jenazah (keranda) dan alat pengangkutan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(409, 0, '31001', 3, '31001', 389, 'INDUSTRI FURNITUR DARI KAYU', 'mencakup usaha pembuatan furnitur dari kayu untuk rumah tangga dan kantor, seperti meja, kursi, bangku, tempat tidur, lemari, rak, kabinet, penyekat ruangan dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(410, 0, '31002', 3, '31002', 390, 'INDUSTRI FURNITUR DARI ROTAN DAN ATAU BAMBU', 'mencakup pembuatan furnitur dengan bahan utamanya dari rotan dan atau bambu, seperti meja, kursi, bangku, tempat tidur, lemari, rak, penyekat ruangan dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(411, 0, '31003', 3, '31003', 391, 'INDUSTRI FURNITUR DARI PLASTIK', 'mencakup pembuatan furnitur yang bahan utamanya dari plastik, seperti meja, kursi, rak dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(412, 0, '31004', 3, '31004', 392, 'INDUSTRI FURNITUR DARI LOGAM', 'mencakup pembuatan furnitur untuk rumah tangga dan kantor yang bahan utamanya dari logam, seperti meja, kursi, rak, spring bed dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(413, 0, '31009', 3, '31009', 393, 'INDUSTRI FURNITUR LAINNYA', 'mencakup usaha pembuatan furnitur yang bahan utamanya bukan kayu, rotan, bambu, logam, plastik dan bukan barang imitasi, seperti bahan pelengkap matras atau kasur, matras atau kasur dengan per atau pegas atau yang yang diisi atau disumpal atau dilengkapi dengan bahan pelengkap lainnya (kapok, dakron) dan matras atau kasur plastik atau karet yang tidak dilapisi dan matras atau kasur sejenisnya. Termasuk kereta restoran dekorasi, seperti kereta desert, kereta makanan.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(414, 0, '32111', 6, '32111', 394, 'INDUSTRI PERMATA', 'mencakup usaha pemotongan, pengasahan dan penghalusan batu berharga atau permata dan sejenisnya, seperti berlian perhiasan, intan perhiasan, batu aji/ batu akik dan intan tiruan.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(415, 0, '32112', 6, '32112', 395, 'INDUSTRI BARANG PERHIASAN DARI LOGAM MULIA UNTUK KEPERLUAN PRIBADI', 'mencakup usaha pembuatan barang-barang perhiasan yang bahan utamanya dari logam mulia (emas, platina dan perak) untuk keperluan pribadi, seperti cincin, kalung, gelang, giwang, bross, ikat pinggang dan kancing, termasuk bagian dan perlengkapannya. Pembuatan perlengkapan kesehatan (tambal gigi, dan benang bedah) dimasukkan pada kelompok 21012. Pembuatan perhiasan imitasi dimasukkan dalam kelompok 32120.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(416, 0, '32113', 6, '32113', 396, 'INDUSTRI BARANG PERHIASAN DARI LOGAM MULIA BUKAN UNTUK KEPERLUAN PRIBADI', 'mencakup usaha pembuatan perhiasan yang bahan utamanya dari logam mulia selain untuk keperluan pribadi, seperti peralatan makan dan minum, piring-piring ceper, wadah-wadah berongga, barang-barang toilet, barang hiasan untuk rumah tangga, barang-barang kantor atau meja, piala, medali dan noveltis atau barang-barang yang berhubungan dengan keagamaan, termasuk bagian dan perlengkapannya', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(417, 0, '32114', 6, '32114', 397, 'INDUSTRI BARANG DARI LOGAM MULIA UNTUK KEPERLUAN TEKNIK DAN ATAU LABORATORIUM', 'mencakup usaha pembuatan barang-barang untuk keperluan teknik dan atau laboratorium dari logam mulia (tidak termasuk instrument dan bagian-bagiannya), seperti spatula, crucibles, cuples, platinum grill yang digunakan sebagai katalisator dan electro-plating anodes', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(418, 0, '32115', 6, '32115', 398, 'INDUSTRI PERHIASAN MUTIARA', 'mencakup usaha pengerjaan mutiara dan pembuatan perhiasan dari mutiara atau perhiasan berbahan dasar utamanya adalah mutiara.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(419, 0, '32119', 6, '32119', 399, 'INDUSTRI BARANG LAINNYA DARI LOGAM MULIA', 'mencakup usaha pembuatan barang lainnya dari logam mulia, seperti tali jam tangan dari logam mulia, manset, ikat jam tangan dan kotak rokok. Termasuk pembuatan koin baik yang legal sebagai alat tukar maupun tidak dan jasa engraving baik pada perhiasan dari logam mulia atau bukan. Pembuatan case (badan) jam dan perhiasan jam dimasukkan dalam kelompok 26520.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(420, 0, '32120', 6, '32120', 400, 'INDUSTRI PERHIASAN IMITASI DAN BARANG SEJENIS', 'mencakup usaha pembuatan perhiasan imitasi dan sejenisnya, seperti cincin, gelang, kalung dan barang-barang sejenisnya yang dibuat dari logam dasar yang dilapisi logam mulia, perhiasan dengan batu imitasi seperti batu permata imitasi, berlian imitasi dan sejenisnya. Termasuk pembuatan tali jam tangan dari logam (kecuali logam mulia).', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(421, 0, '32201', 6, '32201', 401, 'INDUSTRI ALAT MUSIK TRADISIONAL', 'mencakup usaha pembuatan alat-alat musik tradisional baik alat musik senar, tiup, pukul dan lainnya, seperti kecapi, seruling bambu, angklung, calung, kulintang, gong, gambang, gendang, terompet tradisional, rebab dan tifa. Termasuk pembuatan peluit, call horn (semacam terompet) dan alat sinyal suara yang ditiup lainnya', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(422, 0, '32202', 6, '32202', 402, 'INDUSTRI ALAT MUSIK BUKAN TRADISIONAL', 'mencakup usaha pembuatan alat-alat musik non tradisional, seperti alat musik petik (gitar, bass dan sejenisnya), alat musik tiup (terompet, saxophone, clarinet, harmonika dan sejenisnya), alat musik gesek (biola, cello dan sejenisnya), alat musik perkusi (drum set, selofon, metalofon dan sejenisnya). Termasuk usaha pembuatan piano/organ, pianika gamitan, akordeon dan garpu tala. Usaha pembuatan mikrofon, loudspeaker, headphone dan komponen yang sejenisnya dimasukkan dalam kelompok 26420. Sedangkan alat-alat musik untuk mainan dimasukkan dalam kelompok 32402.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(423, 0, '32300', 6, '32300', 403, 'INDUSTRI ALAT OLAHRAGA', 'mencakup usaha pembuatan alat-alat olahraga, seperti bola sepak, bola basket, bola volley, raket tenis, raket bulu tangkis, net volley, net pingpong, stik golf, stik hockey, meja pingpong, ski bindings dan poles (galah), sepatu ski, papan layar dan papan selancar, peralatan untuk olahraga memancing termasuk jaring penyerok, peralatan untuk berburu, panjat gunung, sarung tangan dan tutup kepala olahraga dari kulit, ice skate, roller skate, busur dan panah, peralatan untuk olahraga ketangkasan, peralatan gimnastik (senam), peralatan pusat kebugaran (fitness centre) atau peralatan atletik dan matras. Yang tidak termasuk dalam adalah usaha pembuatan layar perahu (13929), pakaian olahraga (14111), pakaian kuda (15123), sepatu olahraga (15202), senjata untuk olahraga (25200), sepeda olahraga (30921), kapal/sampan olahraga (30120), meja billiard/perlengkapan bowling (32401), cambuk dan pecut (32903).', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(424, 0, '32401', 6, '32401', 404, 'INDUSTRI ALAT PERMAINAN', 'mencakup usaha pembuatan alat/perlengkapan seperti kartu domino, remi dan sejenisnya, kelereng, bekel, papan permainan dan permainan sejenisnya (halma, ular tangga), permainan elektronik, permainan catur, permainan yang dioperasikan dengan koin, bilyard, meja khusus untuk permainan judi dan sebagainya, fun fair, table and parlour games, meja billiard, meja casino, meja bowling dan perlengkapannya, video games, puzzle dan mainan edukatif dan alat-alat permainan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(425, 0, '32402', 6, '32402', 405, 'INDUSTRI MAINAN ANAK-ANAK', 'mencakup usaha pembuatan macam-macam mainan, seperti boneka dari kayu, kain, karet, dan sejenisnya termasuk pakaian boneka dan aksesorinya, mainan berupa senjata, toys set, tokoh super hero seperti superman, batman dan lain-lain, binatang mainan, alat musik mainan, kartu permainan, scale model dan model rekreasional sejenisnya, kereta api listrik, permainan konstruksi, mainan beroda yang dirancang untuk dikendarai (mainan jenis kendaraan) termasuk sepeda roda dua dan sepeda roda tiga yang terbuat dari plastik. Sepeda anak-anak dimasukkan dalam kelompok 30921.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(426, 0, '32501', 3, '32501', 406, 'INDUSTRI FURNITUR UNTUK OPERASI, PERAWATAN KEDOKTERAN DAN KEDOKTERAN GIGI', 'mencakup pembuatan perabot atau furnitur untuk kegiatan operasi, perawatan, kedokteran gigi dan kedokteran hewan, seperti meja operasi, tempat tidur rumah sakit dengan peralatan mekanik dan kursi untuk pemeriksaan dan perawatan gigi.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(427, 0, '32502', 6, '32502', 407, 'INDUSTRI PERALATAN KEDOKTERAN DAN KEDOKTERAN GIGI, PERLENGKAPAN ORTHOPAEDIC DAN PROSTHETIC', 'mencakup pembuatan peralatan dan perlengkapan untuk pemeriksaan kesehatan, operasi, kedokteran gigi dan kedokteran hewan, seperti electrocardiograph, alat-alat bor gigi, peralatan test mata (termasuk reflektor, endoscope, dan lain-lain), jarum suntik, peralatan sterilisasi, peralatan pijat, ozone therapy, oxygen therapy, peralatan pernapasan buatan, perlengkapan orthopaedic dan prosthetic (crutches, surgical belts and trussers, orthopaedic corsets and shoes dan lain-lain), thermometer kedokteran, tungku pembakar laboratorium kedokteran gigi, mesin pembersihan ultrasonik laboratorium, peralatan destilasi laboratorium, alat sentrifugal laboratorium, pelat dan baut tulang (bone plates and screws), alat suntik, jarum suntik, kateter, cannulae dan sebagaiya, peralatan kedokteran gigi (termasuk kursi periksa dokter gigi yang tergabung dengan perlengkapan dokter gigi lainnya), gigi buatan dan sebagainya yang dibuat di laboratorium kedokteran gigi, mata buatan dari gelas dan peralatan tubuh palsu lainnya, seperti mata palsu, tengkorak palsu dan bagian-bagian dalam tubuh palsu.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(428, 0, '32503', 6, '32503', 408, 'INDUSTRI KACA MATA', 'mencakup usaha pembuatan macam-macam barang-barang opthalmik dan kaca mata berikut frame, seperti kaca mata pembantu penglihatan, kaca mata peredam sinar matahari/cahaya (sunglasses) dan safety googles (kaca mata untuk penahan debu, renang, selam, las). Termasuk juga pembuatan lensa kaca mata dan lensa kontak.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(429, 0, '32509', 6, '32509', 409, 'INDUSTRI PERALATAN KEDOKTERAN DAN KEDOKTERAN GIGI SERTA PERLENGKAPAN LAINNYA', 'mencakup usaha pembuatan peralatan kedokteran dan kedokteran gigi serta perlengkapan lainnya yang belum tercakup dalam kelompok 32501 sampai dengan 32503, seperti kain dan benang steril dan kertas tisue untuk operasi, semen dan penambal gigi (kecuali perekat gigi palsu 20232), lilin gigi dan preparat plester gigi lainnya, semen rekonstruksi tulang.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(430, 0, '32901', 6, '32901', 410, 'INDUSTRI ALAT TULIS DAN GAMBAR TERMASUK PERLENGKAPANNYA', 'mencakup usaha pembuatan macam-macam alat tulis dan gambar termasuk perlengkapannya, seperti pensil hitam, pensil berwarna, pulpen, pena boll point, tangkai pena, pena sablon, jangka, kuas gambar, batu tulis, meja gambar, rapido, sablon, letraset dan crayon. Termasuk pembuatan cat air dan cat minyak.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(431, 0, '32902', 6, '32902', 411, 'INDUSTRI PITA MESIN TULIS/GAMBAR', 'mencakup usaha pembuatan macam-macam pita mesin tulis/gambar, seperti pita mesin tik, pita pencetak komputer dan pita mesin tulis lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(432, 0, '32903', 7, '32903', 412, 'INDUSTRI KERAJINAN YTDL', 'mencakup usaha pembuatan barang-barang kerajinan dari bahan tumbuh-tumbuhan dan hewan, seperti kerajinan pohon kelapa, tempurung, serabut, akar-akaran, kulit, gading, tanduk, tulang, bulu, rambut, binatang yang diawetkan, kegiatan taxidermy (mengisi kulit binatang dengan kapas dan lain-lain sehingga nampak seperti binatang hidup), karangan bunga, rangkaian bunga berbentuk lingkaran dan keranjang bunga; bunga, buah-buahan dan daun-daunan buatan dan barang-barang lukisan. Termasuk usaha pembuatan barang-barang kerajinan dari kulit ikan dan kekerangan, baik dari kulit kerang mutiara seperti kerang Pinctada maxima, kerang mabe (mutiara setengah bulat), maupun kerang lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(433, 0, '32904', 6, '32904', 413, 'INDUSTRI PERALATAN UNTUK PELINDUNG KESELAMATAN', 'mencakup usaha pembuatan peralatan untuk pelindung keselamatan, seperti pakaian pelindung dan pakaian anti api, sabuk pengaman tukang kawat dan sabuk lain untuk keperluan pekerjaan, pelampung, topi plastik yang keras (helm bangunan) dan perlengkapan keamanan lainnya yang terbuat dari plastik (helm olahraga dan segala macam helm sejenisnya), pakaian pelindung kebakaran, tutup kepala pengaman dari logam dan peralatan pengaman pribadi lain yang terbuat dari logam, penyumbat telinga dan hidung (misalnya untuk renang dan pengaman hidung) dan masker gas.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(434, 0, '32905', 7, '32905', 0, 'INDUSTRI SERAT SABUT KELAPA', 'mencakup usaha pengolahan sabut kelapa menjadi bahan baku, seperti cocofiber (serat sabut kelapa), cocopeat (serbuk sabut kelapa), Rubberized Curl Coir (RCC)/ serat sabut kelapa berkaret (sebutret), dan lainnya. Contoh: cocofiber digunakan untuk pembuatan jok mobil, spring bed, dan lainnya serta cocopeat biasanya digunakan untuk media tanaman, dan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(435, 0, '32909', 6, '32909', 414, 'INDUSTRI PENGOLAHAN LAINNYA YTDL', 'mencakup usaha pembuatan barang-barang yang tidak diklasifikasikan di tempat lain, seperti papan nama, papan reklame (papan atau lampu display), segala macam payung, pipa rokok, lencana, piala, medali, stempel, tongkat, kap lampu, lilin, segala macam kancing, sapu, sikat ijuk, tempat cerutu dan sirih, pipa rokok, sisir, penyemprot wangi-wangian, botol vakum dan bejana vakum untuk keperluan pribadi atau rumah tangga, wig (rambut palsu), janggut palsu, bulu mata palsu dan lainnya yang belum tercakup dalam golongan lainnya, termasuk pembuatan korek api dari logam dan pembuatan perhiasan imitasi, boneka yang digunakan oleh penjahit untuk mengenakan baju, peti jenazah. Pembuatan sumbu lampu dimasukan dalam kelompok 13942.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(436, 0, '33111', 8, '33111', 415, 'REPARASI PRODUK LOGAM SIAP PASANG UNTUK BANGUNAN, TANGKI, TANDON AIR DAN GENERATOR UAP', 'mencakup reparasi dan perawatan produk logam pabrikasi di golongan 251, seperti reparasi tangki, reservoir dan kontainer atau wadah logam, drum pengapalan baja, generator uap atau uap air lainnya, mesin tambahan yang digunakan dalam generator uap (Kondensator, pemanas, pengumpul/kolektor dan akumulator uap), reactor nuklir kecuali separator isotop, suku cadang mesin kapal laut atau ketel uap tenaga dan peralatan kerja dari radiator dan pemanas pusat dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(437, 0, '33112', 8, '33112', 416, 'REPARASI PRODUK SENJATA DAN AMUNISI', 'mencakup reparasi dan perawatan produk logam di golongan 252, yaitu reparasi dan perawatan senjata api dan meriam/artileri (termasuk reparasi senjata untuk kegiatan olahraga atau rekreasional).', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(438, 0, '33119', 8, '33119', 417, 'REPARASI PRODUK LOGAM PABRIKASI LAINNYA', 'mencakup reparasi dan perawatan produk logam pabrikasi di golongan 259, seperti reparasi dan perawatan alat potong, perkakas tangan dan peralatan umum (biasa digunakan umtuk pertanian, pertukangan dan rumah tangga), wadah dari logam, barang dari kawat, brankas, filling kabinet dan barang logam lainnya. Termasuk las (keliling) yang berpindah-pindah,', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1);
INSERT INTO `m_kbli` (`id`, `server_id`, `kode`, `direktorat_id`, `kode2009`, `kbli2009_id`, `kbli`, `deskripsi`, `created`, `modified`, `ipaddress`, `dataactive`) VALUES
(439, 0, '33121', 9, '33121', 418, 'REPARASI MESIN UNTUK KEPERLUAN UMUM', 'Kelompok ini mencakup reparasi mesin untuk keperluan umum yang tercakup dalam golongan 281, seperti reparasi dan perawatan mesin kapal laut atau kereta api, pompa dan peralatan yang terkait, peralatan tenaga uap atau zat cair, katup atau klep, roda gigi (persneling) dan peralatan kemudi, tungku pembakar pada proses industri, alat pengangkat dan pemindah, mesin dan peralatan kantor kecuali komputer dan perlengkapannya (cash register, mesin fotokopi, kalkulator, mesin ketik), perkakas tangan yang digerakkan tenaga, peralatan pendingin dan pembersih udara, timbangan, mesin penjual otomatis dan keperluan umum lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(440, 0, '33122', 9, '33122', 419, 'REPARASI MESIN UNTUK KEPERLUAN KHUSUS', 'Kelompok ini mencakup reparasi dan perawatan mesin untuk keperluan khusus yang tercakup dalam golongan 282, seperti reparasi dan perawatan traktor pertanian, mesin pertanian dan mesin kehutanan dan penebangan, perkakas mesin pemotong logam dan pembentuk logam dan aksesorinya, perkakas mesin lainnya, mesin metalurgi, mesin pertambangan dan penggalian termasuk mesin pada ladang minyak dan gas, mesin konstruksi, mesin pengolahan makanan dan minuman, mesin pengolahan tembakau, mesin tekstil, mesin pembuatan pakaian dan pakaian dari kulit, mesin pembuatan kertas dan mesin keperluan khusus lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(441, 0, '33131', 9, '33131', 420, 'REPARASI ALAT UKUR, ALAT UJI DAN PERALATAN NAVIGASI DAN PENGONTROL', 'mencakup reparasi dan perawatan peralatan yang diproduksi dalam golongan 265, seperti reparasi dan perawatan peralatan mesin pesawat terbang, peralatan pengujian emisi mobil, peralatan meteorologi, peralatan pengujian dan pemeriksaan perlengkapan secara fisik, listrik dan kimia, peralatan penelitian atau survei, peralatan pendeteksi dan pemantauan radiasi dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(442, 0, '33132', 9, '33132', 421, 'REPARASI PERALATAN IRRADIASI, ELEKTROMEDIS DAN ELEKTROTHERAPI', 'mencakup reparasi dan perawatan peralatan irradiasi, elektromedis dan elektrotherapi dalam golongan 266, seperti reparasi dan perawatan peralatan penggambaran resonansi magnetik (magnetic resonance imaging/MRI), peralatan kesehatan ultrasound, peralatan pembuka jalan (pacemaker), peralatan bantu pendengaran (hearing aids), peralatan elektrokardiografi, peralatan endoskopis elektromedis, peralatan irradiasi dan sejenisnya', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(443, 0, '33133', 9, '33133', 422, 'REPARASI PERALATAN FOTOGRAFI DAN OPTIK', 'mencakup reparasi dan perawatan peralatan fotografi dan optik dalam golongan 267, jika utamanya digunakan secara komersial, seperti reparasi dan perawatan teropong, mikroskop (kecuali mikroskop elektron, proton), teleskop, prisma dan lensa (kecuali ophtalmik), peralatan fotografi dan sejenisnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(444, 0, '33141', 9, '33141', 423, 'REPARASI MOTOR LISTRIK, GENERATOR DAN TRANSFORMATOR', 'mencakup reparasi dan perawatan mesin dan peralatan yang diproduksi dalam glongan 271, seperti reparasi dan perawatan mesin tenaga, distribusi dan khususnya transformator, motor listrik, generator dan perangkat motor generator, peralatan saklar dan papan hubung, peralatan relay dan pengontrol industri.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(445, 0, '33142', 10, '33142', 424, 'REPARASI BATERAI DAN AKUMULATOR LISTRIK', 'mencakup reparasi dan perawatan peralatan listrik lainnya dalam golongan 273, 274 dan 279, seperti reparasi dan perawatan peralatan penerangan listrik, peralatan kawat pembawa arus dan bukan pembawa arus untuk sirkuit kabel listrik dan peralatan listrik sejenis lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(446, 0, '33149', 10, '33149', 425, 'REPARASI PERALATAN LISTRIK LAINNYA', 'mencakup reparasi dan perawatan peralatan listrik lainnya dalam golongan 273, 274 dan 279, seperti reparasi dan perawatan peralatan penerangan listrik, peralatan kawat pembawa arus dan bukan pembawa arus untuk sirkuit kabel listrik dan peralatan listrik sejenis lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(447, 0, '33151', 11, '33151', 426, 'REPARASI KAPAL, PERAHU DAN BANGUNAN TERAPUNG', 'mencakup jasa reparasi dan perawatan alat angkutan dalam golongan 301, seperti jasa reparasi dan perawatan kapal, perahu, kapal pesiar, kapal atau perahu untuk kepeluan rekreasi dan olahraga dan sejenisnya. Termasuk usaha jasa reparasi dan', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(448, 0, '33152', 11, '33152', 427, 'REPARASI LOKOMOTIF DAN GERBONG KERETA', 'mencakup jasa reparasi dan perawatan lokomotif dan gerbong kereta api dan kendaraan jalan rel lainnya (kecuali industri pembangunan kembali dan pengubahan) dalam golongan 302.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(449, 0, '33153', 11, '33153', 428, 'REPARASI PESAWAT TERBANG', 'mencakup reparasi dan perawatan pesawat terbang (kecuali industri pengubahan, pemeriksaan, dan pembangunan kembali), mesin pesawat terbang dan perlengkapannya dalam golongan 303.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(450, 0, '33159', 11, '33159', 429, 'REPARASI ALAT ANGKUTAN LAINNYA, BUKAN KENDARAAN BERMOTOR', 'mencakup reparasi dan perawatan alat angkut lainnya bukan sepeda motor dan sepeda (subgolongan 3092), seperti reparasi dan perawatan kendaraan perang, andong dan kereta yang ditarik binatang dan alat angkut sejenis lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(451, 0, '33190', 9, '33190', 430, 'REPARASI PERALATAN LAINNYA', 'mencakup reparasi dan perawatamencakup reparasi peralatan lainnya, seperti reparasi jaring untuk menangkap ikan, tali jerat, tali temali, canvas dan terpal (tarp), kantong penyimpan pupuk dan bahan kimia, pallet kayu, drum pengapalan dan tong Sejenisnya, mesin pinball dan mesin permainan yang dioperasikan dengan koin, orgel dan peralatan musik bersejarah lainnyan alat angkut lainnya bukan sepeda motor dan sepeda (subgolongan 3092), seperti reparasi dan perawatan kendaraan perang, andong dan kereta yang ditarik binatang dan alat angkut sejenis lainnya.mencakup reparasi dan perawatan alat angkut lainnya bukan sepeda motor dan sepeda (subgolongan 3092), seperti reparasi dan perawatan kendaraan perang, andong dan kereta yang ditarik binatang dan alat angkut sejenis lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(452, 0, '33200', 9, '33200', 431, 'INSTALASI/PEMASANGAN MESIN DAN PERALATAN INDUSTRI', 'mencakup instalasi/pemasangan mesin dan peralatan industri, seperti instalsi/pemasangan mesin industri dalam pabrik, peralatan kendali/kontrol proses industri dan peralatan industri lainnya (peralatan komunikasi, mainframe dan komputer sejenis, peralatan iradiasi dan elektromedis dan lain-lain), pembongkaran mesin dan peralatan berskala besar, kegiatan millwright, machine rigging dan jasa perakitan peralatan arena bowling.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(453, 0, '38301', 8, NULL, 0, 'DAUR ULANG BARANG LOGAM', 'mencakup usaha pengolahan barang bekas dari logam dan sisa-sisa barang logam menjadi bahan baku sekunder. Hasil dari daur ulang barang logam adalah bahan baku sekunder berbagai bentuk seperti potongan-potongan atau serpihan logam dan lainnya. Kegiatan pada mencakup pemisahan dan pemilihan sampah logam, penghancuran secara mekanik sampah logam, reduksi mekanik sampah logam, pembongkaran, pemotongan dan pengirisan sampah logam, pemotongan kapal dan alat apung lainnya (ship breaking) dan lainnya. Pembuatan barang logam baru yang menggunakan bahan baku sekunder, barang logam bekas dan sisa-sisa barang logam dimasukkan dalam kelompok industri yang sesuai.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(454, 0, '38302', 8, NULL, 0, 'DAUR ULANG BARANG BUKAN LOGAM', 'mencakup usaha pengolahan barang bekas dari bukan logam dan sisa-sisa barang bukan logam menjadi bahan baku sekunder. Hasil dari daur ulang barang bukan logam adalah bahan baku sekunder berbagai bentuk seperti potongan-potongan atau serpihan bukan logam dan lainnya. Kegiatan pada mencakup pemisahan dan pemilihan sampah bukan logam, reklamasi karet dan ban bekas, pemilihan plastik, pengolahan sampah plastik atau karet menjadi butiran, penghancuran, pembersihan dan pemilihan kaca, pengolahan minyak dan lemak bekas pakai menjadi bahan sekunder, pengolahan sampah makanan, minuman dan tembakau dan sampah non logam lainnya. Pembuatan barang bukan logam yang baru dari bahan baku sekunder, barang bekas bukan logam dan sisa-sisa barang bukan logam dimasukkan dalam kelompok industri yang sesuai.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(455, 0, '45201', 11, NULL, 0, 'REPARASI MOBIL', 'mencakup usaha reparasi dan perawatan mobil, seperti reparasi mekanik, reparasi elektrik, reparasi sistem injeksi elektronik, servis regular, reparasi badan mobil, reparasi bagian kendaraan bermotor, penyemprotan dan pengecatan, reparasi kaca dan jendela dan reparasi tempat duduk kendaraan bermotor. Termasuk reparasi, pemasangan atau penggantian ban dan pipa, perawatan anti karat, pemasangan bagian dan aksesori yang bukan bagian dari proses pembuatan dan usaha perawatan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(456, 0, '45407', 11, NULL, 0, 'REPARASI DAN PERAWATAN SEPEDA MOTOR', 'mencakup usaha pemeliharaan dan reparasi sepeda motor, termasuk pencucian sepeda motor dan usaha perawatan lainnya.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(457, 0, '61925', 10, NULL, 0, 'JASA PENYEDIA KONTEN MELALUI JARINGAN BERGERAK SELULER ATAU JARINGAN TETAP LOKAL TANPA KABEL DENGAN MOBILITAS TERBATAS', 'mencakup usaha jasa untuk menyediakan konten melalui jaringan bergerak seluler atau jaringan tetap lokal tanpa kabel dengan mobilitas terbatas yang pembebanan biayanya melalui pengurangan deposit prabayar atau tagihan telepon pascabayar pelanggan jaringan bergerak seluler dan jaringan tetap lokal tanpa kabel dengan mobilitas terbatas. Konten yang disediakan adalah semua bentuk informasi yang dapat berupa tulisan, gambar, suara, animasi, atau kombinasi dari semuanya dalam bentuk digital, termasuk software aplikasi untuk diunduh', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(458, 0, '62011', 10, NULL, 0, 'AKTIVITAS PENGEMBANGAN VIDEO GAME', 'mencakup kegiatan pengembangan video game, seperi kegiatan desain konsep game, pengembangan piranti lunak video game, pembuatan aset grafis, pembuatan animasi yang berkaitan dengan video game, pembuatan suara dan musik, pengujian video game, dan dukungan lainnya untuk video game', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(459, 0, '74100', 10, NULL, 0, 'AKTIVITAS PERANCANGAN KHUSUS', 'mencakup kegiatan penyediaan jasa perancangan khusus, seperti perancangan mode yang berhubungan dengan tekstil, pakaian jadi, sepatu, perhiasan, furnitur dan dekorasi interior lain serta barang mode lainnya seperti halnya barang pribadi atau rumah tangga; perancang industrial, yaitu penciptaan dan pengembangan desain dan spesifikasi yang mengoptimalkan penggunaan, nilai dan tampilan produk, termasuk penentuan bahan, konstruksi, mekanisme, bentuk, warna dan penyelesaian akhir permukaan produk, pendekatan kepada kebutuhan dan karasteristik manusia, keamanan, pengenalan pasar dan efisien dalam produksi, distribusi, penggunaan dan produksi; kegiatan perancangan grafis, kegiatan desainer interior dan kegiatan dekorator interior.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(460, 0, '82920', 6, NULL, 0, 'AKTIVITAS PENGEPAKAN', 'mencakup usaha jasa pengepakan atas dasar balas jasa (fee) atau kontrak, baik menggunakan atau tidak suatu proses otomatis. Termasuk pembotolan minuman dan makanan, pengemasan benda padat (blister packaging, pembungkusan dengan alumunium foil dan lain-lain), pengemasan obat dan bahan obat-obatan, pelabelan, pembubuhan perangko dan pemberian cap, pengemasan parsel atau bingkisan dan pembungkusan hadiah. Termasuk pengalengan dan sejenisnya. Jasa pengepakan untuk kegiatan pengangkutan dimasukkan dalam kelompok 52291 s.d. 52299 yang bersesuaian.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(461, 0, '95110', 10, NULL, 0, 'REPARASI KOMPUTER DAN PERALATAN SEJENISNYA', 'mencakup usaha jasa reparasi dan perawatan komputer dan peralatannya, seperti komputer desktop, laptop, disk drive magnetik, flash drives dan media penyimpanan lain, disk drive optik (CD-RW, CD-ROM, DVD-ROM, DVD-RW), printer, monitor, keyboard, mouse, joysticks dan trackball, modem komputer internal dan eksternal, terminal komputer, server komputer, scanner termasuk scanner bar code, pembaca smart card, virtual reality helmet dan proyektor komputer. Termasuk jasa reparasi dan perawatan terminal komputer seperti automatic teller machine (ATM), terminal point of sale (POS), yang tidak dioperasikan secara mekanik dan komputer genggam (PDA).', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(462, 0, '95120', 10, NULL, 0, 'REPARASI PERALATAN KOMUNIKASI', 'mencakup usaha khusus reparasi dan perawatan peralatan komunikasi, seperti reparasi perangkat telekomunikasi tanpa kabel (telepon seluler, RFID, computer tablet, computer genggam, modem nirkabel, alat pelacak kendaraan); reparasi perangkat telekomunikasi kabel (mesin FAX, pesawat telepon analog, ADSL/HDSL, PABX, modem, router, bridges); reparasi peralatan transmisi berbasis kabel (sentral telepon analog); reparasi perangkat transmisi radio (microwave link, studio To Transmitter Link/STL, Trans Horizon Link/Troposcatter); reparasi radio dua arah (komunikasi radio trunking, komunikasi radio konvensional, walky talky); dan reparasi perangkat pengirim dan/atau penerima radio/transceiver (perangkat pemancar TV siaran, pesawat Tv/smart TV, radio siaran, perangkat pemancar dan penerima jaringan bergerak seluler, dan kamera video).', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(463, 0, '95210', 10, NULL, 0, 'REPARASI ALAT-ALAT ELEKTRONIK KONSUMEN', 'mencakup usaha khusus jasa reparasi dan perawatan alat elektronik konsumen, seperti televisi dan radio penerima (termasuk pemasangan antena),, perekam kaset video (VCR), CD player dan kamera video jenis untuk pengguna rumah tangga.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(464, 0, '95220', 10, NULL, 0, 'REPARASI PERALATAN RUMAH TANGGA DAN PERALATAN RUMAH DAN KEBUN', 'mencakup usaha khusus jasa reparasi dan perawatan peralatan rumah tangga, seperti kulkas, kompor, mesin cuci, pengering pakaian, pendingin ruangan (AC), seterika listrik, alat penghisap debu dan berbagai barang/perabot listrik lainnya untuk keperluan rumah tangga. Termasuk jasa reparasi dan perawatan peralatan rumah dan kebun, seperti mesin pemotong rumput, edger, penyapu salju dan daun, trimmer dan sebagainya', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(465, 0, '95230', 5, NULL, 0, 'REPARASI ALAS KAKI DAN BARANG DARI KULIT', 'mencakup usaha khusus jasa reparasi alas kaki dan barang dari kulit, seperti sepatu, sepatu boot, sandal, koper, tas dan sebagainya. Termasuk jasa pemasangan tumit sepatu.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(466, 0, '95240', 3, NULL, 0, 'REPARASI FURNITUR DAN PERLENGKAPAN RUMAH', 'mencakup usaha khusus jasa reparasi furnitur dan perlengkapan rumah, seperti pelapisan, penyelesaian, reparasi dan pemulihan kembali perabot dan perlengkapan rumah termasuk perabot kantor dan perakitan perabotan self-standing.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1),
(467, 0, '95290', 6, NULL, 0, 'REPARASI BARANG RUMAH TANGGA DAN PRIBADI LAINNYA', 'mencakup usaha khusus jasa reparasi barang rumah tangga dan pribadi lainnya tidak diklasifikasikan di tempat lain, seperti sepeda, pakaian, perhiasan, jam tangan, jam dinding dan bagian-bagiannya, alat olahraga (kecuali senapan untuk olahraga), buku, alat musik, mainan dan barang sejenisnya, barang pribadi dan rumah tangga lainnya. Termasuk setem piano.', '2017-03-12 22:18:29', '2017-05-30 21:13:46', NULL, 1);
